INSERT INTO `cffacildescr` VALUES (1,'The CLARIN project is a large-scale pan-European collaborative effort to create, coordinate and make language resources and technology available and readily useable for the whole European Humanities (and Social Sciences) community. CLARIN will be built on and contribute to a number of key technologies coming from the major initiatives advancing the eScience paradigm, such as: Data Grid technology to connect the repositories as being implemented in the DAM-LR pilot project and web services the various centres provide; Digital Library to create Live Archives; Semantic Web technology to overcome the structural and semantic encoding problems and advanced multi-lingual language processing technology that supports cultural and linguistic integration.','HUMAN',1,'en');
