INSERT INTO `cfprojabstr` VALUES (1,'The European Spallation neutron Source (ESS) will be the world s most powerful source of neutrons. Its design parameters makes it the most cost-effective top tier source for 40 years or more. A genuine pan European facility, it will serve a user community of 5,000 users annually across many areas of science and technology. Neutron beams produced by reactors are inherently intensity-limited. The ESS R&D and design phase (>50 M ; all major European labs, >100 top scientists) has shown the feasibility of MW spallation sources. In line with the global neutron strategy endorsed by OECD ministers in 1999, the US has now commissioned its facility, based on an early ESS design, and Japan will follow suit in 2008. The initial long pulse configuration of ESS provides substantially higher power, maximum complementarity and the largest instrument innovation potential. Its technical layout guarantees a long-term top position. ESS will also offer new modes of operation and user support to maximally facilitate industry, in addition to university and research lab users. At present, two official bids for siting with a financial contribution in excess of 320M have been made by Spain (Bilbao) and Sweden (Lund). Hungary is expected to come forward with a similar bid soon. From the technical side the ESS is mature and detailed construction design work could start immediately after a positive decision has been taken. The cost issue (WP5) was very carefully assessed in the past and only needs final updating and inclusion of the decommissioning costs. Strategic, legal and governance issues have been investigated by the several possible sites. This information will be updated and collated (WPs 4,6,7). WP 8 will deal with Health, Safety and Environmental questions arising from possible different target materials (WP 9). WPs 1 and 2 concerns the management and the coordination of the project, respectively, and WP 3 the project assessment by an external Advisory Committee.','HUMAN','en',202247),(2,'To face the increase in the complexity of facilities, and the cost and technical demands in a global context of international user groups and expertise, 18 European funding Agencies representing 14 countries have decided to submit an ERANET project to provide Europe with a more coherent funding of its Nuclear Physics Infrastructures and equipments. The project will ensure exchange of information, the definition of joint activities, and their launch through one or more concrete pilot actions. The success of the activities within the scope of the project will be a major achievement in the field and will have a strong impact on the present and future European landscape of Research Infrastructures.','HUMAN','en',202914),(3,'Structural biology in the next two decades aims to integrate structural knowledge at different resolution levels into specific cellular contexts, with a temporal component, to underpin biomedical sciences. This challenge requires the seamless integration of techniques providing information in different resolution ranges. INSTRUCT will link the information obtained by the major structural biology methods with state-of-the art cell biology techniques to provide a dynamic picture of key cellular processes at all scales.\n\nMajor technology advances, from high throughput methods in protein production, though NMR and X-ray crystallography to electron microscopy mean that major investment in infrastructure is required to maintain European competitiveness. The preparatory phase of INSTRUCT will forge a pan-European structure comprising a number of Core Centres, with broad infrastructure provision, an appropriate number of Associate Centres, with complimentary expertise and establish the mechanisms for establishing National Access Holder Communities of users and rules for access. The development of cutting-edge infrastructure will be energised by a focus on a few key biomedical questions and environment problems.','HUMAN','en',211252),(4,'In the last 5 years the Science Case for a European Extremely Large Telescope, has been established by the European astronomical community. In 2010 the E-ELT Project shall be ready for decision to build, with in particular a detailed scientific Design Reference Mission, a secured site, reliable expected performance, cost and timeline, analysis of the project risks and associated mitigation plans and a confirmed funding scheme. There are a number of transnational activities which are suited for this Preparatory phase. Besides E-ELT Prep Management, there are: International Cooperation aim is to find external partners for the E-ELT development.\n\nIndustrial Links will strengthen the links with the industrial partners and establish policies on connected issues, e.g. development standards, public relation and knowledge transfer. Design Reference Mission objective is to develop a comprehensive set of observing proposals, in particular to maintain the alignment of the E-ELT Project with its community scientific aspirations and explore its synergies with other large astronomical facilities. Science Access Strategy will define the strategy and requirements for the Telescope Operation and for data access by its Users in order to maximize the Facility scientific impact.','HUMAN','en',211257),(5,'The successful demonstration of single-pass free electron lasers (FEL) around the year 2000 triggered a number of research centres in Europe, the United States and Asia to initiate the construction of new research infrastructures. These projects are based on strong science cases put forward by interested research communities. The new FEL sources combine the wide and continuously tunable wavelength range of synchrotron radiation with ultra-short pulses and coherence of lasers, but at much higher peak and average power, offering completely new research opportunities in different areas of science for a large research community. Several European countries are supporting the construction of national FEL facilities which are now combining their forces and coordinating their activities to build and operate a distributed European facility, the IRUVX-FEL. This facility will be able to offer a suite of complementary sources and instrumentation that is unsurpassed in the world. The main objective of the IRUVX-FEL Preparatory Phase is the integration of the national FEL facilities into a distributed European FEL facility in order to fully exploit the complementary features and expertise of the individual member facilities and to maximise the benefits for both the member facilities and the users. This includes the agreement and implementation of structures and methods that allow efficient construction and operation of the IRUVX-FEL facility, and the preparation of critical technology ensuring that all member facilities will be exploited with highest efficiency. The access to this world-class facility will be facilitated by transparent and coordinated access policies and procedures agreed by the IRUVX-FEL consortium. The present proposal includes all the necessary preparatory work to build this consortium with the goal to offer world-class service in response to the needs formulated by the research community.','HUMAN','en',211285),(6,'eInfrastructure in Europe has reached a mature state where the GEANT network forms a backbone on top of which a distributed computing infrastructure - the Grid - provides processing and storage services for eScience research. The South-East European eInfrastructure initiatives are committed to ensuring equal participation of the less-resourced countries of the region in European trends. SEEREN initiative has established a regional network and its GEANT connection and the SEE-GRID initiative the regional Grid. Hereby proposed SEE-GRID-SCI will leverage the SEE eInfrastructure to enable new scientific collaborations among SEE user communities.\n\nSEE-GRID-SCI will stimulate widespread integrated eInfrastructure uptake by new cross-border user groups extending over the region, fostering collaboration and providing advanced capabilities to more researchers, with an emphasis on strategic groups in seismology, meteorology and environmental protection. The initiative thus aims to have a catalytic and structuring effect on a variety of user communities that currently do not directly benefit from the available eInfrastructures. In parallel, it will enlarge the regional eInfrastructure to cater for demands of the communities: a number of new Grid clusters and countries will be added, engaging a wider range of players and expanding the provider pool. Finally, SEE-GRID-SCI will help mature and stabilise the National Grid Initiatives in the region, allowing them to join the new era of longer-term sustainable Grid infrastructure in Europe. In this context, SEE-GRID-SCI will aim to attract political and financial support for materializing the eInfrastructure vision.\n\nIn longer term, SEE-GRID-SCI aspires to contribute to the stabilisation and development of South-East Europe, by easing the digital divide and stimulating eInfrastructure development and adoption by new user communities, thus enabling collaborative high-quality research across a spectrum of scientific fields.','HUMAN','en',211338),(7,'The Life Watch e-Science and Technology Infrastructure for biodiversity data and observatories will be a large-scale European research infrastructure bringing together:\n-a system of marine, terrestrial and freshwater observatories;\n-common access to a huge amount of interlinked, distributed data from databases and monitoring sites;\n-computational facilities in virtual laboratories with analytical and modelling tools;\n-targeted user and training support and a programme for public services.\n\nThe biodiversity research infrastructure will open up new and exciting research opportunities, and will help to enhance the understanding and sustainable management of our natural environment. This preparatory project brings together the interested EU Member and Associated States with the objective to prepare a cooperation agreement on the construction and maintenance of the Life Watch research infrastructure. In addition, the leading networks in biodiversity science and stakeholder institutes are preparing the organisation and logistics for the following construction phase. The current project delivers the technical, legal and financial preparations required for entering and managing the Construction Phase.','HUMAN','en',211372),(8,'Subject of this EU project is the implementation of the FAIR GmbH for the construction of the new research infrastructure FAIR. The \"Facility for Antiproton and Ion Research\" is an integrated system of particle accelerators which will provide high energy and high intensity beams of ions from antiprotons to uranium with unprecedented quality for basic research in different fields of physics. The total costs of the FAIR project is 1002 M? (investment) and 185 M? for personnel. Under the supervision of the International Steering Committee the scientific and technical preparations of the project have been evaluated and completed. The necessary legal documents for the establishment of international company FAIR GmbH have been worked out. This EU project concentrates on activities which still have to be successfully completed for the implementation of the FAIR project. The most important task is to achieve an agreement on financial / In-kind contributions to the construction of the facility between the 14 FAIR Member countries and the signing of the Convention, the intergovernmental agreement for FAIR. The Work packages of this proposal are legal issues, finances, governance, FAIR line-management and project management, coordination of research and coordination of accelerator. These activities cover also the start-up phase of the FAIR GmbH, until the FAIR project is successfully implemented. The participants of this application are 12 ministries or funding agencies and 14 research institutions. The activities, subject of this EU project, will be performed by the international project team \"FAIR Joint Core Team\".','HUMAN','en',211382),(9,'Medically related Life Sciences use the mouse as a model system to understand the molecular basis of health and disease in humans (>95% similarity of genes in humans and mice). An essential task for Biomedical Sciences in the 21st century will be the functional analysis of mouse models for every gene in the mammalian genome. The major bottlenecks identified by the user community will be proper characterization (Mouse Clinics), archiving and dissemination of mouse disease models to the research laboratories.\n\nThe current capacities, governance structures and funding strategies of existing infrastructures will not be able to serve the upcoming urgent needs. Thus it is imperative to organise and establish now an efficient distributed infrastructure for the phenotyping, archiving and dissemination of mouse models on a well concerted, large-scale and pan-European level. This will be a prerequisite for maintaining Europe s leading role in the functional annotation of the mouse genome. Infrafrontier will guarantee the accessibility of mouse models and will be essential to facilitate their exploitation. Infrafrontier integrates 15 European laboratories with exceptional track records to implement and run large-scale infrastructures.','HUMAN','en',211404),(10,'ESFRI has identified High Performance Computing (HPC) as a strategic priority for Europe. Scientists and engineers must be provided with access to capability computers of leadership class in Europe to remain competitive internationally and to maintain or regain leadership. Supercomputers are an indispensable tool to solve the most challenging problems through simulations.\n\nPACE, the Partnership for Advanced Computing in Europe, has the overall objective to prepare the creation of a persistent pan-European HPC service, consisting of three to five centres, similar to the US HPC infrastructure. PACE will be the tier-0 level of the European HPC ecosystem. It will build on the experience of the partners and use concepts and services from EC-funded projects like GEANT2 and DEISA.\n\nThe hosting centres of the planned tier-0 systems will provide the expertise, competency, and the required infrastructure for comprehensive services to meet the challenging demands of excellent users from academia and industry.\n\nPACE will prepare for the implementation of the infrastructure in 2009/2010 by defining and setting up a legal and organisational structure involving HPC centres, national funding agencies, and scientific user communities to ensure adequate funding for the continued operation and periodic renewal of leadership systems, coordinated procurements, efficient use and fair access.\n\nIn parallel PACE will prepare the deployment of Petaflop/s systems in 2009/2010. This includes the procurement of prototype systems for the evaluation of software for managing the distributed infrastructure, the selection, benchmarking, and scaling of libraries and codes from major scientific user communities, the definition of technical requirements and procurement procedures, as well as collaborations with the European IT-industry to influence the development of new technologies and components for architectures that are promising for Petaflop/s systems to be procured after 2010.','HUMAN','en',211528),(11,'The European Synchrotron Radiation Facility (ESRF), supported by 18 European countries, is a storage ring based X-ray source, which provides the research user community with world-class experimental stations, exploiting the unique properties of synchrotron radiation for research in a large variety of fields.\n\nIn order to maintain its leading role and to respond to the emerging scientific challenges, the ESRF is envisaging an ambitious Upgrade Programme, comprising\n- the extension of the experimental hall to enable the construction of new and upgraded beamlines with largely improved performance and new scientific opportunities, as well as improved infrastructures for the preparation of experiments,\n- a programme of improvements of the accelerator complex, and\n- the development of productive science and technology driven partnerships.\n\nThe most ambitious project in this context is the creation of a European high magnetic field laboratory on the common ESRF/ILL site. The objectives of the proposal are to prepare the implementation of this Upgrade Programme. Key activities shall be centred around the discussion and definition of the individual scientific and technological projects, as well as the examination of the consequences on the local site infrastructure in terms of access, buildings and environment.','HUMAN','en',211549),(12,'The ICOS project will build an infrastructure for co-ordinated, integrated, long-term high-quality observational data of the greenhouse balance of Europe and of adjacent key regions of Siberia and Africa. Consisting of a centre for co-ordination, calibration and data in conjunction with networks of atmospheric and ecosystem observations, ICOS is designed to create the scientific backbone for a better understanding and quantification of greenhouse gas sources and sinks and their feedback with climate change.\n\nThe overarching objectives of ICOS are:\n- To provide the long-term observations required to improve understanding of the present state and future behaviour of the global carbon cycle and greenhouse gas emissions, and the factors that control the changing atmospheric composition in greenhouse gases.\n- To monitor and assess the effectiveness of carbon sequestration and/or greenhouse gases emission reduction activities on global atmospheric composition levels, including attribution of sources and sinks by region and sector at atmospheric and ecosystem level.\n\nThese objectives will be achieved by: Establishing a central facility, the ICOS-centre, which is responsible for co-ordination, calibration and data handling.','HUMAN','en',211574),(13,'The grand vision for the Digital Research Infrastructure for the Arts and Humanities (DARIAH) is to facilitate access to research material for the humanities and for supporting the preservation of digital heritage material in Europe. DARIAH connects information users (researchers), information managers and information providers. It gives them a technical framework that enables enhanced data sharing among research communities.\n\nResearchers can use DARIAH to: find and use a wide range of digital content from across Europe, and the tools that aid their interpretation and use; ensure the long-term preservation of data; ensure that they work to accepted standards and following best practice; seek advice, and exchange ideas and knowledge on all aspects of digital scholarship; use DARIAH as a place for experimentation and innovation in collaboration with other scholars from across multiple domains. The core strategy of DARIAH is to bring together national, regional and local endeavours to form a coherent infrastructure where complementarities and new challenges are clearly identified and acted upon. The initial idea for DARIAH has now grown into a clear vision shared by many and it is time to make this vision concrete.','HUMAN','en',211583),(14,'The Euro-Argo infrastructure will be a major component of the Argo global in situ ocean observatory. The Argo network is a global array of autonomous instruments measuring temperature and salinity over the upper 2000 m of the ocean. Argo is an indispensable component of the Global Ocean Observing System required to understand and monitor the role of the ocean in the Earth\'s climate system. Argo must be considered in its ensemble: not only the instruments, but also the logistics necessary for their preparation and deployments, field operations, the associated data streams and data centres.\n\nEuro-Argo will develop and progressively consolidate the European component of the global network. Specific European interest also requires a somewhat increased sampling in regional seas. Overall, the Euro-Argo infrastructure should comprise 800 floats in operation at any given time. The maintenance of such an array would require Europe to deploy about 250 floats per year. The main objective of the Euro-Argo preparatory phase will be to undertake the preparatory work needed to ensure that by 2010 Europe will be able to deploy and operate an array of 800 floats and to provide a world-level service to the research (climate) and environment monitoring (e.g. GMES) communities.','HUMAN','en',211597),(15,'The objective of the ELIXIR preparatory phase is to produce a memorandum or memoranda of understanding between organisations (government agencies, research councils, funding bodies and scientific organisations) within the member states, with the purpose of constructing a world class and globally positioned European infrastructure for the management and integration of information in the life sciences.\n\nTo achieve this, we will address the following tasks and issues:\n1 Define the scope of the infrastructure, its role and benefits\n2 Define an appropriate governance and legal structure\n3 Define a long term funding structure to provide a sustainable infrastructure\n4 Define the requirements for the European Data Centre in the next 5-10 years and makes plans to meet these needs\n5 Involve all relevant stakeholders, including users, data providers, tools providers to ensure that the infrastructure meets their needs\n6 Explore integration and interoperability between core and specialised data resources and the development of standards in newly emerging fields\n7 Define the critical interdisciplinary links that need to be forged between the biological and related scientific disciplines, including medicine, agriculture and the environment\n8 Define the needs of related European industries\n9 Define a training strategy to ensure that Europe effectively exploits all the available information\n\nThe specific activities of the preparatory phase will include:\nA Holding stakeholder meetings to bring together national representatives, key scientific opinion and funding organisations.\nB Establishing working parties, supported by technical feasibility studies where appropriate, to address the tasks and issues above with final reports at month 18.\nC Consolidating these reports into a management and funding proposal to be sent to member states and funding agencies with draft MoU by month 38 and to seek agreement on the MoU and establish an Interim ELIXIR Board by month 50.\nD To establish the detailed organization of ELIXIR; and to draft and work toward the signing of the ELIXIR International Consortium Agreement','HUMAN','en',211601),(16,'The objectives of the Preparatory Phase of the European X-ray Free-Electron Laser Facility are: a) to provide the technical, legal and financial documents which are necessary for the foundation of this new research infrastructure in Europe. b) to advance as far as possible in the specification, research and development, prototyping and industrialization of buildings, technical infrastructure, technical components, in order to start the construction phase with maximum probability to conclude it succesfully on time and budget. c) to mobilize the potential users community, which is multidisciplinary and possibly composed by scientists experienced with synchrotron light sources, with ultrafast lasers, and ultrafast electron diffraction. As far as the objectives a) are concerned, the Technical Design Report is completed, and nearly final drafts of the Convention and of the Articles of Association are available. Still missing are the basic contractual framework to regulate in-kind contributions from participating countries, and the framework contract regulating the relationship between the new international facility and the host laboratory (DESY), which are among the deliverables of the present proposal (Work Packages 4 and 5). As far as the objectives b) are concerned, the work is very advanced for accelerator and infrastructure design, where DESY personnel is engaged; for instrumentation and experiments development, the necessary personnel is lacking. One goal of this proposal is the immediate recruitment of an international staff, supported by the EC funding, in order to advance in this domain, and to impress a strong international flavour to the enterprise, which has been so far mostly carried out as a DESY activitity (Work Package 3). As far as the objectives listed under c) are concerned, with support from this proposal we plan to hold 9 workshops over the next 4 years, plus three annual Users meetings (Work Package 2).','HUMAN','en',211604),(17,'The EGI Design Study represents a project for the conceptual setup and operation of a new organizational model of a sustainable pan-European grid infrastructure. The project will address key questions concerning the assessment of technical and financial feasibility of such a sustainable grid service, producing a \"conceptual design report\" addressed at member state policy makers and funding agencies. The project will interact and encourage the member states to make the strategic decisions required to establish and support a sustainable grid infrastructure, and initiate its implementation.\n\nEurope has developed a scientific grid infrastructure in and across many member states which is being used by many research communities. This has come about by investments from member states into national resources as well as by the European Commission with project awards for European flagship projects such as EGEE (Enabling Grids for E-sciencE) and support projects to develop interoperable middleware technologies and co-ordination mechanisms. At present and on a project-basis, this production service infrastructure cannot be sustained indefinitely, and there is a clear need to establish a long term technical and financial structure. This need is confirmed by a series of recommendations from the e-Infrastructure Reflection Group (e-IRG), and the European Grid Initiative (EGI) represents the coordinated effort to advance on this matter.\n\nThe EGI Design Study will identify the conditions and develop the framework for a sustainable Grid infrastructure which should take over the coordination and operation of the future European grid infrastructure from today\'s projects. The design study will foster the emergence of a new organisational model designed to consolidate a sustainable approach to e-Infrastructures, in particular in the domain of grids, facilitating new service provisioning schemes, more application neutral and open to all user communities and resource providers.','HUMAN','en',211693),(18,'Aim of this proposal is to deploy e-Infrastructures (EC-funded MammoGrid and AddNeuroMed\'s NeuBase) to enable the European neuroscience community to carry out research required for the pressing study of degenerative brain diseases to build a new user-friendly Grid-based research e-Infrastructure (neuGRID), where the collection/archiving of large amounts of imaging data is paired with computationally intensive data analyses.\n\nThis proposal will initially provide neuroscientists with the capability to identify neurodegenerative disease markers through the analysis of 3D magnetic resonance brain images via the provision of sets of distributed medical and Grid services and later to provide a general, expandable infrastructure of services for other medical applications. neuGRID will be compliant with acknowledged EU and international standards regarding data collection, data management, and Grid construction. Of the two deployed infrastructure, MammoGrid will provide knowledge related to the middleware and upperware that will allow applications to talk to the Grid, and AddNeuroMed that related to the collection/archiving/retrieval of multicentre clinical data, biomedical images and computerized image analysis.\n\nKey research challenges will be: the gridification of algorithm pipelines for brain image analysis, the development of a mid-layer of services between user-facing and grid-facing services to make the infrastructure expandable to a number of algorithm pipelines, and testing and validation of the prototype infrastructure. neuGRID aims to become the \"Google for Brain Imaging\", providing a centrally-managed, easy-to-use set of tools with which scientists can perform analyses and collaborate.','HUMAN','en',211714),(19,'Grid systems are currently being used and adopted by a growing number of user groups and diverse application domains. However, there still exist many scientific communities whose applications require much more computing resources than existing Grids like EGEE can provide.\n\nThe main objective of this project is to support these new communities:\n- by providing the necessary extensions for existing Grid infrastructures to address the specific needs in these new scientific communities within a coherent pan-European model, regardless of the location of their research facilities\n- with the adaptation of their applications to the enhanced Grid infrastructure\n- through the provision of standard APIs and Grid application development tools that facilitate the adaptation of their application to the enhanced Grid infrastructure.\n\nIn order to support the specific needs of these scientific communities EDGeS will interconnect the existing EGEE Grid infrastructure with existing Desktop Grid (DG) systems in a strong partnership with EGEE. Service Grids (SGs) like EGEE are more flexible than DGs and can accommodate a broader variety of applications, however, they are much more expensive to maintain. Desktop Grids are currently restricted solely to Master/Worker-style compute-intensive applications but can scale very easily and are able to collect 1-2 orders of magnitude more compute power than most SGs are able to, and at a fraction of the cost. The interconnection of these two types of Grid systems will enable more advanced applications and provide extended compute capabilities to more researchers.\n\nOne other objective of EDGeS is to extend the potential user communities for both Grids and Desktop Grids beyond traditional scientists and current volunteer computing participants to further involve ordinary citizens, secondary school students, and company employees, giving them an opportunity to become involved in science and to apply Grid technology in their every day life.','HUMAN','en',211727),(20,'HiPER is a multi-national laser facility designed to allow Europe to take a leading position in the pursuit of Inertial Fusion Energy, whilst offering an internationally unique capability for science in extreme conditions. It will open up entirely new areas of research, providing access to physics regimes which cannot be explored on any other science facility. It has been formally endorsed by 7 European nations at the governmental or national funding agency level, 2 regional governments, over 20 scientific institutions and has direct involvement from industry.\r\n\r\nInertial Fusion Energy (IFE) lies at the heart of the design of HiPER. Fusion is the holy grail of energy sources combining abundant fuel with no greenhouse gas emissions, minimal waste products, and a scale that can meet mankind s long-term energy demands. Fusion combines hydrogen isotopes to create helium gas and a neutron which is captured to provide heat for a steam turbine. The IFE solution for fusion is a proven scientific concept. A laboratory demonstration of net energy production using lasers for IFE is now only 3 years away, marking the culmination of 40 years research.','HUMAN','en',211737),(21,'European clinical research needs an integrated and distributed infrastructure able to provide efficient support to multinational clinical trials, taking advantage of the European population and competencies, unlocking latent expertise and patients scattered across the EU member states. ECRIN (European Clinical Research Infrastructures Network) is designed to bridge the fragmentation of clinical research in Europe through the connection of national networks of clinical research centres and clinical trial units.\n\nParticipants are currently Austria, Denmark, Finland, France, Germany, Hungary, Ireland, Italy, Spain, Sweden, Switzerland, the United Kingdom, and the EORTC. It will provide integrated, one-stop shop services to investigators and sponsors in multinational studies (patient recruitment and investigation, data management, GMP manufacturing of biotherapy products, quality assurance, monitoring, ethics, regulatory affairs and adverse event reporting).','HUMAN','en',211738),(22,'This project concerns the study and the conceptual design for a new infrastructure that will bring Europe to the forefront of the most promising new development in our quest to understand the history and future of the Universe, the emergence of the field of Gravitational Wave Astronomy. We are proposing to study the conceptual design of a new European infrastructure, a GW observatory that could cover the complete frequency range from about 1Hz to 10kHz that is potentially observable from ground.\n\nWe are aiming at the identification of the possible technologies and design characteristics that could lead to an amplitude sensitivity more than a hundred times that of the existing first generation devices. This will increase the observable volume of the universe and, correspondingly, the event rate by a factor of more than one million. This formidable task will be achieved by combining all presently known scientific breakthroughs of measurement science in a single observatory.','HUMAN','en',211743),(23,'Climate science plays an increasingly important role for European policy-makers and private sector companies. Basic research and development of effective strategies to mitigate climate change and deal with its impact on society are required, involving a wide range of experts from multiple disciplines. These expert need to access climate data, in particular data from model projections for the next decades and centuries, and to assess the suitability of that data for their purposes. Currently, even if large repositories of climate data are accessible, these repositories are poorly connected and described. The data is therefore difficult to understand, compare and exploit because there is no common information paradigm.\n\nThe main objective of METAFOR is to define a Common Information Model (CIM) that describes in a standard way climate data and the models that produce the data. METAFOR will build on existing metadata (data describing data) currently used in existing data repositories and address issues like metadata fragmentation, gaps, or duplication. In close interaction with related initiatives at the international level, METAFOR will propose solutions to identify, access and use the climate data in these repositories. To support the adoption of the CIM, METAFOR will build CIM-based tools and services, allowing specific data and models to be found and compared between holdings at partner sites. METAFOR will therefore optimise the way climate data infrastructures are used to store knowledge, thereby adding value to primary research data for an increasingly wide range of stakeholders.\n\nMETAFOR will take the first step in doing for climate data what search engines have done for the Internet: it will put users of climate data in touch with the information they need. Simply unlocking existing climate data repositories for new communities will provide new exciting opportunities for scientific research, policy making, and private sector competitiveness.','HUMAN','en',211753),(24,'The ERICON-AB project will generate the strategic, legal, financial and organisational frameworks required from National Governments and the European Commission to commit financial resources to the construction and running of the European Polar Research Icebreaker AURORA BOREALIS. Scientific management frameworks will be assessed including mechanisms to handle dedicated large-scale multi-year or special mission specific research programmes.\n\nThe strategic integration of the facility into the fabric of the European Research Area shall be achieved by connecting the national research priorities and the demand of ship time of the stakeholder countries with a European level facility. The relevance of the facility in promoting science and technology cooperation with EU strategic partner countries such as the Russian Federation will be specifically analysed. Deliverables will focus on moving the project from the preparatory phase to the construction phase by addressing key barriers especially in relation to engineering financial models that allow the mixed participation of EU member states and Non-EU partner countries. Consortium partners and legal experts will develop the legal/political frameworks for joint ownership and operation of a multi-country research facility.\n\nA dedicated legal implementation structure for managing and operating the AURORA BOREALIS will be proposed and its connection with other existing research assets such as Polar Stations, air support and supporting satellite assets will be analysed. The final deliverables of this project will be concerned with reaching a decision point and agreement with nations ready to move forward with the construction phase. It is anticipated that a series of natural decision points for agencies/governments to pass on their individual degree of integration into the project will be programmed in to the ERICON - AB Stakeholder councils meetings.','HUMAN','en',211796),(25,'ITER is the next generation of fusion devices and is intended to demonstrate the scientific and technical feasibility of fusion as a sustainable energy source for the future. To exploit the full potential of the device and to guarantee optimal operation for the device a high degree of physics modelling and simulation is needed already in the current construction phase of the ITER project.\n\nFirst principles modelling tools that are needed for an adequate description of the underlying physics cover both a wide range of timescales and spatial orderings and are in general very demanding from a computational point of view. Current modelling activities relies on local or national computational resources and an improved access to computing infrastructures will be instrumental in advancing a pan-European modelling activity for ITER to a very competitive status in relation to the ITER partners.\n\nThe EUFORIA project will provide a comprehensive framework and infrastructure for core and edge transport and turbulence simulation, linking grid and High Performance Computing (HPC), to the fusion modelling community. The project will enhance the modelling capabilities for ITER and DEMO sized plasmas through the adaptation, optimization and integration of a set of critical applications for edge and core transport modelling targeting different computing paradigms as needed (serial and parallel grid computing and HPC). Deployment of both a grid service and a High Performance computing services are essential to the project.\n\nA novel aspect is the dynamic coupling and integration of codes and applications running on a set of heterogeneous platforms into a single coupled framework through a workflow engine a mechanism needed to provide the necessary level integration in the physics applications. This strongly enhances the integrated modelling capabilities of fusion plasmas and will at the same time provide new computing infrastructure and tools to the fusion community in general.','HUMAN','en',211804),(26,'This three-year design study will assess the feasibility of providing an infrastructure for research into citizenship, political participation, and electoral democracy in the European Union (EU). Such an infrastructure would endow the social science community with the most essential information required for a recurrent audit of the most important aspects of the electoral process in the European Union. Since elections are crucial instruments of popular control, elite accountability, and popular representation, auditing these processes is seen as good practice in a number of democracies.\n\nSuch audits empirically assess the nature of electoral processes and detect challenges and threats to the quality of these processes. The infrastructure project that we propose to design focuses on data which, if not collected at the time of an election, will either be lost or will be recorded in a manner incompatible with the way in which other relevant data have been recorded, making the complete picture unavailable for future research. At the EU s supra-national level, democratic rules and procedures are not yet well established and the institutions of multi-level governance are repeatedly renegotiated and adapted. Auditing the quality of the electoral process at the EU-level is therefore essential.','HUMAN','en',211810),(27,'The European Multidisciplinary Seafloor Observation - Preparatory Phase (EMSO-PP) is a 4-year project with the main objective of establishing the legal and governance framework for EMSO, an infrastructure servicing scientists and other stakeholders in Europe and outside Europe for long-term deep water observation and investigation. The Preparatory Phase will handle all further actions towards the actual realisation of the infrastructure and its long-term management.\n\nMoreover, it will promote the catalytic process and synergic effort at EC and national levels, coordinating and harmonising all the resources made available, in link with the Network of Excellence ESONET. One peculiarity of the EMSO infrastructure, among the ones indicated within ESFRI, is that it is geographically distributed around European waters from the Arctic to the Mediterranean Sea EMSO cabled deep-sea observatories deployed on specific sites will allow as a basic scientific objective to make real-time long-term monitoring of environmental processes in the geosphere, biosphere and hydrosphere of European seas. The observatories will be organised in a unique management structure at European level which is part of an international endeavour in seafloor observatories.','HUMAN','en',211816),(28,'The Survey of Health, Ageing and Retirement in Europe (SHARE) has been selected by the ESFRI roadmap process as one of the 35 crucial pillars of the European Research Area. This project will prepare a major upgrade of SHARE for all 27 EU members plus associated Switzerland and Israel during the decade 2010-2020. SHARE builds an infrastructure of micro data necessary to understand individual and societal ageing as a process in time that is strongly influenced by pension, health care and labour market regimes and their reforms. It is designed by researchers for researchers and integrates economics, medicine, and social sciences. Research based on this infrastructure will also serve as a feedback mechanism to support fact-based EU policies, such as the open method of coordination and the Lisbon agenda, to help meeting the challenges of population ageing in all countries of the EU. The major upgrade of SHARE will have two dimensions. First, it will prolong SHARE over time and generate a genuine panel that follows individuals as they age and react to the changes in the social and economic environment. From a research viewpoint, the time dimension is crucial since ageing is a process that can only be understood if we observe the same individual at different points in time. Second, SHARE will expand to all EU member states. Ageing in the accession states is a particular challenge as these countries are ageing before their social and health institutions are brought to the same level of maturity as in the EU15 countries. Aim of the preparatory phase is to bring the SHARE prototype to the level of financial, legal, governance and technical maturity required to fill important knowledge gaps in individual and population ageing. It involves all stakeholders necessary for the major upgrade, among them research institutes and universities; national science ministries and foundations; two Directorates General of the European Commission; and the U.S. National Institute on Aging.','HUMAN','en',211909),(29,'It has become increasingly obvious that concepts and strategies for research infrastructure (RI) funding should be harmonised and coordinated within the EU. ESFRI has determined requirements for European RI funding and has presented a roadmap. Growing attention is paid to life sciences that rely on RIs of a less centralised, but more networked dimension. There is a clear need for action in the interdisciplinary area between physics, chemistry, biology and medical sciences as cutting edge instrumentation becomes increasingly expensive and, yet, indispensable for world-class research.\n\nHowever, promotion of research policies, apart from the ESFRI projects, has been restricted so far to national efforts without managing these actions with a European view. Funding and research organisations can not afford to remain at the national stage with world-wide competition for the best scientists and the most promising projects. Frontier research is international since long and funding organisations have to follow scientists to the European level. ERA-Instruments aims at initiating coordination and a sustainable network of ministries, charities, funding agencies and research councils active in funding of life science RI.','HUMAN','en',211928),(30,'The main objective of the project is to design the conceptual scheme of a research infrastructure supporting the networking of centres for high-quality research in Slavic lexicography, fostering their scientific capacity, integrating their digital resources and opening them up to the European academic community. The project will provide strategies for the coordination, unification and extension of existing digital lexical resources and the creation of new ones, in accordance with the recent advances in the field and the international standards. This will ensure their reusability and interoperability, so that researchers in humanities and social sciences as well as business will have easy access to digital bi- and multilingual dictionaries of Slavic languages. Thus the project will contribute to preserving and supporting the multilingual and multicultural European heritage. In more distant perspective we envisage the creation of a general lexical data base with the possibility of searching entries in any Slavic language, with information on the words? etymology and correspondences in all Slavic languages and in English. The data base will possess a rich system of links between forms and meanings of words in synchrony and diachrony. An interactive Web portal will enable the supervised extension of the data base by the end users (Wiki-style) and ensure fast growth and relevance to the users? needs. The partners in the project are research organisations from six European countries whose six national languages belong to the Slavic group: Bulgaria, Poland, Russia, Slovakia, Slovenia and Ukraine. All partners are national centres for high-quality research in lexicography and digital resources. Each partner is responsible for coordinating a part of the work matching their specialisation and experience. The six thematic working groups are designed as fora for discussing specific parts of the project, and the work programme provides a detailed breakup of the task in time.','HUMAN','en',211938),(31,'The European Theoretical Spectroscopy Facility addresses an important need of European science and technology by providing experimental, industrial and other researchers with access to state-of-the-art computer simulation tools for electronic excited states in matter, together with high-quality support from ETSF personnel, mirroring the massive progress in the power and resolution of new European experimental facilities.\n\nAll domains that need knowledge about electronic excitations, transport and spectroscopy will benefit from the ETSF, such as condensed matter physics and chemistry, biology, materials science and nanoscience, atmospheric science, and astrophysics. The ETSF provides users with computer codes, background knowledge, customised support and development, training, and collaborators to enhance their studies of the electronic and transport properties of complex or nanoscale materials. Its focus is on the rapid transfer of ground-breaking fundamental knowledge of matter, at the quantum-mechanical level, to detailed understanding and future-oriented design of prototypical or technologically relevant systems.\n\nThe ETSF has been successfully designed and recently brought into operation by the Nanoquanta Network of Excellence with the support of national and local institutions. In the present ETSF-I3 project, the ETSF is partnered by the Barcelona Supercomputing Centre to create a framework for deploying the ETSF infrastructure to a much wider range of users, through user training and projects supported by ETSF scientists.\n\nThe ETSF-I3 project will monitor the scientific and technological needs of users, and will boost the user-oriented development of ETSF software, algorithms and libraries made available on the most advanced computational platforms. ETSF-I3 will be crucial to keep the ETSF at the forefront of knowledge and establish it as the world-wide reference centre for modelling of electronic excited states.','HUMAN','en',211956),(32,'Founded in 1967, the Institut Laue-Langevin (ILL) is an international research centre at the leading edge of neutron science and technology. As a central facility, the ILL provides access to instruments that use low-energy neutrons of unequalled quality and breadth to a community of many thousands of researchers throughout Europe and beyond. The ILL has occupied this leading position for 35 years. In order to keep the ILL at the forefront of neutron science and to provide the best possible experimental facilities and support to its European users over the next two decades, the Institute needs to modernise its infrastructure and instrument suite. This is the scope of the proposed ILL20/20 upgrade programme, which can be summarised as follows: (i) improving neutron moderators and delivery systems; (ii) planning and prototyping new instruments and neutron technologies; (iii) strengthening the links with the European Synchrotron Radiation Facility (ESRF), creating partnerships for science and joint scientific facilities accessible to ILL and ESRF users; (iv) developing the site shared by the ILL, the European Molecular Biology Laboratory (EMBL) and the ESRF. This proposal aims at optimising the preparatory phase of this ambitious programme. The preparation of the upgrade will involve: (i) a benchmarking to enable a strategic decision to be taken on whether or not the ILL should focus on cold instruments; (ii) feasibility studies, on challenging technical projects to renew the ILL\'s neutron moderators and delivery facilities, and on neutron scattering technologies; (iii) preparing the framework for a Partnership for Soft Condensed Matter; (iv) planning the development of the ILL/EMBL/ESRF site, including the resolution of the administrative issues.','HUMAN','en',212057),(33,'GENESI-DR, (Ground European Network for Earth Science Interoperations Digital Repositories), has the challenge of establishing open Earth Science Digital Repository access for European and world-wide science users to seamlessly access and share all data, information, products and knowledge originating from space, airborne and in-situ sensors. GENESI-DR shall operate, validate and optimise the integrated access and use available digital data repositories to demonstrate how Europe can best respond to the emerging global needs relating to the state of the Earth, a demand that is unsatisfied so far. \n\nGENESI-DR has identified the following objectives:\n-To provide a base for (establishing) a world-wide e-infrastructure for Earth Science with European leadership\n-To provide guaranteed, reliable, easy, effective, and operational access to a variety of data sources, and demonstrate how the same approach can be extended to provide access to all Earth Science data\n-To harmonise operations at key Earth Science data repositories limiting fragmentation of solutions\n-To demonstrate effective curation and prepare the frame for approaching long term preservation of Earth Science data\n-To validate the effective capabilities required to access distributed repositories for new communities, including education, and assess benefits and impacts\n-To integrate new scientific and technological derived paradigms in operational infrastructures in responds to the latest Earth Science requirements GENESI-DR builds upon the existing, operational and focused Earth Observation (EO) European infrastructure and involves key Earth Science centres responsible for operational data acquisition, processing, archiving and distribution. \n\nGENESI-DR involves key partners of the Ground Segment Coordination Body (GSCB), and it is aligned to the ESA EO Programme Board strategic vision for long term data access and preservation, thus efficient use of already existing and planned developments is guaranteed.','HUMAN','en',212073),(34,'EuroVO-AIDA aims at unifying the digital data collections of European astronomy, integrating their access mechanisms with evolving e-technologies, and enhancing the science extracted from these datasets. The concept of a Virtual Observatory (VObs) is that all the world\'s astronomical data should feel like it sits on the astronomer\'s desk top, analysable with a user selected workbench of tools and made available through standard interfaces across the whole range of astronomical research topics. VObs is embraced as a world-wide community-based initiative with the potential to transform and restructure the way astronomy research is done.\n\nEuro-VO is the European implementation of this idea, and the EuroVO-AIDA project is proposed to lead the transition of Euro-VO into an operational phase. EuroVO-AIDA integrates the technology, networking and service activities of Euro-VO into a fully functioning eInfrastructure. It will establish a Registry of VObs-compliant resources; support the network of data centres in deploying the VObs eInfrastructure; co-ordinate development of user tools for science extraction; and disseminate results to the astronomical community and identify their needs. The VObs interoperability standards will be updated taking into account feedback from implementation by data centre and from science usage. Specific emphasis will be placed on data access and data models, and on assessing innovative use of emerging technologies such as Web 2.0 by data centres for continuous improvement of the eInfrastructure.\n\nThe result will be an operating knowledge infrastructure that enables and stimulates new scientific usage of astronomy digital repositories. Coordination of EuroVO-AIDA activities with the international VObs community is ensured, and discussions with other scientific communities will help to identify relevant generic tools and environments. Service activities are also identified for the support of outreach to higher education and the general public.','HUMAN','en',212104),(35,'Among the most significant scientific inquiries defined by Science (July 2005) was whether or not scientists will be able to build a laser of intensity sufficient to rip photons into electron-positron pairs. ELI will be the first infrastructure to approach this limit. It represents the consensual effort of 13 European countries, more than 50 laboratories and numerous international collaborators. Dedicated to the fundamental study of laser-matter interaction in a new and unsurpassed, ultra-relativistic regime, this facility will be based on an exawatt-class laser delivering ultra-short (down to fractions of attosecond) pulses at least 100 times more powerful than any other existing or planned.\n\nELI will strive to be a highly multidisciplinary platform with specialized laser, particle or radiation beam lines dedicated to wide scientific fields, from fundamental ones: atomic, particle, nuclear, gravitational, and cosmology, to societal ones. ELI will for instance benefit in life science, nanotechnology material science, or environment. ELI will finally foster technology transfers, as well as education and training. The ELI preparatory phase aims at establishing all the elements for the start of a successful construction and operation of the facility.','HUMAN','en',212105),(36,'Earthquakes regularly occur throughout the world, frequently causing catastrophic harm and injury and always resulting in significant damage and widespread disorganization in the area. Modern society is increasingly vulnerable to external hazards, it is readily apparent that, in developed countries, although the numbers of victims of major earthquakes is tending to drop, the costs of the consequences are constantly rising. It is therefore indispensable for Europe to intensify the research and development in this field.\n\nMain topics of this research and development aim to improve the capability of prediction of the behaviour of new or existing structures and equipment, define reliable and economic ways of retrofit. The strong R&D need in earthquake engineering must be accompanied by an in-depth consideration of research infrastructures. For the design study of a world class seismic testing facility, the work plan should be brought following this coherent set of objectives: Define the new testing facility, high performances, single-site, answering to modularity, flexibility, operating easiness, complementary to existing research infrastructures in Europe','HUMAN','en',212109),(37,'The Preparatory Phase for a pan-European Biobanking and Biomolecular Resources Research Infrastructure (BBMRI) will focus on technical, legal, governance, and financial issues to ? prepare to construct BBMRI, building on existing biobanks, resources and technologies, specifically complemented with innovative components and properly embedded into European scientific, ethical, legal and societal frameworks, ? provide the concept for a key resource to increase excellence and efficacy in biomedical sciences, drug development and public health, ? expand and secure competitiveness of European research and industry in a global context, ? develop a sustainable financial framework. Biomedical quality-assessed samples and data as well as biomolecular resources and molecular analysis tools are essential for academic and industry-driven research to treat and prevent human diseases. Although currently established national biobanks and biomolecular resources are a unique European strength, valuable collections typically suffer from fragmentation of the European biobanking-related research community. This hampers the collation of biological samples and data from different biobanks required to achieve sufficient statistical power. Moreover, it results in duplication of effort and jeopardises sustainability due to the lack of long-term funding. BBMRI will comprise: ? biobanks of different formats (collections of blood, DNA, tissue, etc., together with medical, environmental, life-style and follow-up data), ? biomolecular resources (antibody and affinity binder collections, ORF clone collections, siRNA libraries, proteins, cellular resources etc.), ? enabling technologies and high-throughput analysis platforms and molecular tools to decipher gene, protein and metabolite functions and their interactions, ? harmonized standards for sample collection, storage, preanalytics and analysis ? harmonized databases and biocomputing infrastructure, ? ethical, legal and societal','HUMAN','en',212111),(38,'It is proposed to establish a sustainable distributed infrastructure for global observations of atmospheric composition from a large fleet of in-service aircraft. This will be achieved by installing autonomous instrument packages aboard initially 10-20 longrange aircraft of internationally operating airlines. IAGOS-ERI will provide high quality in-situ observations of greenhouse gases and reactive gases, aerosol, and cloud particles in the tropopause region, which is not adequately resolved by remote sensing from space and, on the other hand is one of the most sensitive regions for climate change. At the same time, IAGOS-ERI will provide detailed vertical profiles in the troposphere, which are of paramount importance for predicting changes in local and regional air quality and its causes. \nThe main goals of the preparatory phase are to prepare the legal and organisational structure and funding scheme for the new RI, to obtain the necessary legal preconditions for sustainable deployment of scientific instrumentation and near-realtime data transmission on in-service aircraft, insofar not yet achieved during the design study (IAGOS-DS), the coordination with the scientific and operational user community, such as WMO, AMDAR, ECMWF, and the implementation of IAGOS-ERI into the global observing system established by WMO-GAW within GEOSS. Technical work is required for bringing CARIBIC into routine operation, the deployment of very small instrument packages on a wider fleet of aircraft, and for cooperation with WMO-AMDAR for routine water vapour measurements.','HUMAN','en',212128),(39,'DRIVER is a multi-phase effort whose vision and primary objective is to establish a cohesive, pan-European infrastructure of Digital Repositories, offering sophisticated functionality services to both researchers and the general public. The present proposal (\'DRIVER Phase-II\') aims to introduce key innovations compared to the original \'DRIVER\' project, while building on its results.\n\nThe main novelties envisioned are: Establishment of a \"European Confederation of Digital Repositories\" as a strategic arm of DRIVER; Inclusion of Digital Repositories with non-textual or non-publication content, e.g., images, presentations, and possibly primary data; Construction of \"enhanced publications\", which combine interrelated information objects into a logical whole, e.g., publications coupled with relevant presentations and associated datasets; Provision of advanced functionality to address the requirements raised by the above innovations or to serve varied modes of scientists\' research explorations.\n\nAdditionally, DRIVER Phase-II moves from a test-bed to a production-quality infrastructure, expands the geographical coverage of Digital Repositories included in it, intensifies state-of-the-art and future-direction studies, and escalates dissemination, training, and community building activities. \'DRIVER Phase-II\' significantly broadens the horizons of the whole DRIVER endeavour regarding infrastructure operation, functionality innovation, and community relevance, and constitutes a major step on the way to the envisioned Knowledge Society.','HUMAN','en',212147),(40,'COPAL has the objective of providing the European scientific community with an unique research aircraft platform, capable of reaching and operating in any remote area in the world and offering a heavy-payload for integration of a large panoply of instruments for research in environmental and Geo-sciences. It will offer an unprecedented opportunity to countries that are not yet operating research aircraft to develop expertise in airborne measurements and participate to international multidisciplinary experiments.\n\nThe Consortium includes a SME and 10 national research funding institutions, among which 6 are research councils, 3 are meteorological services supporting research, and one is a national aerospace research institution. 7 participants are members of the EUFAR network of European aircraft operators for research in Geo-sciences. User requirements will be refined and translated into specifications for aircraft performance and modifications for research. The acquisition, modification, maintenance and operation costs will be precisely quoted. Procedures will be defined for the selection of the aircraft and data management operators. A network of academic centres of excellence and SMEs will be constituted for the development and airborne certification of innovative instruments for the community aircraft.','HUMAN','en',212205),(41,'This proposal for a major upgrade to the CESSDA Research Infrastructure is a response to the general principles and vision set out in the 2004 Blueprint for the European Research Obsrvatory for the Humanities and Social Science and will meet the goals set out in that report to strengthen interdisciplinary and cross-border collaboration and comparative research on a European dimension enhance the building of research infrastructure capacity in the less resourced European countries of today [and] it will increase the opportunity to improve knowledge on social processes and thus holds great potential in terms of advising European and national policy-makers on how to manage the challenges currently faced by the societies of Europe. Building on the existing operational structure of the Council of European Social Science Data Archives (CESSDA) network of data archives and its associated partners, this proposal for a major RI upgrade will seek to address the major gaps and deficiencies identified by the EROHS report on Research Infrastructures through the facilitation of access to and sharing of existing European and national data','HUMAN','en',212214),(42,'The ultimate goal of CLARIN is the construction and operation of a shared distributed infrastructure that aims at making language resources and technology available to the humanities and social sciences research communities at large. The preparatory phase will pave the way for implementation along 4 dimensions: Funding and governance: The aim is to bring together the funding agencies and to work out a ready-to-sign draft agreement between the funding agencies in the participating countries about governance, financing, construction and operation of the infrastructure. Technical: The technical objective is to provide a detailed specification of the infrastructure, agreement on data and interoperability standards to be adopted, and a running, validated prototype based on these specifications.','HUMAN','en',212230),(43,'The Square Kilometre Array (SKA) will be one of the largest scientific projects ever undertaken. It is a machine designed to answer some of the big questions of our time: what is Dark Energy? Was Einstein right about gravity? What is the nature of dark matter? Can we detect gravitational waves? When and how did the first stars and galaxies form? What was the origin of cosmic magnetism? How do Earth-like planets form? Is there life, intelligent or otherwise, elsewhere in the Universe? There are several issues that need to be addressed before construction of the SKA can begin: 1. What is the design for the SKA? 2. Where will the SKA be located? 3. What is the legal framework and governance structure under which SKA will operate? 4. What is the most cost-effective mechanism for the procurement of the various components of the SKA? 5. How will the SKA be funded? The purpose of this proposal is to address all of these points. We seek funding to integrate the R&D work from around the globe in order to develop the fully-costed design for Phase 1 of the SKA, and a deployment plan for the full instrument. With active collaboration between funding agencies and scientists, we will investigate all of the options for the policy-related questions. The principal deliverable will be an implementation plan that will form the basis of a funding proposal to governments to start the construction of the SKA.','HUMAN','en',212243),(44,'The European Social Survey (ESS) has three main objectives firstly to produce rigorous trend data at a national and European level about people s social, political and moral values in the context of Europe s changing institutions; to remedy longstanding deficiencies in methods of cross-national social measurement, particularly in respect of public attitudes and to bring social indicators into closer focus as a means of monitoring the quality of life across European nations. ESS data and supporting documentation are freely and swiftly available to all and have already attracted over 13,000 registered users.\n\nMany books and journal articles arising from the ESS have already appeared; many more are in preparation. Now starting its fourth biennial Round, the ESS is a pioneering example of the principles and practices behind the European Research Area, with funding from both the EC and over 20 Research Councils. We now seek to consolidate the achievements to date and prepare the project for its transition into an upgraded and sustainable Infrastructure. Although always envisaged as a time series, the future of the ESS has remained uncertain owing to a lack of sustained funding.','HUMAN','en',212331),(45,'Key questions in particle and astroparticle physics can be answered only by construction of new giant underground observatories to search for rare events and to study sources of terrestrial and extra-terrestrial neutrinos. In this context, the European Astroparticle Roadmap of 03/07, via ApPEC and ASPERA, states: We recommend a new large European infrastructure, an international multi-purpose facility of 105-106 ton scale for improved studies of proton decay and low-energy neutrinos.\n\nWater-Cherenkov, Liq. Scintillator & Liq. Argon should be evaluated as a common design study together with the underground infrastructure and eventual detection of accelerator neutrino beams. This study should take into account worldwide efforts and converge by 2010... Furthermore, the latest particle physics roadmap from CERN of 11/06 states: A range of very important non-accelerator experiments takes place at the overlap of particle and astroparticle physics exploring otherwise inaccessible phenomena; Council will seek with ApPEC a coordinated strategy in these areas of mutual interest. Reacting to this, uniting scientists across Europe, we propose here a design study, LAGUNA, to produce by 2010 a full conceptual design sufficient to provide policy makers and funding agencies with enough information for a construction decision.\n\nHas Europe the technical and human capability to lead future underground science by hosting the next generation underground neutrino and rare event observatory? We aim to answer this question. Certainly construction will exceed the capacity of any single European nation - to compete with the US and Asia unification of our scattered efforts is essential. Failure to plan now risks not only that our picture of Nature\'s laws remain fundamentally incomplete but also that leadership in the field enjoyed by Europe for 20 years falls away.','HUMAN','en',212343),(46,'We intend to study the feasibility of an European cluster of nanoscience facilities, which will consist of 3-6 Centres closely attached to a number of selected Large Scale Facilities located within Europe (synchrotron radiation sources, neutron scattering sources, high power lasers including free electron lasers and high performance computing, etc). This cluster of nanoscience facilities will enable users to conduct fine analysis experiments and modelling at the nanoscale by offering access to state-of-the-art synthesis, nanofabrication and analysis to a wide research community.\n\nHence, by providing innovative cutting edge preparation and characterization technologies to European scientists, this delocalized institution will raise the standards of nanoscience experiments in the European Research Area and allow full exploitation of the affiliated Large Scale Facilities. The NFFA design study will develop the Emerging Proposals, named NANOSCIENCE, in synergy with the ESFRI roadmap 2006. NFFA is a structuring project for the ERA that requires to be started with support by the EC under FP7, in order to reach the maturity to be validated as a potential RI by ESFRI.','HUMAN','en',212348),(47,'The recent discovery that the neutrino changes type (or flavour) as it travels through space, a phenomenon referred to as neutrino oscillations, implies that neutrinos have a tiny, but non-zero mass. This implies that the Standard Model of particle physics is incomplete. The implications are far reaching: e.g. neutrino interactions may be responsible for the removal of all the anti-matter created in the Big Bang from the early Universe and that the neutrino may have played a crucial role in the birth of the Universe itself. Knowledge of the contribution of neutrinos in these areas requires precise measurements of parameters governing neutrino oscillations, which will require new high intensity neutrino oscillation facilities in which neutrino beams are generated using new and highly challenging concepts.\n\nThe construction of such a facility in Europe would reassert Europe s position as the lead region for high energy particle physics and it would be in line with the strategy for the future of European particle physics, as recommended by the CERN Scientific Policy Committee. The design study will review the three currently accepted methods to realize such a neutrino facility (the so-called neutrino Superbeams, Beta Beams and Neutrino Factories) and do detailed studies of potential show stoppers, it will define the detector options necessary to measure the neutrino oscillation parameters and it will perform a critical physics evaluation of these facilities. The design study will also perform a cost assessment, that coupled with the physics performance, will permit the European research authorities to make a timely decision on the lay-out and construction of the future European neutrino oscillation facility. Doing this work now will enable Europe to secure the lead in this field.','HUMAN','en',212372),(48,'Efficient translation of research discoveries into industrial application is an essential element to maintain Europe s competitiveness in the biomedical and health industry. The main bottleneck is the lack and the fragmented nature of essential research infrastructure and know-how, leading to unacceptable delays and/or preventing the development of new innovative medicines. The aim of EATRIS is to fill this gap by developing a European Advanced Translation Research InfraStructure consisting of key preclinical and clinical components necessary to support the development of new diagnostic or therapeutic strategies at all stages of the biomedical R&D-process.\n\nEATRIS will operate through a network of biomedical translation research centres across Europe which will provide user access to: State of the art animal facilities for preclinical proof of principle and proof of concept studies Small molecule screening facilities to identify and characterize new drug targets High-resolution imaging facilities for preclinical and clinical validation Disease-specific patient and population cohorts to develop and validate new innovative diagnostic and therapeutic strategies Centralized GMP facilities for bioprocess development and manufacturing Facilities for Clinical Phase I studies.','HUMAN','en',212435),(49,'This is the project definition for the Conceptual Design Study of the large aperture European Solar Telescope (EST). EST is a pan-European project involving 29 partners from 14 different countries. A consortium EAST (European Association for Solar Telescopes) exists with the aim, among others, of undertaking the development of EST, to keep Europe in the frontier of Solar Physics in the world. EST will be optimised for studies of magnetic coupling between the deep photosphere and upper chromosphere. This will require diagnostics of the thermal, dynamic and magnetic properties of the plasma over many scale heights, by using multiple wavelength imaging, spectroscopy and spectropolarimetry. The EST design will strongly emphasise the use of a large number of visible and near-infrared instruments simultaneously, thereby improving photon efficiency and diagnostic capabilities relative to other existing or proposed ground-based or space-borne solar telescopes. To achieve these goals, EST must specialise in high spatial and temporal resolution using instruments that can efficiently produce two-dimensional spectral information. The study aims at demonstrating the scientific, technical and financial feasibility of EST. It includes key aspects needed for a conceptual design of the whole telescope, such as optomechanical design, cooling mechanisms, adaptive optics, instrumentation and control. Different existing alternatives will be analysed for all systems and subsystems, with decisions taken on the most adequate ones that are compatible with the scientific goals and the technical strategies. Technical specifications will be given at the end of the Design Study for all systems and subsystems.','HUMAN','en',212482),(50,'The main objective of this project is to deploy the e-Infrastructures built so far by the EGEE and DILIGENT projects so that they address the needs of several new scientific communities affiliated with the broad disciplines of Environmental Monitoring and Fishery Resource Management. These e-Infrastructures, which offer mechanisms that concurrently exploit networks, grids, and data in a seamless fashion, will enable scientific communities to operate within a coherent pan-European model, regardless of the location of their research facilities.\n\nThe project will progressively consolidate and expand these open e-Infrastructures to better address the needs of the two major target disciplines (which have challenging differences but also interesting commonalities). Thousands of scientists will obtain increasingly more facilities for creating Virtual Research Environments based on shared computation, storage, and generic service resources offered by EGEE and DILIGENT at a European level, as well as on data and domain-specific service resources offered by large international organizations, such as ESA, FAO, and CGIAR.\n\nThe envisioned D4Science e-Infrastructure will have a multiplicative benefit to many scientific fields and will also act as a catalyst for the kind of cooperation and cross-fertilization among multiple communities that is necessary for addressing many grand challenges of science and society.','HUMAN','en',212488),(51,'The objective of this design study is to address all key issues related to the feasibility of a new research infrastructure with a clear European dimension, named LIVING LAB, that will: Advance the field of user centred research (i.e. by studying the interaction of people with innovations for the home), Test, evaluate and improve innovations for the home, Foster societal needs such as sustainability and quality of life, Stimulate competitiveness of European industry (that brings these innovations to the market).\n\nLIVING LAB will bring together Europe\'s top research institutes and companies to study the interaction of people with technology in the home environment, and to stimulate cooperative projects in the fields of user centred research and product development. A LIVING LAB-core infrastructure will look like an ordinary house, but (invisible to its inhabitants, who are all volunteers) it will have sensors, cameras and microphones that record every aspect of home life. The behaviour and interactions of the volunteers can be monitored at any point in the day throughout the duration of their stay. One key advantage of the LIVING LAB over other simulation setups is that products can be evaluated in a real-life environment, over a prolonged period of time.','HUMAN','en',212498),(52,'In the framework of the KM3NeT Preparatory Phase project the strategic, legal and financial issues are addressed related to the construction of an European deep-sea infrastructure housing a cubic kilometre size Cherenkov neutrino telescope and providing access for deep-sea research. Many technical issues are already addressed in the KM3NeT Design Study, started in 2006, that at the end of its work will deliver a Technical Design Report for the KM3NeT Cherenkov neutrino telescope. KM3NeT has been included in the ESFRI European Roadmap for Research Infrastructures.\n\nThe Preparatory Phase will provide the grounds to bring the project to its construction stage. The Consortium performing the Preparatory Phase will include the participants involved in the KM3NeT DS. The major stakeholders are present. The work performed in the Preparatory Phase will be structured in work packages aimed at addressing the following issues: political convergence towards a pan European facility; legal, governance and financial engineering; strategic issues and international networking; integration with regional and global marine and environmental systems (i.e. EMSO); preparing the production of the telescope components and the assembly and test of the system; definition of the data handling and dissemination scheme, and the operation of KM3NeT.','HUMAN','en',212525),(53,'The SPIRAL 2 Preparatory Phase project aims to achieve the development and signing of the consortium agreement allowing for the construction of the facility. The SPIRAL 2 project located at the GANIL facility (Caen, France) will deliver energetic rare (radioactive) isotope beams with intensities not yet available with presently running machines. The studies of the properties of nuclei forming these beams or their interaction with stable nuclei is a rapidly developing field of contemporary nuclear physics, astrophysics and interdisciplinary research.\n\nAlthough the Region Basse-Normandie and the French funding agencies (CNRS and CEA) are financing the investment to the extend of 80% of the cost of baseline project, SPIRAL 2 seeks new partners in order to balance the construction budget both of the baseline project and of the new instrumentation necessary for experiments. The Preparatory Phase will deal with the critical financial, legal and organisational issues related to the international character of the SPIRAL 2 facility during its construction and operation phases. Searching for new funding partners will be achieved by direct contacts and negotiations between international partners, their funding agencies and the European Commission as established through the official visits, meetings and workshops. Several critical technical issues have still to be addressed in order to construct the SPIRAL2 facility and associated instrumentation.\n\nThe corresponding tasks were chosen in order solve remaining technical challenges as well as to attract efficiently European partners. In particular, the accent was put on the new instrumentation for SPIRAL 2. This topic, being the most attractive for scientists, is an excellent tool to convince the funding agencies of international partners to commit for the construction phase. The attractiveness of SPIRAL 2 for outside users will be improved by the construction of new infrastructures.','HUMAN','en',212692),(54,'This Design Study aims at implementing a new concept of integrated research infrastructures in Europe for research on agro-ecosystems and natural ecosystems and environment.\n\nThis infrastructure consists in interfacing three types of platforms:\n(i)The in situ Long Term Experimental Plateforms which consists in developing experiments for the main type of land use systems (arable crops, grasslands, forest, marchlands, heathlands ), where different types of land management are imposed for a long term and where the state variables of the system are monitored for long term in conjunction with the measurement of the environmental fluxes to atmosphere and hydrosphere.\n(ii)The in vitro ECOTRON equipments where blocks of ecosystems of different size could be introduced within controlled environment. Since feedbacks between the plants and the soil responses take time to establish, experiments often need to last a few years. An alternative use of Ecotrons is to analyse the physiology of blocks of ecosystems which have been subjected in situ for years to various treatments within LTEP platforms. In that case, Ecotrons can be seen as ecological analysers receiving samples for analysis.\n(iii) The in silico Database and Modelling platform should complete the system by developing facilities for sharing data bases among Europe','HUMAN','en',212723),(55,'The proposed project aims at improving the ability of the social sciences to explain the causes and consequences of demographic developments, and in particular of the changing relationships between genders and generations, in a manner that would allow working out sustainable responses to policy challenges. The project develops an infrastructure that provides for a breakthrough towards better understanding of the forces that lie behind demographic developments by integrated analyses of the micro-level demographic choices of individuals and households and the various contexts in which they act. It develops and refines a multi-disciplinary population survey and a macro-level contextual database that cover the wide range of topics relevant for explaining demographic trends and behaviour, as well as their consequences.\n\nThe project integrates the approaches from different disciplinary perspectives, such as demography, sociology, economics, political science, statistics, survey methodology, psychology and social psychology, and epidemiology. The work mainly builds on the platform of the Generations and Gender Programme (GGP), including the Generations and Gender Survey and the GGP contextual database. The resulting European research infrastructure will provide a standardized and comparative approach to interdisciplinary analyses of demographic phenomena, which covers the wide range of different European societies, is oriented towards the needs of policy-making and relies on up-to-date data sources designed to meet these analytic needs.','HUMAN','en',212749),(56,'DIESIS proposes to establish the basis for a European modelling and simulation e-Infrastructure based upon open standards to foster and support research on all aspects of critical infrastructures with a specific focus on their protection. DIESIS will perform a thorough conceptual design study in order to prepare the establishment of such a research e-Infrastructure. \n\nIn particular, DIESIS will:\n* analyse in detail the requirements for the research e-Infrastructure coming from researchers, industrial stakeholders, decision makers and governmental organisations\n* develop an extensible ontology and communication protocols in order to define a standard for interoperable simulations in the field of critical infrastructure protection\n* provide concepts enabling interoperability among heterogeneous and distributed modelling and simulation technologies\n* design an ICT architecture for a distributed European e-Infrastructure on top of existing GRID approaches in order to support federated, interoperable simulations and research on critical infrastructure protection\n* implement a prototype of such an infrastructure as a proof of concept\n* assess the feasibility (scientific, technical, and financial) and the potential impact (scientific and technical) of such an e-Infrastructure. \n\nWhile the main focus of the project is on research in the critical infrastructure domain the developed concepts, protocols and technologies will be applicable much more broadly. In principle, these should be applicable to all kinds of research where federated simulation is useful. By providing the design and the evaluation of the feasibility DIESIS is the first step towards a European e-Infrastructure for research in the important and emerging field of critical infrastructure protection that will lead to more dependable, resilient and secure infrastructures to the benefit of all European citizens and European society and economy at large.','HUMAN','en',212830),(57,'The term Research Infrastructures (RIs) refers to facilities and resources that provide to the scientific community essential services needed for the performance of leading edge research in both an academic and/or industrial environment. Research Infrastructures should be open to researchers, to the scientific community and to the Industry and cover the whole range of scientific and technological fields. The Research Infrastructures are of high importance in order to strengthen the knowledge base of Scientific Communities and the technological know-how of Industrial sector across Europe.\n\nThe overall objective of the proposed project is: To support the efficient implementation of the Research Infrastructures Programme and to promote the benefities offered by the RIs in order to enhance the Research Excellence, the competitiveness and the growth of Europe. Within this framework the project aims to improve the effectiveness of the Research Infrastructures (RIs) NCPs network through the upgrade of the level of the transnational cooperation which will result in more consistent services provided to the customers/clients across Europe. Coordination activities and synergies with other EU Networks will promote a coherent approach towards the Research Infrastructures and their utilization for the benefits of the European Scientific Community and Industry.\n\nThe NCPs within each particular country represent different administrative and organisational schemes and patterns. The lack of coordination activities between NCPs frequently leads to obstacles both for the NCPs and the Researchers and requires more efforts by the European Commission for the effective implementation of the Programme itself. The project will focus on the establishment of a unified approach to RIs NCPs services across EU, will support the trasnational collaboration, will raise awareness at European level and will promote RIs as a base for a coherent development of the enlarged Union.','HUMAN','en',212879),(58,'The increasing cost of experimental facilities in many research fields is powering a concentration of such facilities in a few selected places, sometimes driven also by environmental conditions. The clear, steady skies without light pollution necessary to Astronomical Observatories are generally not easily found. In the Southern hemisphere the best observing facility for optical and infrared astronomy is widely acknowledged to be ESO.\n\nAt the same time the ever increasing data volumes as detectors get bigger and more complex, raises a number of problems for the builders, the operators and the users as well. The remoteness of the facilities makes the travelling from European home institutions difficult and expensive. Information Technologies can offer a solution to these problems, provided the necessary infrastructure and tools are put in place. The strategic objective of this proposal is to make possible a strict integration in the ever-growing instrumental grid emerging worldwide of the world-class facilities created in Chile by the European Astronomical Community. These represent an investment of many hundred million Euros that will be exploited in the next decades.\n\nThe present project proposes to create a physical infrastructure (and the tools to exploit it) to efficiently connect these facilities to Europe. The infrastructure will be complementary to the international infrastructures created in the last years with the EC support (RedCLARA, ALICE, GEANT) and will be another step in the creation in Latin America of an advanced instrumentation GRID. This will allow the European Research a competitive edge having faster access to the collected data and use the facilities in an ever more efficient way.','HUMAN','en',212891),(59,'The project focuses on all needed preparatory actions to enable in the following phase the construction of a Research Infrastructure (RI) called Pan-European Research Infrastructure for Nano-Structures (PRINS), with the aim of enabling European innovative research for the ultimate scaling of electronics component and circuits. The platform will be truly interdisciplinary by allowing the convergence of top-down technology, which is today the main enabler of Moore\'s law (i.e. transistor scaling), with bottom-up methods derived from fundamental disciplines such as material physics, chemistry, biotechnology and particle electronics. The open access of this infrastructure provided to the Scientific Community will enable the cross-disciplinary fertilization of academic and industrial competences in the areas of nanoelectronics, nanosystems, nanobiology, nanophotonics, etc. The consortium consists of European leading Research Centres, industrial partners and Public Authorities and Funding Agencies. Key activities include setting up a legal framework for the operation of the RI.','HUMAN','en',212919),(60,'We propose to set up a European digital repository for cosmic ray data by pooling existing data archives and by developing a real-time database with the data of as many European neutron monitor stations as possible. The data will be available through internet. Cosmic rays provide a diagnostic tool to analyze processes in interplanetary space and at the Sun. Cosmic rays also directly affect the terrestrial environment and serve as indicators of solar variability and non-anthropogenic climate changes on Earth.\n\nIn the fifties of the last century a worldwide network of standardized neutron monitors was developed to examine temporal and spatial variations in our space environment. Despite decades of tradition, neutron monitors remain the state-of-the-art instrumentation for measuring GeV cosmic rays that cannot be measured by space experiments. Therefore the worldwide network, which presently consists of about 50 stations, ideally complements cosmic ray observations in space. Since the beginning of the coordinated neutron monitor measurements the data have been collected in world data centres. A big shortcoming of these data centres for today\'s demands is the fact that the data are not available in real-time and only with a time resolution of one hour. Cosmic ray applications, e.g. space weather warnings (geomagnetic storms, solar energetic particle events) need access to neutron monitor measurements in real-time and with high time resolution.\n\nReliable forecasts of geomagnetic storms are important in many technical areas (radio communication, electric power lines, etc.). Confident alert prediction of solar energetic particle events is highly important for manned space missions and for airline crews and passengers. The proposal unifies for the first time the cosmic ray community of the European neutron monitor network in a coordinated effort to advance the use of cosmic ray data in cutting-edge applications, as e.g. space weather.','HUMAN','en',213007),(61,'NMR plays an important role in life sciences (bio-NMR), and structural biology in particular, at both European and international levels. An I3 initiative is operative in the field, which provides access to NMR instrumentation and pursues technical advancement (EU-NMR). In addition, the EC has funded a Coordination action (NMR-Life) aimed at the establishment of common experimental approaches and at the spreading of best experimental practices across Europe. Altogether, these two initiatives provide a reference point for the large majority of European scientists with an interest in bio-NMR.\n\nIn parallel, European developments in the area of Research Infrastructures in the past years resulted in a leading edge high-speed research network covering all Europe and in a overlaying production Grid infrastructure, realized by projects as EGEE/EGEE II. This integrated network and processing/storage environment - e-Infrastructure - provides a platform for new methods of global collaborative research - e-Science.\n\nThe main objective of this project is to optimise and extend the use of the NMR Research Infrastructures of EU-NMR through the implementation of an e-Infrastructure in order to provide the European bio-NMR user community with a platform integrating and streamlining the computational approaches necessary for bio-NMR data analysis (e-NMR). The e-NMR infrastructure will be based on the Grid infrastructure.\n\nThe project will also tackle the following objectives:\n- establish a human collaboration network between the bio-NMR and the e-Infrastructure scientific communities;\n- assess the state-of-the-art of the computational aspects of bio-NMR;\n- implement and make available state-of-the-art computational methods. A broad range of networking activities will focus on monitoring, dissemination and outreach, training, hands-on workshops.\n\nThe development and enforcement of operational and organizational schemes and policies will also be addressed.','HUMAN','en',213010),(62,'New DNA sequencing and metagenomics projects are increasing the flow of poorly annotated raw sequence data into public databases with limited annotation. At the same time, users are imposing increasing demands on databases to include functional and contextual information, and to facilitate linking to other databases. Recent advances in technologies for achieving this and enabling complex querying and analysis are now well established, including services such as DAS and Web services.\n\nOf the traditional protein functional classification resources, arguably the best known and most used is the InterPro database and its accompanying software, InterProScan. InterPro is an integrated documentation resource for protein families, domains and functional sites, which unifies data from 10 major signature databases into a single resource. It provides a means of small- and large-scale protein functional classification and annotation, adding value through its cross-references to GO, 3D structure data, and specialized protein family information. Despite the success of InterPro and its contributing databases, however, lack of funding recently has limited our collective ability to keep up with the ever-increasing flood of new data and emergence of new function-related data sources, and to fully embrace technologies such as DAS. This proposal aims to address these limitations and drive InterPro and its member databases into a sustainable future.\n\nThis will be achieved through improved coordination of Consortium activities and infrastructures; by better interaction with our users, and increased functionality to better meet the needs of existing users, and to embrace more advanced users. Our focus for the future is on new protein signatures to increase coverage and depth of protein space, faster turn-around in providing data to the public, interoperability with new protein function and pathway databases, and increased functionality of our interface to cater for beginner and expert users.','HUMAN','en',213037),(63,'The FEDERICA project has the following main objectives:\n- Support research experiments on new Internet architectures and protocols,\n- Create a versatile, scalable, European wide \"technology agnostic\" infrastructure, separated from the production networks, but with the possibility to interoperate,\n- Be open to host researchers hardware and applications,\n\nFEDERICA adopt the paradigm that \"the infrastructure is the network\". The traditional model of core and edges is replaced by a quasi-homogeneous network, where each node is defined according to its functions, rather than through its position and the logical and node functions topology can be easily changed. The infrastructure can be adapted to whatever the user wants it to be. Particular features are:\n- Simultaneous use by more than one research group,\n- Availability of the infrastructure for Call1 Network of the Future and Call2 FIRE,\n- Exploiting the excellent networking facilities that are available in Europe.\n\nThe project will network, in terms of:\n- Facilitating technical discussion amongst specialist,\n- Providing preliminary information and results for the next generation of the NREN networks, and link with GEANT2 and as a pre-experimental phase for GEANT3,\n- Contributing with real test case and results to standardization bodies, e.g. IETF, ITU-T, OIF, IPsphere.\n\nResearch will be undertaken to:\n- Understand and produce initial solutions on management and control of distributed, parallel, virtual networks which may communicate between them and with the general Internet,\n- Develop experience and a model for managing and using virtual infrastructures as a combination of networks and systems,\n- Open the infrastructure to any \"application\" type (application can be a test),\n- Use, test and advance the tools and services being developed by GN2, NRENs and partners, in particular for end-to-end services,\n- Enable the graceful implementation of new inter-domain service layer.','HUMAN','en',213107),(64,'The DORII project aims to deploy e-Infrastructure for new scientific communities, where on the one hand the ICT technology is still not present at the appropriate level, but on the other hand it is demanded to empower its daily work. We deal with a group of scientific users, and this is a reference for DORII, with experimental equipment and instrumentation that are not integrated or integrated only partially with the European infrastructure.\n\nThe DORII is focusing on the following selected scientific areas:\n- earthquake community, with various sensor networks\n- environmental science community\n- experimental science community, with synchrotron and free electron lasers.\n\nThe scientific communities represented by the project are well recognised and organised even in the industry area represented by SME. This means the organisations are members of bigger consortia which deal with similar topics mentioned above but also focus on research aiming to have a better experimental environment. The IT technology is provided by partners who have recognised the initial requirements of the scientific communities and will deliver the functionality (adopted to new users requirements) developed in projects which had a focus on accessing remote instrumentation (GRIDCC, RINGrid), on interactivity (int.eu.grid), on software frameworks for application developers (g-Eclipse) and advanced networking technologies (GN2) with EGEE based middleware.\n\nThe experience gained in these projects, in co-operation with end users allows us to expect a positive result of integrating applications with the existing and future e-Infrastructure. The standardisation and knowledge transfer is planned to be done via e-IRG and OGF research group established by us giving added value of interoperability and sustainability of DORII.\n\nThe DORII consortium capitalised its previous experience and knowledge and is going to use it in the current project, making significantly lower any possible risks occurrence.','HUMAN','en',213110),(65,'The need for advanced light sources is well documented by the creation of new facilities such as SOLEIL, DIAMOND, MAX IV and the upgrades of older facilities. The applications of light sources encompass all aspects of sciences spanning the fields of physics, chemistry, biology, material science, electronics and medicine. An option to provide more light to this community is to develop small laboratory sources beyond the standard and rotating anodes. Recently, several small scale synchrotron sources were proposed, whereby the most advanced system is the Mirrorcle© developed by Prof. Yamada (Japan) with three functioning systems. In this project, we will design a complete small facility around the Mirrorcle© source. The Mirrorcle© is based on two RF klystron driven microtrons to accelerate the electrons first and second to obtain a electron storage ring with constant energy (6 MeV or 20 MeV) and high current (3A). The relativistic electrons produce intense far infrared radiation (FIR) and when targets are inserted in the electron path intense soft and hard X-rays can be produced from 90 eV up to the electron energy. The first goal of this project is to complete the characterization of the full radiation spectrum generated by the Mirrorcle© . This includes parameters such as the brilliance, the beam divergence, polarization and monochromacity. The second goal is to design a specific Mirrorcle© ring with four output ports, namely a FIR port, a soft X-rays port, a hard X-rays port and one port where the full spectrum is available. This includes designing the required targets as well as internal mirrors configurations. The third goal is to design specific beam-lines for these four ports that take into account the source. Finally, two specific user stations will be designed that make use of the unique abilities offered by such a small scale source, namely a multi-diagnostic in-situ, real-time nano-material synthesis system and a medical imaging and therapy','HUMAN','en',213126),(66,'A globally distributed computing Grid now plays an essential role for large-scale, data intensive science in many fields of research. The concept has been proven viable through the Enabling Grids for E-sciencE project (EGEE and EGEE-II, 2004-2008) and its related projects. EGEE-II is consolidating the operations and middleware of this Grid for use by a wide range of scientific communities, such as astrophysics, computational chemistry, earth and life sciences, fusion and particle physics. Strong quality assurance, training and outreach programmes contribute to the success of this production Grid infrastructure.\n\nBuilt on the pan-European network GEANT2, EGEE has become a unique and powerful resource for European science, allowing researchers in all regions to collaborate on common challenges. Worldwide collaborations have extended its reach to the benefit of European science.\n\nThe proposed EGEE-III project has two clear objectives that are essential for European research infrastructures: to expand, optimize and simplify the use of Europe\'s largest production Grid by continuous operation of the infrastructure, support for more user communities, and addition of further computational and data resources; to prepare the migration of the existing Grid from a project-based model to a sustainable federated infrastructure based on National Grid Initiatives.\n\nBy strengthening interoperable, open source middleware, EGEE-III will actively contribute to Grid standards, and work closely with businesses to ensure commercial uptake of the Grid, which is a key to sustainability.\n\nFederating its partners on a national or regional basis, EGEE-III will have a structuring effect on the European Research Area. In particular, EGEE-III will ensure that the European Grid does not fragment into incompatible infrastructures of varying maturity. EGEE-III will provide a world class, coherent and reliable European Grid, ensuring Europe remains at the forefront of scientific excellence.','HUMAN','en',222667),(67,'The Cyprus Institute is developing a Computation-based Science and Technology Research Centre (CSTRC) that will include a high-performance computing (HPC) facility on a scale expected to be in the tens of teraflops, with an associated research and educational centre devoted to computational science. The CSTRC will be designed primarily to serve the needs of Cyprus and the Eastern Mediterranean region.\n\nThis Support Action aims to ensure that in its planning and early development phases the CSTRC develops strong anchors in both the European ICT infrastructure and the Eastern Mediterranean scientific community, thereby helping to build scientific and technological bridges between Europe and the Middle East and to narrow the digital gap between the Eastern Mediterranean and the Western World.\n\nThis will be achieved through the action of a consortium of European and US leaders in the fields of HPC and computational science and of prominent Eastern Mediterranean research institutions. The consortium will conduct studies, prospective work and outreach activities relevant to the integration of CSTRC in the EU HPC landscape and to the attainment of its regional dimension.\n\nPlanned actions include the assessment of needs for computational resources within the scientific community of Cyprus and the Eastern Mediterranean, the coordination of HPC resources and their integration in Europe and the region, the planning of the access of users, the preparation of research and educational programmes in computational science, as well as a feasibility study for the amelioration of the network connectivity in the region. Dissemination and outreach actions, including an International Conference and several users workshops, will also be conducted. All of these will bring significant contributions to the EC’s objectives in the fields of e-science, e-infrastructures and their integration on a European and regional Eastern Mediterranean scales.','HUMAN','en',222904),(68,'DEISA2 continues to support and develop a distributed high performance computing infrastructure by consolidating the existing DEISA infrastructure and extending its collaborative environment for capability computing and data management. The resulting infrastructure is unmatched world-wide in its heterogeneity and complexity, enabling the operation of a powerful supercomputing Grid built on top of national services, facilitating Europe\'s ability to undertake world-leading computational science research.\n\nDEISA has already proved its relevance for advancing computational sciences in leading scientific and industrial disciplines within Europe and has paved the way towards the deployment of a cooperative European HPC ecosystem. The existing infrastructure is based on the tight coupling of eleven leading national supercomputers, using dedicated network interconnections of GEANT2 and the NRENs.\n\nIn DEISA2, activities and services relevant for Application Enabling, Operation, and Technologies are continued and enhanced, as these are indispensable for the effective support of world-leading computational sciences in the area of supercomputing. The service provisioning model is extended from one that supports a single project to one supporting Virtual European Communities. Collaborative activities will be carried out with new European and other world-leading initiatives. Of strategic importance is the cooperation with the PACE initiative which is preparing for the installation of a limited number of leadership-class tier-0 supercomputers in Europe.\n\nFor a future persistent European HPC ecosystem, as suggested by ESFRI, which integrates national tier-1 centres and the new tier-0 centres, DEISA2 will deliver a turnkey operational solution. For this goal, DEISA2 targets the integration of further national computing centres as Associated Partners. DEISA2 will also contribute to interoperation of distributed infrastructures.','HUMAN','en',222919),(69,'GLOBAL - Global Linkage Over BroadbAnd Links will provide a virtual conference centre using advanced communication technologies and concepts to support the promotion of e-infrastructure topics around the world.\n\nThe GLOBAL project can be condensed in 4 objectives:\n- Objective 1: Providing the \"Virtual Conference Centre\" Collaborative e-Infrastructure\n- Objective 2: Realising of Global Networking Sessions\n- Objective 3: Disseminating the Results and Providing Sustainability\n- Objective 4: Providing Services for Third Parties\n\nThe members of the consortium have a large experience in organising virtual events.','HUMAN','en',223120),(70,'The impact of Grids has rapidly expanded beyond that which can be disseminated by individual projects. GridTalk will bring the success stories of Europe\'s e-Infrastructure to policy makers in government and business, to the broader scientific community, and to the general public. The project will co-ordinate the dissemination outputs of EGEE and other European Grid efforts, ensuring their results and influence are reported widely in print and online.\n\nGridTalk\'s output will come in three main forms. Firstly, a series of reports and briefings will engage policy makers with the specific achievements and impacts of Europe’s science Grids. Secondly, the high profile GridCafe website will be extended to ensure its continued success in informing the general public. And finally international Science Grid This Week, the rapidly growing online newsletter, will provide a resource for scientists using Grid computing and for those considering becoming involved.\n\nThrough its international, cross-disciplinary approach, GridTalk will play a vital role in encouraging participation in and co-ordination between Grid projects in Europe, and in particular in preparing for the proposed European Grid Infrastructure and other initiatives aimed at a sustainable e-Infrastructure in Europe. It will also spread awareness of Europe\'s leading role in Grid development to other geographical areas.','HUMAN','en',223534),(71,'The South Caucasus countries, Armenia, Azerbaijan and Georgia are linked to the pan European research backbone GEANT with only limited capacities which constitutes a major blocking factor to consolidate the potential of the region and to establish stronger links with the scientific community of the EU. The establishment of high speed connections between the South Caucasus countries and to GEANT will both introduce new technologies and services to the Information Society in those countries and be an important step towards the integration of those countries’ scientific potential to the European infrastructure. The Black Sea Interconnection (BSI) project with the participation of ULAKBIM, GRNET, CEENET,DANTE, GRENA, AZRENA and Academia of Science aims to setup and operate such a network among South Caucasus countries.\n\nA number of projects funded by EC and NATO have contributed to the development of e-Societies and the networking infrastructure in the region. These projects served the dissemination of research networking knowledge and constitution of regional Information Society by creating a human network in the region. Besides, the limited connection capacities among the NRENs and to GEANT harden the consolidation of regional scientific potential and they are inadequate for involving in scientific strategies and working groups of GEANT project.\n\nThe BSI project intends bridging the digital divide that exists between the South Caucasus countries and Europe by establishing a regional research and education network in the region and connecting it to GEANT. Project involves development of strategies for interconnecting the existing infrastructures in the region, realization of the connections and supplying operational support for the established network. In addition, BSI will contribute to the integration of South Caucasus scientific potential to Europe by successfully disseminating the infrastructure and promoting the IST projects in South Caucasus countries.','HUMAN','en',223572),(72,'The e-Infrastructures Reflection Group Support Programme 2 (e-IRGSP2) project provides full support to the work of the e-Infrastructures Reflection Group (e-IRG). The e-IRG has been instrumental in the development of the policies and documenting the best practices, producing five white papers and a roadmap presenting the consensus of the leading European Grid and networking infrastructure experts. The e-IRGSP2 uses the experiences of the previous support action (e-IRGSP), combined with an in-depth analysis of the evolution of the e-IRG itself, to plan for an optimal support strategy.\n\nThe activities of the project are based on supporting the process of the e-IRG, modeled as an iterative repetition of four phases:\n- Studying the state-of-the-art and best practices,\n- Creating scenarios based on the data (white papers and roadmaps),\n- Establishing consensus about the actions needed (e-IRG recommendations) and\n- Engaging with the necessary stakeholders.\n\nThe support is based on three services: Secretarial support, which is involved in all of the activities. Its role is central in enabling e-IRG to study the state-of-the-art and engage with the necessary stakeholder groups through communication and dissemination support. Support for the policy activities provides rapid analysis of the impact of the developments on relevant levels (policy, technical, usage patterns) of e-IRG goals.\n\nThe activity takes the input generated in the phase 1 through the next two steps. Liaisons with research and other stakeholders focuses on identifying the key activities, developments and trends emerging in the world surrounding e-IRG. It facilitates dialogue about the interplay between the opportunities, goals and gaps related to the e-IRG vision and the surrounding legal, technical and socioeconomic framework. In phases 4 and 1 this ensures that the next iteration of the process will receive sufficient input.','HUMAN','en',223598),(73,'The FP7 e-Infrastructures initiative has already resulted in a number of projects being set-up or in negotiation covering a range of areas of scientific endeavour. The creation of virtual research communities brings together stakeholders with diverse backgrounds and capabilities.\n\nOne consequence is a large diversity of approaches and there is as yet little consensus across these communities about best practices in maintaining permanent access to the records of science in a sustainable way. The purpose of this proposal is to work with providers and users of scientific information and repositories to deliver insight into the issues of sustainable permanent access and provide cross-fertilisation of ideas and requirements between providers and users, between the various sectors of interest they represent and between the research community as a whole and national/European funding agencies.\n\nThere will be six key outcomes for the EU - it will provide:\n- a roadmap for the support e-infrastructure for long-term accessibility and usability of scientific and other digital information in Europe.\n- insight into current and planned research and development relating to e-infrastructures and permanent access, national, European and global, regardless of the funding mechanism \nidentification of gaps in the existing and planned infrastructure and the research agenda\nthe ability to share and capitalise on best practices as well as understanding the impact that e-Science is having on the research communities that it is serving, through an insight study into the capabilities and practices within the various research communities\n- better-informed investment decisions and sustainable e-repositories through an impact analysis framework and tool based on these insights\n- an international process for evaluating the sustainability and trustworthiness of digital repositories, and identifying best practice','HUMAN','en',223758),(74,'BELIEF-II, building on achievements and momentum created by BELIEF [2005-2007], aims to coordinate effective communication, results, networking and knowledge flow between EU eInfrastructure projects and their users, promoting their development and exploitation globally.\n\nBELIEF-II seeks to:\nEnsure Europe\'s diverse eInfrastructure projects evolve in synergy with one another to ensure common directions and efficient interaction;\nReinforce the relevance of Europe\'s eInfrastructures worldwide sustaining successful development and exploitation;\nNetwork a wide range of stakeholders through a coordinated mechanism to support a vibrant eInfrastructure community;\nSynchronise eInfrastructures priorities through easy to read eInfrastructure communication products;\nProvide a unique, communication platform for projects to manage their content, communicate activities to users and the public to learn more about eInfrastructures.\n\nBELIEF-II, owing to its qualified and committed international consortium of partners, is in the optimal position to address these strategic needs through: eConcertation coordination, Brainstorming Workshops, eInfrastructure Guides, Digital Library evolution and outreach in Latin America, S. Africa and India through International Symposia.\n\nThese actions will maximise the overall communication of eInfrastructures potential, and increase the visibility of EC Programmes in developing countries aiming at evolving and supporting a qualified, research and enterprise eInfrastructures community globally. Major results of BELIEF-II are: 2 eConcertation meetings with Reports, 2 European Brainstorming events, 2 editions of eInfrastructures guide, 1 DVD, 2 EC eInfrastructure dissemination publications, 5 Research Infrastructures News publications, 3 International Symposia. The DL implemented in BELIEF will be further enhanced in BELIEF-II with a number of services and functionalities to provide improved support for the community.','HUMAN','en',223759),(75,'E-Infrastructures are one of the key enablers for large-scale scientific research and the development of Information Society in Europe. Scientific software and the middleware components providing grid services act as the framework for many scientific developments. Different and incompatible implementations of the services, disconnected and short-lived software repositories, lack of clear procedures for software build, test, validation and maintenance hinder the widespread adoption of grid technologies by many diverse communities.\n\nThe definition and widespread adoption of common software lifecycle management procedures, manageable validation testbeds, distributed and federated repositories of code and software packages and widely agreed quality assurance processes and tools are goals closely aligned with an overall policy of creating a structural and sustainable eInfrastructure in Europe. The ETICS 2 project aims at supporting the widespread adoption of grid technologies by promoting and expanding the use of grid-based software engineering technologies by existing and new communities. The major objectives of the project are to provide an integrated combination of new key technologies (test management and workflow tools, release management tools, resource virtualization) and actively involve existing and new grid infrastructures through collaborations with key organizations and scientific research projects.\n\nIn addition, ETICS 2 will build upon international collaborations in Europe and internationally through its direct links with parallel initiatives and infrastructures in the US and will directly support the emerging National Grid Initiatives (NGIs) creating a flexible, stable and reliable environment that can eventually be transitioned in the future, sustainable European Grid Initiative and used to establish official \"quality labels\" for grid software and create trust between users and providers.','HUMAN','en',223782),(76,'The goal of OGF-EUROPE is to stimulate, co-ordinate and harmonise networked actions on Grid adoption across Europe and globally through reinforcement of the Open Standards message and thus capillary diffusion of the Open Grid Forum (OGF) model to Europe in alignment with OGF mission, strategy and leadership. \n\nOGF-EUROPE aims to mobilise the Grid European community of researchers, developers, providers, and end-users in both the public and private sector, focusing on issues that are of prime importance within the EU, ultimately increasing the ability of industry and commerce to influence requirements for a more competitive ICT infrastructure towards i2010. OGF-EUROPE scope is pursued by providing a sound, cohese message regarding EU requirements and global priorities in the field, as well as continuing to shape the broad vision while supporting practical progress on maturing and standardising the technology based on real-world experience. \n\nOGF-EUROPE is proposed at a crucial time as it provides the opportunity to capitalise on significant European investments performed in the past 8 years, by executing support actions that target the essence of mobilisation and integration of grid communities and that deliver actionable and sustainable results. \n\nThe OGF-EUROPE Consortium has the necessary expertise, knowledge and skills to demonstrate how grid infrastructures are a competitive advantage in Europe. The co-ordinating organization - the European Chapter of OGF - brings to the Project the additional asset of its already formalised, operational linkages and influential position within OGF global. \n\nMajor tangible results of the OGF-EUROPE initiative comprise: 3 reports supporting OGF Technical and Strategic Roadmap, 2 survey reports on trends and Grid practices, 4 workshops on challenges on standardisation issues, 4 Grid adoption challenge reports; 6 Community outreach seminars including 4 in-depth tutorials.','HUMAN','en',223784),(77,'The EUAsiaGrid proposal contributes to the aims of the EU Research Infrastructures FP7 Programme by \"promoting international interoperation between similar infrastructures with the aim of reinforcing the global relevance and impact of European e-Infrastructures\".\n\nThe project\'s main goal will be to pave the way towards an Asian e-Science Grid Infrastructure, in synergy with the other European Grid initiatives in Asia, namely EGEE-III via its Asia Federation, and both the EUChinaGRID and EU-IndiaGRID projects and their eventual follow on efforts.\n\nTaking advantage of the existing global Grid technologies, with the specific emphasis on the European experience with the gLite middleware and applications running on top of it, the project plans to encourage federating approaches across scientific disciplines and communities.\n\nEUAsiaGrid will act as a support action, aiming to define and implement a policy to promote the gLite middleware developed within the EU EGEE project across Asian countries. Its main actions will be to spread dissemination, provide training, support scientific applications and monitor the results.','HUMAN','en',223791),(78,'EELA-2 aims to build, on the current EELA e-Infrastructure, a high capacity, production-quality, scalable Grid Facility providing round-the-clock, worldwide access to distributed computing, storage and network resources for a wide spectrum of applications from European and Latin American scientific communities. The project will provide an empowered Grid Facility with versatile services fulfilling application requirements and ensure the long-term sustainability of the e-Infrastructure beyond the term of the project. \n\nThe specific EELA-2 objectives are: \n- Build a Grid Facility by: \nExpanding the current EELA e-Infrastructure to consist of more production sites mobilising more computing nodes and more storage space, at start of the project and to further grow storage over the duration of the project; \nProviding, in collaboration with related projects (e.g. EGEE), the full set of Grid Services needed by all types of scientific applications; \nSupporting applications various types (from classical off-line data processing up to control and data acquisition of scientific instruments), selected against well defined criteria (including grid added value, suitability for Grid deployment, outreach/potential impact); \n\n- Ensure the Grid Facility sustainability: \nThrough the already established and new contacts with policy/decision makers, collaborating with RedCLARA and NRENs and supporting the ongoing creation of e-Science Initiatives and/or National Grid initiatives (NGI). \nBuilding the support of the e-Infrastructure to provide a complete set of Global Services from a Central Operation Centre and to pave the way for the creation of Regional Operation Centres in Latin America: \nAttracting new applications; \nMaking available knowledge of EELA-2 Grid Facility to all potential users, developers, and decision makers through an extensive Training and Dissemination program; \nCreating knowledge repositories federated with the EGEE ones.','HUMAN','en',223797),(79,'The EU and India have established an extensive Information Society dialogue. On the research side, six priority sectors were highlighted at the occasion of the last EU-India Information Society Forum: EUROINDIA 2006. Internet security, next generation mobile wireless, migration from IPv4 to IPv6, languages technologies, Open Source software and high capacity research and education network (e.g. possible connection of the European network GEANT to its Indian counterpart ERNET) are the main topics of such dialogue.\n\nERNET, the educational and Research Network in India has deployed nationwide high speed networks to cover all universities and public research institutes. According to the new government policy, the broadband is of high priority along with IPv6 technology.\n\nWith 6CHOICE Proposal, the close co-operation between ERNET and European GEANT and GRID network is planned. 6CHOICE project supports such co-operation through joint network interconnection, service planning and the experiments will be facilitated across ERNET and GEANT linked universities and research institutes. This will be complemented with number of workshops to be held and conducting workshops to different level of target audience and complemented with training events with experts involved.\n\n6CHOICE will complement the implementation of the Framework Programme across Europe and India for future Community research and technological development policy activities including monitoring and assessment activities. In particular, the project will involve conferences, seminars, studies and analysis, working groups and expert groups, operational support and dissemination, information and communication activities, or a combination of these, as appropriate in each case.\n\nThe activities proposed encourage and facilitate the participation of small research teams, newly developed and remote research centres in the activities of the Communication Network Development scheme.','HUMAN','en',223804),(80,'PESI provides standardised and authoritative taxonomic information by integrating and securing Europe\'s taxonomically authoritative species name registers and nomenclators (name databases) that underpin the management of biodiversity in Europe. \n\nPESI defines and coordinates strategies to enhance the quality and reliability of European biodiversity information by integrating the infrastructural components of four major community networks on taxonomic indexing into a joint work programme. This will result in functional knowledge networks of taxonomic experts and regional focal points, which will collaborate on the establishment of standardised and authoritative taxonomic (meta-) data. In addition PESI will coordinate the integration and synchronisation of the European taxonomic information systems into a joint e-infrastructure and the set up of a common user-interface disseminating the pan-European checklists and associated user-services results. \n\nThe organisation of national and regional focal point networks as projected not only assures the efficient access to local expertise, but is also important for the synergistic promotion of taxonomic standards throughout Europe, for instance to liaison with national governmental bodies on the implementation of European biodiversity legislations. In addition PESI will start with the geographic expansion of the European expertise networks to eventually cover the entire Palaearctic biogeographic region. \n\nPESI supports international efforts on the development of a \'Global Names Architecture\' by building a common intelligent name-matching device in consultation with the principal initiatives (GBIF, TDWG, EoL, SpeciesBase). PESI contributes the development of a unified cross-reference system and provides of high quality taxonomic standards. PESI will further involve the Europe-based nomenclatural services and link the planned joint European taxonomic e-infrastructures middle-layer to the global e-gateway.','HUMAN','en',223806),(81,'The Baltic Grid Second Phase (BalticGrid-II) project is designed to increase the impact, adoption and reach, and to further improve the support of services and users of the recently created e-Infrastructure in the Baltic States. \n\nThis will be achieved by an extension of the BalticGrid infrastructure to Belarus; interoperation of the gLite-based infrastructure with UNICORE and ARC based Grid resources in the region; identifying and addressing the specific needs of new scientific communities such as nano-science and engineering sciences; and by establishing new Grid services for linguistic research, Baltic Sea environmental research, data mining tools for communication modelling and bioinformatics. \n\nThe e-Infrastructure, based on the successful BalticGrid project, will be fully interoperable with the pan-European e-Infrastructures established by EGEE, EGEE associated projects, and the planned EGI, with the goal of a sustained e-Infrastructure in the Baltic Region. \n\nThe present BalticGrid e-Infrastructure of 26 clusters in five countries is envisaged to grow, both in capacity and capability of its computing resources. The consortium is composed of 13 leading institutions in seven countries, with 7 institutions in Estonia, Latvia and Lithuania, 2 in Belarus, 2 in Poland, and one each in Sweden and Switzerland. \n\nThe overall vision is to support and stimulate scientists and services used in the Baltic region to conveniently access critical networked resources both within Europe and beyond, and thereby enable the formation of effective research collaborations.','HUMAN','en',223807),(82,'SLING is about Serving Life-science information for the Next Generation. Its goal is to make sure that advances in European Science are supported by the best possible biomolecular information, and that European scientists are optimally equipped to exploit it. To do this it makes available a comprehensive range of databases and services from SIB and the EBI, provides extensive, high-quality training in the use of these databases, and carries out R&D necessary to enable the data and services to keep page with changing science. The activities are designed to support both commercial and academic research throughout Europe, and its training will be delivered in numerous European locations. The work to ensure the quality of the data will include efforts targeted at information in patent literature through the European Patent Office. New high-throughout methods such as next-generation DNA sequencing will provide major stimuli for the R&D work of the project.','HUMAN','en',226073),(83,'This project builds on recent developments in the management of Research Infrastructures, specifically the publication of the European Strategy Forum on Research Infrastructures (ESFRI) Roadmap and four European conferences which discussed how to develop regional, national and international policy in this area, particularly the legal, financial, operational and governance aspects of managing large and complex research infrastructures. The principal aims of this proposal are to train senior policy makers and scientific decision makers, particularly in New EU Member States and Associated States, in the practical governance and management requirements of pan-European and transnational Research Infrastructures; and to develop a policy framework directed at managing future large Research Infrastructures across national boundaries. Key deliverables of the project will be a symposium entitled','HUMAN','en',226446),(84,'EUMINAfab is the first Pan-European Research Infrastructure for micro and nano fabrication of new, novel and emerging functional materials. It provides access to a unique portfolio of state-of-the-art technologies for structuring and characterisation of a multitude of materials at the micro nano scale. It answers to challenges from global competitors. EUMINAfab coordinates 10 European partners from 8 member states. \n\nThe consortium integrates 6 academic institutes and 4 industrial partners. EUMINAfab opens access to 36 installations and estimates over 430 users in 48 month duration. It pursues networking (5 work packages), transnational access (8 work packages) and joint research (3 work packages) and applies for an EC contribution of nearly 6M with total costs of nearly 7.79 M . \n\nEUMINAfab significantly structures the ERA of micro nano manufacturing (European platform MINAM) by implementing and further developing a distributed infrastructure for creating knowledge and enabling scientific breakthroughs, even to next generation products. As such EUMINAfab allows for access of its users from fundamental science to industry-oriented research.','HUMAN','en',226460),(85,'SYNTHESYS IA will aid in the evolution of a European resource through the creation an accessible, integrated infrastructure for researchers in the natural sciences in Europe and globally. By focusing the JRA on DNA extraction, SYNTHESYS IA will increase the opportunities for Users to exploit a largely untapped facet of the 337 million strong collections. Users will be able to play an active role in generating new knowledge based on molecular and morphological studies.\n\nA range of new services and improved access both physical and digital will be provided to a broad range of scientific Users (from biological and geological related disciplines) in a consistent and more easily accessible way. The new tools to be developed and disseminated will give Users the chance to pursue new avenues for independent studies at the leading edge of biodiversity and environmental research.','HUMAN','en',226506),(86,'The Integrated Infrastructure Initiative for Neutron Scattering and Muon Spectroscopy (NMI3) aims at the pan-European coordination of neutron scattering and muon spectroscopy, maintaining these research infrastructures as an integral part of the European Research Area. NMI3 comprehensively includes all major facilities in the field, opening the way for a more concerted, and thus more efficient, use of the existing infrastructure. Co-ordination and networking within NMI3 will lead to a more strategic approach to future developments and thus reinforce European competitiveness in this area. NMI3 is a consortium of 22 partners from 13 countries, including 10 research infrastructures.\n\nThe objective of integration will be achieved by using several tools:\n- Transnational ACCESS will be provided by 10 partners offering more than 4000 days of beam time. This will give European users access to all of the relevant European research infrastructures and hence the possibility to use the best adapted infrastructure for their research.\n- Joint Research Activities focusing on six specific R&D areas will develop techniques and methods for next generation instrumentation. They involve basically all those European facilities and academic institutions with major parts of the relevant know-how.\n- Dissemination and training actions will help to enhance and to structure future generations of users.\n- Networking and common management will help strategic decision-making from a truly European perspective.','HUMAN','en',226507),(87,'The Optical Infrared Coordination Network for astronomy brings together all the national and international agencies and organisations which fund, support, develop and operate Europe\'s facilities for optical and infrared astronomy, both night-time - callsical astronomy- and daytime - solar astronomy.\n\nOpticon provides a framework allowing joint action to improve the quality of Europe\'s infrastructures, to train new astronomers, especially those from Central Europe, in modern new research methods, to develop innovative technologies to enhance research quality, to plan for future developments, and to work towards a strategic plan for Europe\'s future research infrastructures.','HUMAN','en',226604),(88,'SPIRIT is an Integrating Activities project integrating 7 leading ion beam facilities and 4 research providers from 7 Member States and 1 Associated State. The 7 partners providing TransNational Access supply ions in an energy range from ~10 keV to 100 MeV for modification and analysis of solid surfaces, interfaces, thin films and nanostructured systems. The techniques cover materials, biomedical and environmental research and technology, and are complementary to the existing synchrotron and neutron radiation networks. \n\nThe partners have highly complementary equipment and areas of specialization. SPIRIT will increase User access and the quality of research by sharing best practice, balancing supply and demand, harmonizing procedures and extending the services into new emerging fields and to new users especially from the NMS and industry. \n\nAn independent International User Selection Panel will examine proposals under a common SPIRIT procedure. Networking activities include the development of common standards for quality assessment; training and consultancy for User researchers and foresight studies. \n\nJoint Research Activities will promote emerging fields such as targeted single ion implantation for irradiation of living cells; ion-beam based analysis with ultrahigh depth resolution; ion-based 3-D tomography, and chemical and molecular imaging. Joint efforts are necessary to improve the systems for detection of ion-induced secondary radiation and to develop means to reduce sample deterioration by the analyzing ion beam. Finally, a unified software package for ion-beam based analysis shall be developed and made available to the community. \n\nThe management structure of SPIRIT will consist of a Management Board, 3 Activity Boards (Networking, Transnational Access and Joint Research) and a Project Steering Team. A European Users Panel will provide input on user needs, evaluate service improvements against the benchmark level and assess new capabilities resulting from the JRA.','HUMAN','en',227012),(89,'EUFAR is the Integrating Activity for airborne research in Geo-science. It will integrate the airborne community, to ensure that researchers may have access to the most suited infrastructure they need, irrespective of the location of the infrastructure. The EUFAR consortium comprises 33 legal entities. 15 operators of airborne facilities, and 18 experts in airborne research. They contribute to 9 Networking Activities, Trans-national Access to 25 installations, and 3 Joint Research Activities.\n\nA Scientific Advisory Committee, constituted of eminent scientists, contributes to a better integration of the users with the operators to tackle new user driven developments. Transnational Access coordination aims at providing a wider and more efficient access to the infrastructures. The working group for the Future of the Fleet fosters the joint development of airborne infrastructures in terms of capacity and performance. The Expert Working Groups facilitate a wider sharing of knowledge and technologies across fields. The activity for Education and Training provides training courses to new users. The working group on Standards and Protocols contributes to better structure the way research infrastructures operate.\n\nThe development of a distributed data base for airborne activities improves the access to the data collected by the aircraft. All these activities rely on an unique web portal to airborne research in Europe. The working group on the Sustainable Structure aims at promoting solutions for the long term sustainability of EUFAR. Among the JRA, one will develop and characterize airborne hygrometers, the second one will develop and implement quality layers in the processing chains of hyperspectral imagery, and the third one will develop an airborne drop spectrometer based on a new principle.','HUMAN','en',227159),(90,'RadioNet is an integrating activity that has pulled together ALL of Europe\'s leading radio astronomy facilities to produce a focused, coherent and integrated proposals that will significantly enhance the quality and quantity of science performed by European astronomers. \n\nRadioNet FP7 has 25 partners. They range from operators of major radio telescope facilities to laboratories that specialise in micro-electronics. This proposal has brought these institutes together in a unique partnership that builds and extends on RadioNet FP6. \n\nThe programme of work includes: 7 Networking activities, 4 joint research activities and 9 transnational access projects. \n\nThe three main objectives are to:\n* provide European astronomers access to world-class radio astronomy facilities\n* embark on a research and development plan that will further enhance and improve these facilities\n* nurture and support a rapidly growing community of radio astronomers and engineers, so that can fully exploit the upgraded and next generation radio facilities that will become available over the next few years.','HUMAN','en',227290),(91,'The Project promotes the access to five European Research Infrastructures, and it is structured intop eight Networking Activities, plus the Management of the Consortium, and fourteen Joint Research Activities. The Project represents the continuation of the successful HadronPhysics project in FP6 and originates from the initiative of more than 2.500 European scientists working in the field of hadron physics. Hadron physics deals with the study of strongly interacting particles, the hadrons. Hadrons are composed of quarks and gluons. Their interaction is described by Quantum Chromo Dynamics, the theory of the strong force. Hadrons form more complex systems, in particular atomic. Under extreme conditions of pressure and temperature, hadrons may loose their identity and dissolve into a new state of matter similar to the primordial matter of the early Universe. The Networking Activities are related to the organization of experimental and theoretical collaborative work concerning both ongoing activities at present Research Infrastructures and planned experiments at future facilities. In hadron physics the close interaction between experimentalists and theoreticians is of paramount importance. The Joint Research Activities concentrate on technological innovations for present and future experiments. Applications in material science, medicine, information, technology, etc., represent natural fall-outs. The main objective of this Integrating Activity is to optimize the use and development of the Research Infrastructures existing in Europe working in the field of hadron physics. The Project aims as well at structuring, on European scale, the way Research Infrastructures operate, and at fostering their joint development in terms of capacity and performance. The approach used is the','HUMAN','en',227431),(92,'The mouse shows great similarities in development, physiology and biochemistry to humans, which makes it a key model for research into human disease. The major challenges for mouse functional genomics in the 21st century are to:\n- Develop a series of mutant alleles for every gene in the mouse genome\n- Determine the phenotypic consequences of each mutation\n- Identify mouse models for the complete disease spectrum in humans\nTo exploit this emerging resource, mouse models must be preserved and made available to the European biomedical research community.\n\nBuilding on EMMA\'s previous achievements as the primary mouse repository in Europe, EMMAservice aims to meet the future challenges presented by archiving and disseminating mouse models in the ERA as follows:\n- Archiving of 1224 new mouse mutant lines in support of individual depositors and also European mouse genetics programmes\n- Support of eligible customers with free of charge Transnational Access for up to 20% of requested mouse resources.\n- Technology development will underpin the archiving and distribution efforts by advancing current sperm freezing technology\n- Training courses will promote the shipment of frozen germplasm rather than live mice\n- EMMA informatics will support user services by setting new standards for user friendly accession of EMMA services, extensive data curation and cross referencing with other mouse database resources\n- Outreach efforts to attract users will be widened and addressed at the translational research community\n\nEMMAservice will contribute significantly to the development of a world leading repository and European capacity in mouse disease model archiving and distribution, supporting the needs of the wider European biomedical research community.','HUMAN','en',227490),(93,'Particle physics stands at the threshold of a new era of discovery and insight. Results from the much awaited LHC are expected to shed light on the origin of mass, supersymmetry, new space dimensions and forces. In July 2006 the European Strategy Group for Particle Physics defined accelerator priorities for the next 15 years in order to consolidate the potential for discovery and conduct the required precision physics. These include an LHC upgrade, R&D on TeV linear colliders and studies on neutrino facilities.\n\n\nThese ambitious goals require the mobilization of all European resources to face scientific and technological challenges well beyond the current state-of-the-art and the capabilities of any single laboratory or country. EuCARD will contribute to the formation of a European Research Area in accelerator science, effectively creating a distributed accelerator laboratory across Europe. It will address the new priorities by upgrading European accelerator infrastructures while continuing to strengthen the collaboration between its participants and developing synergies with industrial partners. R&D will be conducted on high field superconducting magnets, superconducting RF cavities which are particularly relevant for FLASH, XFEL and SC proton linacs, two-beam acceleration, high efficiency collimation and new accelerator concepts.\n\nEuCARD will include networks to monitor the performance and risks of innovative solutions and to disseminate results. Trans-national access will be granted to users of beams and advanced test facilities. Strong joint research activities will support priority R&D themes. As an essential complement to national and CERN programmes, the EuCARD proposal will strengthen the European Research Area by ensuring that European accelerator infrastructures further improve their performance and remain at the forefront of global research, serving a community of well over 10,000 physicists from all over the world.','HUMAN','en',227579),(94,'The network INCREASE consists of 6 infrastructures (large-scale field sites) with experimental manipulation of climate e.g. night time warming and extended summer drought. Within INCREASE we will improve the technology and methodology for studies of climate change effects on European shrublands.\n\nThe main objectives of INCREASE are:\n- To optimize technologies and methodologies for non-intrusive field manipulation of climate change in shrubland ecosystems by development, testing and application of new technology and methods i) to optimize the field manipulations of warming to 3-4 °C (in agreement with the newest predictions of global warming by the IPCC (2007)), ii) to develop, test and apply the combination of warming and drought and the combination with CO2.\n- To improve and develop non-destructive techniques and methods for measurements of physical, chemical and biological effects of climate.\n- To stimulate collaboration within the scientific community around climate manipulation experiments i) within the infrastructure by means of e.g. common research, common protocols, test of equipment, data syntheses, ii) between the infrastructure and related infrastructures beyond the proposal, and iii) scientists within relevant fields\n- To provide access to a unique set of large scale climate change experiment for European scientists.\n- To develop and provide access to a comprehensive data base of experimental data.\n- To develop and provide access to a dynamic ecosystem model for scrubland ecosystems\n- To test and apply non-destructive methods for ecosystem carbon assessment and important underlying processes of root dynamics and carbon transformations in the soil.','HUMAN','en',227628),(95,'Ruminants and other large domestic herbivores are often used in agricultural research both as target species for increasing knowledge on production systems and their impact on the environment. They are also used as models for physiological studies, and for biomedical research.\n\nERIN is a support action aiming at identifying potential European networks of animal facilities for research on large animals that will support future research needs in this area. Its objectives are\n- to identify future needs for experimental research on large animals,\n- to locate and characterise European experimental facilities and identify those that are candidates for forming an integrated infrastructure,\n- to combine future needs and potential research facilities in order to produce potential scenarios of organisation.\n\nERIN will use a combination of bibliometrical studies and collaborative networks for the identification of potential candidates (research groups and experimental facilities) for a quantitative survey of the main research institutes and universities in Europe, and complete this with qualitative analyses based on in-depth interviews of key research managers and visits to selected experimental facilities. Crossing the results of future needs expressed by research groups and of experimental potential will help to establish scenarios of the future organisation of research facilities in Europe.\n\nResults and scenarios will be presented at a final conference where the major research agencies and funding bodies will be invited to express their positions and react on these scenarios. Final recommendations will be made regarding possible integrated organisations of research facilities dedicated to research on large domestic animals with a view to stimulating synergies, facilitating researcher mobility and achieving a critical mass in Europe able to compete with future large foreign research consortia.','HUMAN','en',227750),(96,'The most important prerequisite and challenge in structural biology research at the atomic level by any method is the availability of sufficiently large amounts of highly purified functional proteins due to the increasing size and complexity of target proteins or protein complexes to be analyzed. Heterologous expression in bacteria, yeast, insect, or mammalian cells combined with many attempts involving different DNA constructs that result in a large variety of protein variants is instrumental to obtain sufficiently high yields.\n\nThis means high-throughput methods employing robotics and specialized infrastructure are essential to efficiently reach the state of obtaining functional protein and/or crystals for X-ray structure determination. PCUBE (\'protein production platform\') combines existing infrastructures and know-how of leading European laboratories in bacterial, eukaryotic expression of proteins, in high-throughput crystallization and in libraries design for the effective production and crystallization of macromolecules. The program aims at offering these various state-of-the-art platforms to research groups from EC member and associated states for the efficient production of proteins for their structural studies. Each infrastructure will offer defined procedures for applying for transnational access.\n\nScientific selection committees will give priorities to applications by scientific criteria of excellence only. Researchers from the different sites offering infrastructure are combining efforts to improve the methods in the various areas by collaborating by joint research activities. These include the improvement of the automation for synthesizing DNA constructs, for parallel expression, for improved libraries, for the efficient selection of affinity molecules from libraries to particular target proteins as well as developing new methods for crystallization at the nanoliter scale.','HUMAN','en',227764),(97,'Europe has a very long and distinguished history in Marine Biology and its coastal marine biological stations are the oldest in the world. For example, Stazione Zoologica in Naples (SZN), Station Biologique in Roscoff (SBR) and Kristineberg Marine Research Station in Fiskebackskil (KMRS) were all established in the late 19th Century. They began an enviable tradition as marine biological research stations that acted, even at that time, as international infrastructure sites to serve, enhance and develop collaborative marine research worldwide. Now, however, they have become a new breed of marine research station, developing and applying new technologies and facilities that allow a higher quality of service, not only to the marine biologist community but also to the increasing numbers of scientists that are turning to marine organisms as models with which to investigate fundamental questions in biology. Building upon this enviable tradition ASSEMBLE seeks to create a network of key marine biological research stations around the European coastline including the sub-tropical station at Eilat (IUI). Uniquely, we also include a Pacific site in Chile (PUC) that provides access to one of the most important upwelling sites in the world. We aim to develop an integrated infrastructure that will make possible for biologists in Europe to study a range of unique coastal ecosystems and a wide variety of marine organisms using the most advanced approaches in modern biology. It will be based on the existing hosting capacities, sea-going facilities and research background of these marine stations, which, as noted above, already have a long experience in hosting students and visiting scientists. This infrastructure will focus on key marine ecosystems and biological models, making possible both the enhancement of existing infrastructures and the introduction and development of new technologies. These include, for example, indoor and outdoor equipment for the cultivation/raising/study o','HUMAN','en',227799),(98,'The proposed project ESWIRP aims at enhancing the complementary research potential and service capabilities of three strategic wind tunnels in Europe both in terms of productivity and quality. The concerned wind tunnels are ONERA S1MA Modane, DNW-LLF and ETW. \n\nThe main ideas leading to the proposal have been:\n* the identification at European level by the aeronautical community (ACARE) of the strategic wind tunnels for Europe needed to maintain and enhance the leadership of European aerospace industry and science\n* the EREA recommendation that the reduction of emissions, noise and fuel consumption by aviation requires the contribution of these infrastructures\n* the recognition that efforts have to be made at community level, in a targeted and coordinated way, to further integrate these strategic wind tunnels at a world class level\n\nThe ESWIRP project is fully responsive to the objectives of the Capacities Research Infrastructures Programme. It will enhance research and innovation capacities throughout Europe and contribute to ensuring their optimal use. The activities planned under this project aim at optimizing the utilization of the three strategic wind tunnels and improving their performance by new long-term investments for the benefit of scientists and customer industries.\n\nESWIRP responds to the so-called targeted approach of the Integrating Activities of the FP7 Capacities Work Programme: Infrastructures following the FP6 I3 model: \n* Networking activities\n* Trans-national access and/or service activities\n* Joint research activities. \n\nA Joint Management Board will be established by the three facilities for coordination of all ESWIRP activities and consolidation of integrating objectives.','HUMAN','en',227816),(99,'Population ageing is among the most pressing challenges of the 21st century in Europe. Addressing this challenge scientifically demands an infrastructure of micro data of the changing health, economic and social living conditions of individuals as they go through the ageing process.\n\nSHARE, the Survey of Health, Ageing and Retirement in Europe, is an infrastructure of multidisciplinary, longitudinal, and cross-nationally harmonized micro data that has been created in response to these demands. Currently, SHARE contains two waves of data for about 32,000 respondents aged 50+ in 17 European countries. SHARE became a great success: More than 2300 researchers are working with the data, and SHARE has been elected to be one of the future ESFRI infrastructures. This project is the essential device to enhance the longitudinal stability of the SHARE panel and to improve access and consulting services to users in the years 2009 and 2010.\n\nIt will:\n-enhance the longitudinal stability of the panel by keeping in touch with the panel members, monitoring moves, re-interviewing lost panel members, and ascertaining last year of life events of deceased panel members. The scientific value of SHARE critically depends on continuous panel care.\n-improve the research potential from the SHARE infrastructure by adding imputed values for missing variables, calibrated weights, geo-coded and environmental variables, and meta/para-statistics derived from IT-driven survey methods.\n-enhance the SHARE survey instrument in response to user feedback, to changes in the institutional environment, and to new survey technologies recently developed, making the interview more effective and less burdensome for the respondents.\n\nSuch enhancements need to be implemented in 2009/early 2010 to be in time for the ESFRI-financed fourth wave of data collection. -improve and maintain the much applauded user-friendly access for SHARE data users through services provided by central and national support points.','HUMAN','en',227822),(100,'European seismic engineering research suffers from extreme fragmentation of research infrastructures (RI) between countries and limited access to them by the S/T community of earthquake engineering, especially that of Europe\'s most seismic regions. A 23-strong Consortium of the key actors in Europe\'s seismic engineering research (including 3 industrial partners) addresses these problems in a sustainable way via a 4-year programme of activities at an annual cost to the Commission less than 1.35% of the total present value (190m) of the RIs material resources. The scope covers all aspects of seismic engineering testing, from eight Reaction Wall Pseudodynamic (PsD) facilities and ten Shake Table labs, to EU\'s unique Tester of Bearings or Isolators, its two major Centrifuges and an instrumented Site for wave propagation studies.\n\nTransnational Access is offered to a portfolio of world class RIs: EU\'s largest PsD facility, four diverse Shake Tables and the two Centrifuges. Networking sets up a public distributed database of past, present and future test results, installs distributed testing capabilities at all PsD labs, fostering development of up-and-coming ones at Europe\'s most seismic regions, drafts and applies protocols for qualification of RIs and engages the entire European community of earthquake engineering via the best possible instances: the European Association of Earthquake Engineering, EU\'s seismic code makers and their national groups, the European Construction Industry, as well as all relevant S/T associations or networks. Joint research engages all labs, exploring and prototyping novel actuators (combination of electro-dynamic and hydraulic ones) for better control of fast tests or special applications, new sensing and instrumentation systems, data assimilation in equipment-specimen models for better test control and optimisation of testing campaigns, as well as experimental studies of soil-structure interaction at all types of testin','HUMAN','en',227887),(101,'Research infrastructures are part of the EC s current priorities in structuring the European research area. Among these, the importance of high magnetic field facilities has been recognized, as witnessed by the continued EC funding of many high magnetic field projects. Under FP6, three different projects have been accepted. The Grenoble High Magnetic Field Laboratory ihas been running a RITA program (until 31/12/2007), whereas the TNA of all other European high field facilities is being coordinated by the I3 EuroMagNET (until 31/12/2008). The European pulsed high magnetic field laboratories are executing a Design Study for the next generation pulsed field user facilities (until 31/3/2009).\n\nAll these programs are running very satisfactorily and contribute to the excellence of Europe s high magnetic field research. For FP7, the principal actors of Europe s high magnetic field research, the Grenoble High Magnetic Field Laboratory (Grenoble, France), the High Field Magnet Laboratory (Nijmegen, the Netherlands), the Hochfeld Labor Dresden (Dresden, Germany) and the Laboratoire National des Champs Magnétiques Pulsés (Toulouse, France) propose to unite all their transnational access, together with joint research activities and networking activities into one I3, called EuroMagNET II . This I3 is considered as a very important step towards full collaboration between Europe s high field facilities, which will bring European high magnetic field science to a comparable level of that in the USA. It is also a step towards the creation of a multi-site European Magnetic Field Laboratory (EMFL). Within the context of the ESFRI Roadmap Update, a proposal for such an EMFL is currently under consideration, for a planned realization in 2015.','HUMAN','en',228043),(102,'The South-East European eInfrastructure initiatives aim to ensure equal participation of the region in European networking and Grid computing trends. SEEREN initiative has established regional network and SEE-GRID the regional Grid. SEE-LIGHT project is currently establishing dark-fibre backbone in the region, and SEE-GRID-SCI empowering strategic regional user communities in common use of the eInfrastructure. Close collaboration of National Research & Education Networks and National Grid Initiatives in the region was crucial in materializing this vision.\n\nThe above initiatives have also raised awareness of national ministries for the necessity of local programmes and financial support for eInfrastructures: a number of ministries have contributed to local network funding and regional interconnections, as well as national Grid programmes. SEERA-EI will capitalise on this momentum and link national-level programme managers and provide an open forum for information exchange, in order to enable coordination of national programmes in eInfrastructures, and to set the framework for a common regional agenda.\n\nThe project will gather and exchange information regarding current programmes and carry out a state-of-the-art analysis; produce set of best practices and guidelines for national eInfrastructure programmes; and identify areas for joint regional activities, ranging from short-term soft actions, mid-term policy-level actions, to preparatory activities for long-term actions. SEERA-EI will reduce fragmentation of national programmes, create a harmonized approach to national-level initiatives in eInfrastructures, ensure local commitment, and pave the way towards common regional vision, strategy and sustainable cooperation which will give the region a common voice on European and international stage and strengthen the ERA as a whole, enabling collaborative high-quality research across a spectrum of scientific fields.','HUMAN','en',228052),(103,'The Eastern Mediterranean is one of the world s richest areas in terms of archaeological remains, and cultural heritage in general; it has yielded an extraordinary variety of finds spanning all aspects of human activity. However, due to the scarcity of scientific and technological resources in the region, the analysis of these finds has occurred largely in research institutions far removed from the region. Therefore, there is a pressing need to make adequate resources available in the immediate proximity of the excavations and remains themselves, and also to properly document the cultural heritage of this key region.\n\nThe partners of this proposal wish to initiate a coordinated effort for the build-up of the relevant research infrastructures, and the pooling and coordination of the associated resources, in order to contribute to a regional strategic plan for the Eastern Mediterranean archaeological sciences and digital heritage community. This will be achieved in parallel with the design and planning process of the Cyprus Institute s newly created Science and Technology for Archaeology Research Centre, which is planning major investments in infrastructures for archaeometry, underwater archaeology and digital cultural heritage.\n\nThe project will ensure that the development of this new Centre is embedded in a strategy closely adapted to the regional needs and integrated in the Euro-Mediterranean environment of archaeological sciences and digital heritage. In addition to a coherent strategic plan, the outcomes of the project will include suggestions for joint trans-national activities, a user-led assessment of needs, guidelines for good practices and directions for further infrastructure development. It will contribute to the incubation of a regional research cluster in the field of archaeology and cultural heritage, and to the build-up of the associated community of researchers, with periodic workshops for continuous monitoring and update.','HUMAN','en',228130),(104,'IS-ENES will develop a Virtual Earth System Modelling Resource Centre (V.E.R.C.), integrating the European Earth system models (ESMs) and their hardware, software, and data environments. The overarching goal of this e-infrastructure is to further integrate the European climate modelling community, to help the definition of a common future strategy, to ease the development of full ESMs, to foster the execution and exploitation of high-end simulations, and to support the dissemination of model results and the interaction with the climate change impact community.\n\nThe V.E.R.C. encompasses models, the tools to prepare, evaluate, run, store and exploit model simulations, the access to model results and to the European high-performance computing ecosystem in particular the EU large infrastructures DEISA2 and PRACE. The V.E.R.C. developed by IS-ENES is based on generic ICT, Grid technology and subject-specific simulation codes and software environments. The European Network for Earth System Modelling (ENES) leads IS-ENES. This network gathers the European climate and Earth system modelling community working on understanding and prediction of future climate change.\n\nThis community is strongly involved in the assessments of the Intergovernmental Panel on Climate Change and provides the predictions on which EU mitigation and adaptation policies are elaborated. IS-ENES combines expertise in Earth system modelling, in computational science, and in studies of climate change impacts. IS-ENES will provide a service on models and model results both to modelling groups and to the users of model results, especially the impact community. Joint research activities will improve the efficient use of high-performance computers, model evaluation tool sets, access to model results, and prototype climate services for the impact community. Networking activities will increase the cohesion of the European ESM community and advance a coherent European Network for Earth System modelling.','HUMAN','en',228203),(105,'In marine ecology there is an urgent need to understand the functioning of the lower part of the pelagic food web, its response to and effect on climate change, its response to pollution and environmental toxins, and its role in producing food for commercially important species at higher trophic level. This requires access for European scientists to tools allowing experimental approaches to near-natural pelagic systems. To meet this need, we propose a network (MESOAQUA) of European marine mesocosm facilities.\n\nMESOAQUA will:\n- Offer European researchers access to a range of mesocosm facilities in contrasting environments.\n- Develop and test new technologies that allow access to off-shore environments\n- Improve the services of the facilities by exchange of technology and experience\n- Facilitate cross-disciplinary fertilisation and a better coordination of mesocosm research\n- Promote the training of young scientists in the use of experimental ecosystem research\n\nMESOAQUA is necessary because:\n- System level experimentation is required to understand and predict the responses of the pelagic ecosystem in changing ocean subject to increasing anthropogenic pressure.\n- There is no present system for trans-national access to such experiemental facilities, particularly not to facilities offering access to different water masses\n- There is no present technology allowing mesocosm experiments in open waters','HUMAN','en',228224),(106,'During the past 70 years or more, thousands of viruses have been isolated and partly characterised by experts working in different countries worldwide. These viruses potentially provide a unique and extremely valuable medical and educational resource for research and development to understand the basis of virus diseases, and to develop modern state of the art strategies for disease control. However, nowhere in the world has there been an attempt to coordinate these collections of viruses so that they can be authenticated, amplified under quality-controlled conditions, stored long-term, and disseminated worldwide to laboratories engaged in fundamental and/or applied research.\n\nWithout carefully coordinated intervention, these valuable resources will be lost to science and medicine. The objective of this project is therefore to develop a readily accessible virus reference library at the European level through the creation of the European Virus Archive (EVA). Since it would create insurmountable problems to develop such a collection in a single laboratory, EVA will utilise the expertise and facilities of recognised centres of excellence in virology within Europe. EVA will also exploit the high international reputations of these centres to obtain viruses currently held outside Europe. The management structure of EVA will ensure the highest standards of quality assurance, security, traceability and dissemination for the benefit of science, medicine, education and global information.\n\nThe EVA network will develop appropriate protocols for virus amplification, supported by sustainable long-term storage facilities. The resource will be available to all users who can demonstrate the appropriate biosecurity credentials. An associated technology transfer centre will develop products for diagnosis, research, therapeutic application, education, and training. The EVA consortium contains internationally recognised experts in all aspects of the proposal.','HUMAN','en',228292),(107,'The RIFI objectives are:\n- to create a methodology for evaluation of the socio-economic impact of investments in RIs, - to test and improve the elaborated methodology based on its application to several case studies in Romania and Bulgaria (at all the three levels of investment: pan European, regional and national),\n- to complement the methodology through integrating foresight, and to elaborate on the role of foresight for identifying RI investment opportunities.\n\nThe RIFI methodological tool is especially important for the new EU member states, the remote islands of EU, and other countries with similar profiles with Romania and Bulgaria (e.g. from the Black Sea Region). The methodology will be a powerful decision tool both for developing and adjusting the European policies related to RIs, and for pre-assessment of certain RI investments.','HUMAN','en',228293),(108,'Concentrated solar energy is a very promising renewable source of energy. The solar resource in the Mediterranean countries of the EU and in North Africa is huge. The best known application so far is bulk electricity generation through thermodynamic cycles, but other applications have also been demonstrated, such as production of hydrogen and solar fuels, water treatment and research in advanced materials. Europe is a leader in research and development of this technology.\n\nMost of the large R&D infrastructures are European and our industry is leading the way in its commercial deployment, now in an early stage. All the most important European R&D infrastructures on concentrated solar energy are participating in this proposal. Five of them, CIEMAT-PSA, DLR, PROMES-CNRS, ETH and PSI were already part of a virtual laboratory consortium known as Sol LAB , which has initiated several networking activities since its creation in 2004. ENEA and WIS now join the consortium submitting this proposal, thus looking to consolidate a partnership as the reference European Solar Research Laboratory.\n\nThis proposal concerns three activities:\n- Networking: Aiming at the creation of a stable framework for co-operation in which resources are shared, common standards developed, duplication of research effort is avoided and interaction with European research, education and industry is encouraged.\n- Transnational access: Opening the doors of the most relevant R&D infrastructures to interested users, optimizing the use of the facilities and creating critical mass for new research initiatives.\n- Joint Research: developing common standards and procedures for better consortium performance and development of advanced instrumentation and new RI thus improving the services offered to the user community.','HUMAN','en',228296),(109,'EMbaRC will establish a self-sustainable community of European Microbial Resource Centres representing a large bio-diversity and offering a wide-range of not only bio-resources but also expert services. These services will enable the development of new partnerships with public institutes in the field of biodiversity and will facilitate revenue-generating partnerships with the economic sector (large food or biotech companies, research organizations, SMEs, NGO s etc) that will be defined in a set of validate business models for Biological Resource Centres.\n\nThe objective is to enable not only the EMbaRC partners but also other European BRCs, especially those who are endangered or isolated, to find complementary sources of funding to ensure their future existence. Thus EMbaRC proposes an extensive training and outreach programme targeting these collections as well as the wider research community. Furthermore providing access to the partners expert services via the transnational access proposed will enable EMbaRC to improve, coordinate and validate its offer to the research community from within both public and private sectors.\n\nThrough its networking and harmonization activities EMbaRC will lay down the foundations of the future Global Biological Resource Centre Network ensuring that European expertise and research are at the forefront of the International scene. Through the EMbaRC joint research programme the partners will pool their resources and expertise to collaboratively improve strain and DNA storage and develop new identification methods for microorganisms for the benefit of the wider scientific community.','HUMAN','en',228310),(110,'The Europlanet RI project will provide the European planetary science community with a unique research infrastructure, combining access to a suite of state of the art facilities while fostering their joint development and integration in terms of capacity and performance. This research infrastructure will include access to laboratory and field site facilities, advanced modelling, simulation and data analysis resources and to data produced by space missions and ground-based telescopes hence maximising the scientific impact of major European space missions and ground-based installations.\n\nAccess will be provided in two forms. Three coordinated Trans National Access activities will open to many users the unique range of laboratory and field site facilities selected for this project. In parallel, the IDIS e-service will provide a user-friendly web-based access to the available planetary science data, information and software tools. Four Joint Research Activities will broaden the scope of the infrastructure, opening access to new field sites, offering new models and data analysis tools for users and widening the opportunity of remote data access by progressively upgrading IDIS into a Planetary Virtual Observatory. Four complementary networking activities will publicize the objectives and opportunities of Europlanet RI and disseminate project results amongst the scientific community, industries, SME\'s, space agencies and the public. They will consolidate the establishment of a European Research Area for planetary science and exploration. \n\nBuilding on the synergies between its services, joint research activities and networking activities, Europlanet RI will provide the ideal scientific and technical environment to fully analyse data from past and present planetary missions and prepare the next generation of missions. In this way it will play a vital role in establishing the European Community as a leading player in planetary and space exploration.','HUMAN','en',228319),(111,'CHARISMA is an Integrated Infrastructure Initiative that brings together 21 leading European institutions developing research on artwork materials and their deterioration finalised to the conservation of cultural heritage. The consortium has the objective to optimise the use of infrastructures through a coordinated program of transnational access, joint research and networking activities.\n\nTransnational access offers applicants opportunities to exploit the services of three different and complementary groups of facilities, embedded in a multidisciplinary environment involving material science and artwork conservation/restoration. They are:\n* a group of six archives containing a huge amount of analytical data, hosted by the most prestigious European museums and institutions developing safeguard and conservation of cultural heritage\n* a set of advanced portable instrumentation for in-situ non-invasive measurements in the same site where the artworks are located or exhibited\n* two platforms, one in France and one in Hungary, where large scale facilities are coupled to a set of medium scale instrumentations, open to users for the most advanced studies on artwork materials and their alterations. \n\nResearch is devoted:\n* to improve access to databases exploiting digitalisation of data and their harmonisation\n* to design and set-up innovative instrumentations, for in-situ 2D and 3D examinations of artworks, and new cleaning techniques\n* to develop new methodologies for the study of organic materials and their distribution in micro-samples or directly at the surface of the object\n\n. Through networking, the way infrastructures are working is improved, harmonising methodologies and best practices in analysis and conservation, pursuing the establishment of a multidisciplinary synergic working method, based on shared use of knowledge and resources.','HUMAN','en',228330),(112,'LASERLAB-EUROPE II is a Consortium of Laser Research Infrastructures from the majority of the European member states, forming a FP7 Integrated Infrastructure Initiative. Given the importance of lasers and their applications in all areas of sciences, life sciences and technologies, the main objectives of the Consortium are:\n- To form a competitive, inter-disciplinary network of European national laser laboratories;\n- To strengthen the European leading role in laser research through Joint Research Activities (JRA), pushing the laser concept into new directions and opening up new applications of key importance;\n- To engage in the Transnational Access Programme in a co-ordinated fashion for the benefit of the European research community.\n- To increase the European basis in laser research and applications by reaching out to neighboring scientific communities and by assisting the development of Laser Research Infrastructures on both the national and the European level.','HUMAN','en',228334),(113,'The fundamental objective of the project is the further integration of existing European research facilities to a grid of reaction chambers in a continuation of the EUROCHAMP project. These facilities were created to study the impact of atmospheric processes e.g. on regional photochemistry, global change, as well as cultural heritage and human health effects under as realistic conditions as possible.\n\nAlthough initial advances in the application of large chambers occurred in the United States and Japan, Europe now leads the world in the use of large, highly instrumented chambers for atmospheric model development and evaluation. Smaller chambers that were designed for specific purposes and are operated by experts in their fields excellently supplement the larger chambers. The integration of all these environmental chamber facilities within the framework of the EUROCHAMP-2 project promotes the retention of Europe\'s international position of excellence in this area and is unique in its kind worldwide. The mobilization of a large number of stakeholders dealing with environmental chamber techniques provides an infrastructure to the research community at an European level that offers maximum support for a broad community of researchers from different disciplines.\n\nThe EUROCHAMP-2 project will foster the structuring effect of atmospheric chemistry activities performed in European environmental chambers within EUROCHAMP, since it offers the full availability of corresponding facilities for the whole European scientific community. With respect to the project objectives mentioned above, three network activities, two joint research activities and a transnational access activity are formulated and cross-linked in the EUROCHAMP-2 project.','HUMAN','en',228335),(114,'The quality of the infrastructures available for marine research affects directly Europe research performance. So marine research infrastructures are considered as key elements of the European Strategy for Marine Research under development. \n\nA coherent pan-European approach with enhanced partnership in investment, development and usage of fleets, will have a significant impact to better meet the diverse needs of European marine research. \n\nThe EUROFLEETS process is based on the recommendations of a recent MB-ESF report. It aims at bringing together the European research fleets owners to enhance their coordination and promote the cost-effective use of their facilities. \n\nIt will support research services for the monitoring and the sustainable management of the Regional Seas and the Oceans, and will organise a common access to all European scientists on sole condition of scientific excellence. This would enable the EU to reach its ambitious goals about maintaining the ocean biodiversity or understanding climate change. \n\nEUROFLEETS aims at: \n* Working upon common procurement strategy, and build corresponding roadmap on prospective sound bases, \n* Structuring and durably coordinating, through an e-platform, the way that the research vessels are operated and their interoperability capacities, \n* Using more cost efficiently the existing European fleets and associated equipment in the frame of the European research Area, \n* Promoting greener and sustainable research vessel and underwater vehicle operations and design, \n* Providing all European researchers with access to 19 high performing research vessels from 15 different countries, \n* Fostering coordinated and joint development of European fleets, thanks to new interoperable software and underwater vehicle payloads, \n* Developing training and education at sea, \n* Promoting innovative e-access, \n* Participating to the European efforts to stay at first rank in the international scientific arena.','HUMAN','en',228344),(115,'Europe possesses several experiment facilities holding the level 3 of bio safety, which is required to study the large majority of zoonoses, emerging diseases and a number of other animal infectious diseases. Most of them are nevertheless loosely connected, leading to redundancy. NAIF has as its strategic aim to realise the potential European leadership in animal infectiology by bringing together 14 L3 animal experiment infrastructures and organising the facilities in order to optimize their investigation and diagnostic/validation tools, achieve economies of scale and use the saved resources to modernise existing facilities in a coordinated manner. To achieve these goals, NADIR will 1) internally, upgrade the collaboration between the partners by setting an Internet-based joint workspace, strengthening the share of knowledge, best practices and ethical considerations, commonly managing biological resources, organising transnational access to the involved infrastructures, and jointly executing research activities designed to improve the services provided by these facilities; 2) externally, enhance access to the network?s infrastructures by setting up a electronic portal presenting all the infrastructures and services offered by the network in a unified way, providing access of non-member institutions to these infrastructures, coordinating actions with other relevant initiatives, and jointly presenting safety and ethical recommendations. NADIR is organised around four types of activities: i) three networking activities, consisting of internal and external communication, knowledge and best practices sharing, and biological resources joint management; ii) three research activities, made up of characterising animal lines, improvement of infection monitoring tools, and development of new infection models for emerging diseases; iii) as many transnational access activities as infrastructures involved in the network; iv) one project management work package.','HUMAN','en',228394),(116,'The main objective of HPC-Europa2 is to continue the provision of a high quality service for transnational access to the advanced HPC systems available in Europe. This activity has been available on an ongoing basis as a highly-rated and trusted service for almost two decades. The HPC-Europa2 partnership includes as Transnational Access centres CINECA (Italy), BSC (Spain), EPCC (UK), HLRS (Germany), SARA (The Netherlands), CINES ( France) and CSC (Finland). The project is organised around its core activity, the Transnational Access (TA) HPC service provision. Over the four year life span of the action, the TA will provide HPC services, specialist support, scientific tutoring and opportunities for collaboration to more than 1,000 European researchers. This very large community of users will be provided with more than 22 million of CPU hours of computing time.\n\nA number of Networking activities are implemented around the core business of the project:\nTo interact with the HPC ecosystem in Europe, mainly represented by DEISA and PRACE;\nTo coordinate the transnational access activities carried on by the different partners;\nTo coordinate the activities related to user support, consultancy support and the diffusion and dissemination of the HPC culture.\n\nThree Joint Research Activities are also integrated into the project;\nTo provide innovative solutions for parallel computing on massive parallel architectures;\nTo develop tools for scientific data services offering ease of access, analysis and visualisation of complex distributed data sets;\nTo create a virtual cluster environment which enables researchers to prepare and familiarise themselves with the HPC environment in advance of their visit, thus increasing the effectiveness and productivity of transnational access visits.','HUMAN','en',228398),(117,'The TRANSVAC infrastructure will accelerate the pharmaceutical and clinical development of promising vaccine candidates by bringing the gap between academic research and clinical trials through carefully managing the advancement of promising vaccine candidates from preclinical animal models to early proof-of-principle studies in humans. Although expertise already exists within Europe spanning different disease types, there is currently very limited coordination between vaccine R&D groups, assay developers and vaccine producers. \n\nUnarguably, fragmentation of expertise and facilities has slowed, and in some instances distinctly impeded, the development and validation of promising vaccine candidates. To address these challenges the European vaccine development community needs to establish a collaborative vaccine development infrastructure based on shared visions and goals. \n\nThe European Vaccine Initiative (EVI) and the Tuberculosis Vaccine Integrated (TBVI) Project have each demonstrated significant success in creating the know-how and infrastructures to enable the advancement of European vaccine development. In order to sustain the momentum generated by EVI and TBVI these successes will be built-upon to create an infrastructure driven by EVI, in which all stakeholders commit to sharing facilities and knowhow on vaccine development. \n\nThis consortium (TRANSVAC) will comprise major European stakeholders with expertise, resources and facilities for each stage of vaccine development, from the scientific community as well as vaccine developers. Each stakeholder can add to what EVI and TBVI have already established by adding their own expertise to the TRANSVAC long term strategy. \n\nTRANSVAC will be the European driving force for vaccine development, and will be accessible to any interested parties. This consortium will initiate a new era in the innovative, harmonised and rapid development of accessible and efficacious vaccines for Europe and the rest of the world.','HUMAN','en',228403),(118,'Mosquitoes transmit a variety of infectious diseases that cause a tremendous burden to public health. Due to climate changes and to the increase in international trade and tourism the threats posed by mosquitoes are increasingly affecting large parts of Europe, causing understandable concerns among the populations of many Member States. Control methods, mainly based on insecticide usage, are struggling to cope with the challenges posed by the biology and ecology of mosquito vectors.\n\nINFRAVEC aims at bridging the gap between the recent advances in transgenic technology and its implementation as a novel powerful approach for vector control. To this aim, a large European Infrastructure will be established, in which the coordination of efforts, expertise and facilities provided by the individual research groups and institutions will bolster and considerably expand the overall research capabilities of the research community.\n\nINFRAVEC will operate, through a number of Networking, Joint Research, Transnational and Service activities, towards the objective of considerably strengthening research capability in Europe by sharing knowledge, resources and technology. INFRAVEC will mainly focus on Anopheles gambiae, the major vector of malaria, and Aedes albopictus, a viral disease vector that is rapidly spreading through Europe.\n\nFour Infrastructure facilities will be integrated in the project:\n1) the Genetically Modified mosquito laboratory of Imperial College London;\n2) the Mosquito Mass-rearing facility at the Centro Agricoltura ed Ambiente (with the support of the International Atomic Energy Agency);\n3) the Bioinformatics facility at EMBLEBI, UK; and\n4) the Mosquito Confined Release facility at ISRIM.\n\nINFRAVEC will provide a formidable research capability to external users and facilitate the performance of five research projects aimed at utilizing basic knowledge of mosquito genetics and biology in an unprecedented effort to develop novel opportunities for mosquito control.','HUMAN','en',228421),(119,'ULICE is a 4-year project set up by 20 leading European research organisations, including 2 leading European industrial partners (Siemens and IBA), to respond to the need for greater access to hadron therapy facilities for particle therapy research. Project coordinator is the Italian Research Infrastructure Facility CNAO (Milan). Both existing European Hadron Research Facilities in Heidelberg and Milan are partner and together with the next operational centre (Philipps-Universitat Marburg; yr4) they will provide 624 hours of beam-time (141 users, 52 projects) to external researchers. Future facilities like MedAustron, Etoile and Archade also participate in ULICE, which will result in a strong integrated network. Full exploitation of all different resources, unrestricted spread of information and the improvement of existing and upcoming facilities are provided by using grid-based data sharing. The project is built around 3 pillars with measurable outputs. These outputs will be exploited by the (future) facilities and (partly by) the industrial partners: 1. JRA - focus on development of instruments and protocols: new gantry design, improvement of four-dimensional particle beam delivery, adaptive treatment planning, mechanisms for patient selection to the whole European Community and database development for specific tumours which can best be treated using carbon ion. 2. Networking - increasing cooperation between facilities and research communities wanting to work with the research infrastructure. Outputs will be (among others): a report on recommendations for strategically optimal locations for future RIs throughout Europe, training to new users 3. Transnational access: 2-step approach, using a combination of pre-defined (within ULICE) clinical trial programmes to allow researchers with patients to visit the facility, and radiobiological and physics experiments to take place.','HUMAN','en',228436),(120,'DERRI has as its primary objective the further integration of the European Distributed Energy Re-sources research community through the provision of User Access to a unique portfolio of important European Laboratories in the field of Distributed Energy Resources, focusing mainly system and architectural aspects of smart energy network based on Distributed Generation.','HUMAN','en',228449),(121,'Nuclear magnetic resonance (NMR) spectroscopy is a key technology for research in the modern Life Sciences, with an increasing impact on human health. This technology is unique in new areas of molecular systems biology providing detailed insight into protein-protein and protein-ligand interactions. NMR Research Infrastructures (RIs) are of primary importance here; they offer the resources necessary to conduct cutting-edge research and support a knowledge base among a broad group of European users.\n\nEurope has traditionally enjoyed a leadership role in NMR; to maintain this position in the face of increasing international competition, scientific and technological capabilities throughout the EU must be fully exploited. This requires the full mobilization of all European countries, including Eastern Europe, where NMR applications are sparse and tackling challenging scientific projects is less common. As a consequence, human resources are underused. Emerging technological and research frontiers must also continue to be addressed. \n\nThe EAST-NMR project responds to the new challenges facing NMR and its RIs, based on the I3 model. The project will:\n* provide transnational access to NMR instrumentation based in Eastern Europe by taking advantage of the experiences of another on-going European project (EU-NMR) and will provide access to solid-state NMR facilities, an emerging technology at the international level\n* educate and train researchers in NMR s potential and use, with special care for Eastern Europeans\n* advance in sample preparation technologies especially of difficult to tackle membrane proteins through joint research activities. \n\nThe project will impact research throughout the Life Sciences and pan-European potential for excellence in competitive sectors such as pharmaceuticals and biotechnology.','HUMAN','en',228461),(122,'It is an unfortunate truth that the current electronics is facing a brick wall in a decade or so when Moore\'s law has finally run its course an no further miniaturization is possible. We need something new. Coherent electron circuitry may provide that entirely new alternative. In nanocircuits the electrons can behave coherently over the circuit dimension and thus follow the rules of wave motion rather than Ohm\'s law.\n\nTo achieve coherence, however, electron scattering lengths must be larger than the sample size. That demands high purity to limit impurity scattering but even limiting thermal scattering by working at millikelvin temperature are still confined to circuits on the nanoscale. This provides the motivation for this application: there is an implicit imperative in nanoscience that there are enormous advantages to be gained at much lower temperatures. Despite the clear demand, nanoscience in general is inhibited from advancing beyond the millikelvin regime by a lack of appropriate expertise and facilities. However, in Europe we already have the greatest concentration of microkelvin infrastructure and espertise in the world, developed by our quantum-fluids community.\n\nBy integration and rationalization MICROKELVIN aims to put this existing infrastructure at the disposal of the wider communit y and together develope new techniques and materials to bring corerent structures into the completely new regime. Our ultimate aim is the creation of virtual European microkelvin \"laboratory without walls\" operating as a single entity. Integration will also allow us to pool our existing expertise and project it outword by greating new stand-alone machines able to access this temperature range anywhere. Such activity will also encourage European commercial interest in this opportunity. The infrastructure is there. The need is manifest. We simply have to bring the two together.','HUMAN','en',228464),(123,'Astroparticle Physics has become a mature and well accepted science discipline. Demonstrated by many world class projects currently developed and run by European Astroparticle physicists, Europe as a whole is the main promoter and leading the field. As a merit of ASPERA (AStroparticle Physics European Research Area network, http://www.aspera-eu.org ), the ERA-NET in Astroparticle Physics funded in the context of FP6 for 3 years starting in July 2006, the community as well as the supporting funding agencies are becoming more and more organised. In order to allow a deepening and broadening of the successful ERA-NET work started with ASPERA in FP6, the extended consortium here presents a work programme for a second ERA-NET phase (ASPERA-2).\n\nDirectly linked to the common action plan developed in ASPERA-1, the goals of ASPERA-2 are:\n1. establish joint activities as the preferred way of funding R&amp;amp;amp;D programmes and large projects,\n2. establish sustainable procedures of mutual coordination and benchmarking,\n3. create a sustainable structure for European Coordination in Astroparticle Physics,\n4. extend the network to all European countries with interest in Astroparticle Physics,\n5. increase the efforts towards global inter-regional coordination,\n6. update the roadmap,\n7. increase synergy with environmental sciences,\n8. transfer knowledge and technology with SMEs, and\n9. continue and extend outreach activities.','HUMAN','en',235489),(124,'The Heliophysics Integrated Observatory, HELIO,will deploy a new Europe-wide distributed network of services that will address the needs of a broad community of researchers in heliophysics.This new research field explores the Sun-Solar System Connection and requires the joint exploitation of solar, heliospheric, magnetospheric and ionospheric observations. HELIO will provide the most comprehensive integrated information system in this domain; it will coordinate access to the distributed resources needed by the community, and will provide access to services to mine and analyse the data.\n\nHELIO is designed around a Service-oriented Architecture. The initial infrastructure will include services based on metadata and data servers deployed by the European Grid of Solar Observations (EGSO; IST-2001-32409).We will extend these to address observations from all the disciplines of heliophysics; differences in the way the domains describe and handle the data will be resolved using semantic mapping techniques.Processing and storage services will allow the user to explore the data and create the products that meet stringent standards of interoperability.These capabilities will be orchestrated with the data and metadata services using the Taverna workflow tool.\n\nHELIO will address the challenges following the I3 activities model:\n- Networking we will cooperate closely with the community to define new standards for heliophysics and the required capabilities of the HELIO system;\n- Service we will integrate the services developed by the project and other groups to produce an infrastructure that can easily be extended to satisfy the growing needs of the community;\n- Joint Research we will develop search tools that span disciplinary boundaries and explore new types of user-friendly interfaces\n\nHELIO will be a key component of a worldwide effort to integrate heliophysics data and will coordinate closely with international organizations to exploit synergies with complementary domains.','HUMAN','en',238969),(125,'The goal of the SEALS project is to provide an independent and extensible infrastructure that allows the remote evaluation of semantic technologies and, therefore, the objective comparison of the different existing semantic technologies. This will allow researchers and users to effectively compare the available technologies, helping them to select appropriate technologies and advancing the state of the art through continuous evaluation. \n\nThe SEALS Platform will provide an integrated set of semantic technology evaluation services and test suites. They will be used in two public and world-wide evaluation campaigns. The results of these evaluation campaigns will be used to create semantic technology roadmaps identifying sets of efficient and compatible tools for developing large-scale semantic applications. \n\nThe semantic technology evaluation services will initially be available for five different types of technologies (ontology engineering tools, storage and reasoning systems, matching tools, semantic search tools, and semantic web service tools) and for different evaluation criteria (interoperability, scalability, etc.). The platform will provide easy and free access to the evaluation services and to the results of the evaluations performed.','HUMAN','en',238975),(126,'D4Science-II will develop technology to enable interoperation of diverse data e-Infrastructures that are running autonomously, thereby creating e-Infrastructure Ecosystems that can serve a significantly expanded set of communities dealing with multidisciplinary challenges whose solution is currently beyond reach. Furthermore, D4Science-II will bring together several scientific e-Infrastructures established in the areas of biodiversity, fishery resource management, high energy physics, etc., to set up a prototypical instance of such Ecosystem. This will support several critical scientific scenarios that are distinct but also feed into and enrich each other in nontrivial ways. Finally, possibly in collaboration with appropriate international bodies and initiatives, D4Science will take steps to ensure sustainability of the Ecosystem, some of them based on and synchronized with the dissemination, training and standardization activities of the project.\nTechnologically, D4Science-II constitutes a continuation of the DILIGENT and D4Science projects, which have initiated an effort towards using existing network, grid, and repository infrastructures to deploy on top of them a pan-European research e-Infrastructure that will enable unlimited generation and dissemination of scientific knowledge. As the next step towards this goal, D4Science-II will transform the current, operational D4Science e-Infrastructure into the linchpin of an e-Infrastructure Ecosystem, holding together and mediating between all participating e-Infrastructures through programmatically-available interoperability services.\nThe D4Science-II Ecosystem will include among others, the GENESI-DR and DRIVER repository e-Infrastructures, and important thematic repositories maintained by international organizations, e.g., INSPIRE and AquaMaps. The project will create Virtual Research Environments offering significantly enhanced services to scientist without incurring high development and maintenance costs.','HUMAN','en',239019),(127,'Many research groups and institutes within the European Research Area (ERA) are playing a central role in the production of a vast range of atomic and molecular (AM) data, data that is of critical importance across a wide range of applications such as astrophysics, atmospheric physics, fusion, environmental sciences, combustion chemistry and in industrial applications from plasmas to lighting. Through the auspices of this infrastructure the Virtual Atomic and Molecular Data Centre (VAMDC) aims to build a secure, documented, flexible and interoperable e-science environment-based interface to the existing AM data. The VAMDC will be built upon the expertise of existing AM databases, data producers and service providers with the specific aim of creating an infrastructure that is easily tuned to the requirements of a wide variety of users in academic, governmental, industrial or public communities both within and outside the ERA. The project will cover the building of the core consortium, the development and deployment of the infrastructure and the development of interfaces to the existing AM databases as well as providing a forum for training potential users and dissemination of expertise across the ERA. It is expected that VAMDC becomes a European legal entity during the course of the project.','HUMAN','en',239108),(128,'EUMEDGRID-Support aims at reinforcing the relevance of European e-Infrastructures in the Mediterranean and Middle-east regions. The project will build on the results obtained by EUMEDCONNECT/ EUMEDCONNECT2 and the preceding project EUMEDGRID, which successfully deployed a research and education network and a pilot Grid infrastructure, respectively, presently covering almost all the Mediterranean Area. An agreement has been signed among the EUMEDGRID partners to keep open, to the best of their capabilities, the existing Infrastructure and EUMEDGRID-Support wants, not only to consolidate and expand it, but also to make a step forward towards its sustainability.\n\nThe overarching objective of EUMEDGRID-Support is to retain the European and Mediterranean country dialogue achieved in the past as well as to increase stakeholders and community awareness on the fundamental importance of e-Infrastructures in the Mediterranean and on their sustainability.\n\nThe project will use the consolidated schema of a two-fold approach: A bottom-up, raising the awareness of researchers, students and technical personnel, which will exploit the usage of e-Infrastructures in their work and appreciate their value, and a top-down approach at the high policy-level highlighting the benefits and justifying the necessity of e-Infrastructures to influential stakeholders in order to push for a long term stability and sustainability of such e-Infrastructures.','HUMAN','en',246589),(129,'The main objective of the DC-NET project is to develop and to strengthen the co-ordination among the European countries of public research programmes in the sector of the digital cultural heritage. The project will integrate the research capacities of the participant member states, will identify their communalities and will valorize existing programmes and projects in order to initiate the deployment of a wide and comprehensive European e-Infrastructure that will increase the research capacities of the digital cultural heritage community.\n\nThe DC-NET project will contribute to the coordination of coordinate the research priorities of accessing of e-Infrastructures by the Ministries of Culture, their Agencies and other cultural bodies (museums, libraries, archives, audiovisual, archaeological sites, etc.) across Europe in the area of the e-Infrastructures targeted to the digital cultural heritage. Eight governments and agencies will agree a set of common priorities for digital cultural heritage research and will work with e-Infrastructures providers to identify how best to carry out this research using the National Research and Education Networks.\n\nThe project will coordinate the manner in which cultural actors can and should engage with national and European e-Infrastructures to generate innovative services, tools and data sets to support the multidisciplinary research of multidisciplinary communities. A programme of seminars, workshops, meetings and conferences will involve all the relevant stakeholders. A plan of joint activities for e-Infrastructure-enabled research in the sector of digital cultural heritage will be generated and the joint activities will be initiated.','HUMAN','en',246618),(130,'A new ERA-NET is proposed to further the integration of national, EC and global e-infrastructure programmes. An experienced consortium comprising relevant national programme managers is proposed to develop the ERA-NET, called e-InfraNet. The partners know well the existing policy initiatives and identify a gap in the uptake and integration of innovative policy at national and EC level.\n\nA sustainable ERA-NET will be established which will build on existing initiatives and develop a long term approach to the point of implementing joint programmes and calls. A structure is setup to prioritise a sequence of focus areas for collaboration through initial scoping workshops, development of action plans and implementation of initial or pilot joint activities. E-InfraNet aims to engage with programme managers outside the initial consortium and disseminate results widely to this key target group globally. Dissemination and networking activities are built into every stage of the workprogramme.\n\nA key long-term impact will be the more efficient use of resources, and the adoption of best-practice in national e-infrastructure programmes. E-InfraNet will lead to a convergence of funding programmes and avoid unnecessary overlap. The variable geometry approach will allow for progress to be made, while giving flexibility to adjust to national requirements and leave the route open to all to build on successful joint actions.','HUMAN','en',246651),(131,'ERINA4Africa is an initiative aimed at fostering cooperation between the EU and Africa with a win-win perspective: \n1) Africa may benefit from the development of Research Infrastructure policies based on EU experiences and best practices, and \n2) the EU will have the chance to demonstrate on-the-field benefits of exploiting Research Infrastructure in key ICT areas where public funding would be relevant, namely e-Government, e-Health and e-Learning. \n\nBased on the results of a recent study funded by the EC (ERINA, www.erina-study.eu), this proposal aims to provide African and EU policy makers with a detailed analysis of exploitable scenarios of existing (and new) e-Infrastructures in Africa, by means of: \n1. A virtual observatory on trends and current evolution of e-Infrastructures in Africa, including a strict relation with academic as well as industrial communities, with the perspective of gathering concrete requirements to boost Academic and Industrial research. \n2. A foresight study identifying qualitative as well as quantitative benefits in adopting African Research Infrastructures as basic building blocks for other key IST areas (the qualitative analysis and the methodology were developed in the former ERINA study). \n3. A series of virtual conferences and local meetings to both promote and validate the project results. \n\nThe project activities will allow the actors of the African e-Infrastructures ecosystems to network and share knowledge, and will foster easier communications and dissemination between the EU and Africa on an ongoing basis. Moreover ERINA4Africa has a green core. It will be managed to monitor and reduce as much as possible any paper usage, travelling alongside the world and energy consumption in general. This collateral exercise would demonstrate the possibility to have efficient while green research. Through the web site such metrics will be continuously monitored, providing concrete suggestions to reduce the impact of research projects...','HUMAN','en',246663),(132,'A Vision for Global Research Data Infrastructures GRDI2020 aims to define a framework of technological, organizational, & policy recommendations to guide the development of an ecosystem of Global Research Data Infrastructures. The project activities are aimed at mobilizing user communities, international initiatives, leading experts and policy makers worldwide in the GRDI2020 plan.\n\nGRDI2020 is submitted at a crucial time since large data infrastructures have been developed that require integration onto a new expanded Global Data Infrastructure. The current 4 strong consortium from IT, UK, GR & SE was instrumental in the results achieved at 3 prior GRL2020 meetings in: US,\'07; Europe, IT,\'08; Asia, TW,\'09 to take forward in a coordinated approach.\n\nGRDI2020 leads as an obvious follow-up to these events to ensure a sustained action to serve an international forum for all European and global major initiatives for the purpose of presenting, discussing & tackling the major issues in the development of a sustainable Global Research Data Infrastructure.\n\nGRDI2020 major results:\n- A Roadmap Report addressing the application, technological and organizational issues involved in the development of a sustainable Global Scientific Data Infrastructure.\n- Working Group (WG) meetings offering a forum for focused discussions concerning technological, organizational and application aspects of Research Data Infrastructures.\n- Thematic Reports and whitepapers on user requirements, technological and policy aspects of Research Data Infrastructures.\n- Analysis Report containing an in depth analysis of policy documents on information infrastructures produced by funding agencies, ad-hoc committees, and scientific organizations worldwide.\n\nGRDI2020 will operate 2 active WGs of leading external expert collaborators and advisory committee members in data Infrastructures and disseminate its achievements to the wider community by organizing Thematic Working meetings and 2 international events','HUMAN','en',246682),(133,'The proposed project will deliver an electronic infrastructure and supporting mechanisms for the identification, deposition, access, and monitoring of FP7 and ERC funded articles, where the main supporting mechanism will be the establishment and operation of the European Helpdesk System. Additionally, the project will offer a special repository for articles that can be stored neither in institutional nor in subject-based/thematic repositories, while it will also prepare the way for similar functionality on scientific data. All deposited articles and data will be freely accessible worldwide through a new portal to the products of EU-funded research, built as part of this project. It will also connect research input (project contracts) with research output (publications and data) and monitor the system use to obtain statistically-significant trends about both. \n\nThematically, the project will focus on peer-reviewed publications (primarily, journal articles in final or pre-print form, but also conference articles, when considered important) in at least the seven disciplines highlighted in the Open Access pilot (energy, environment, health, cognitive systems-interaction-robotics, electronic infrastructures, science in society, and socioeconomic sciences-humanities) and on research datasets in a subset of them. \n\nGeographically, however, it will have a definitive European footprint by covering the European Union in its entirety, engaging people and scientific repositories in almost all 27 member states and beyond. \n\nThe electronic infrastructure built by the project will be based on state-of-the-art software services of the D-NET package developed within the DRIVER and DRIVER-II projects and the Invenio digital repository software developed at CERN. These will be further enhanced and complemented with services developed within OpenAIRE to address critical requirements and issues that arise in the target environment and require further investigation.','HUMAN','en',246686),(134,'EU-IndiaGrid2, capitalising on the achievements of the FP6 EU-IndiaGrid (EUIG1) project and huge developments in India on infrastructure and leveraging the expertise and experience obtained by its partners during EUIG1, will continue the momentum, attained in e-Infrastructures evolution in Europe and India, to create and ensure sustainable collaboration in many new areas of science, education and technology across the two regions.\n\nEU-IndiaGrid2 main objectives are to:\n\nO1) consolidate & enhance cooperation between European and Indian e-Infrastructures for the benefit of EU-Indian collaboration in e-Science EU-IndiaGrid2 will make full use of the EUIG1 project achievements and of the strong cooperation links established with the foremost European and Indian e-Infrastructure initiatives paving the way for successful sustainable cooperation across European and Indian e-Infrastructures. \nO2) support a set of new grid applications in areas strategic for EU-Indian collaboration EU-IndiaGrid2 will support a set of applications in the domain of Climate Change, High energy Physics, Biology, Material Science which are considered strategic for EU-Indian collaboration in the ICT domain. \nO3) ensure a sustainable approach to e-Infrastructures across Europe and India through dissemination actions, meetings & workshops EU-IndiaGrid2 will continue supporting the Roadmap for Sustainability outlined by the EUIG1 project relying on the progress towards objectives O1 and O2 and on targeted dissemination actions, meetings and events \nO4) foster and enhance cooperation with other European Initiatives in the Asian region and worldwide EU-IndiaGrid2 will continue the strong cooperation links established by EUIG1 with the most relevant projects and institutions e.g. EGEE/EGI, GEANT and the major Indian e-Infrastructure Initiatives as GARUDA NGI and NKN. It will also cooperate with regional projects like EELA2, EuAsiaGrid, SEEGRID and, if approved the EUMEDSupport and EUChinaGrid2 proj','HUMAN','en',246698),(135,'In the Lisbon strategy, the 2005 European Council identified knowledge and innovation as the engines of sustainable growth and stated that it is essential to build a fully inclusive information society. In parallel, the World Conference on Disaster Reduction (Hyogo, 2005), defined among its thematic priorities the improvement of international cooperation in hydrometeorology research activities. Hydro-meteorological science has made strong progress over the last decade at the European and worldwide level: new modeling tools, post processing methodologies and observational data are available. \n\nIn principle, a huge amount of hydro-meteorological data and information is available for the European region, but enormous scientific and technical obstacles have to be overcome when mining the data. Recent European efforts in developing a platform for e-science, like EGEE (Enabling Grids for E-science), SEE-GRID-SCI (South East Europe -GRID e-Infrastructure for regional e-Science), and the German C3-Grid, provide an ideal basis for the sharing of complex hydro-meteorological data sets and tools. Despite these early initiatives, however, the awareness of the potential of the Grid technology as a catalyst for future hydro-meteorological research is still low and both the adoption and the exploitation have astonishingly been slow, not only within individual EC member states, but also on a European scale. \n\nWith this background in mind, the goal of the Distributed Research Infrastructure for Hydro-Meteorology Study (DRIHMS) project is the promotion of the Grid culture within the European hydro-meteorological research community through the diffusion of a Grid platform for e-collaboration in this earth science sector: the idea is to further boost European research excellence and competitiveness in the fields of hydro-meteorological research and Grid research by bridging the gaps between these two scientific communities.','HUMAN','en',246703),(136,'Between e-Infrastructures, ESFRI has identified in FP7 High Performance Computing a strategic priority for Europe. The cost of the related RI is steadily increasing as well, insomuch as, today, the most advanced computing facilities can be conceived only on trans-national or even continental basis, with a joint contribution of a number of different member states. A paradigmatic example is represented by PRACE. In order to have the highest return from such massive economical and political commitment, HPC resources must be exploited at the highest level. \n\nTheir access must be effective and capillary; their services must allow more and more people to use the resources. Homogeneous and effective selection and evaluation procedures for HPC users and related research projects must be defined, to guarantee the excellence of the scientific objectives and the suitability to international research programs and main scientific development streamlines. Cooperation and coordination between the HPC stakeholders is necessary to define the path-forward to the next generation of computing services. \n\nHPC-World will address these issues, with the objective of identifying a standard set of criteria and procedures and an associated methodology to drive the largest HPC e-Infrastructure initiatives in the deployment of services, in the allocation of resources and in the support to users’ access. In particular, the project will model its activities and outcomes on PRACE, in order to offer a mature and effective methodology, to manage its access activities and resources allocation procedures, providing the instrument to deploy and exploit promptly, and with tuned policies and strategies, the available infrastructures. The involvement of non-European partners will strongly improve and enrich, the outcomes of the project and strengthen the international cooperation between the European HPC RI and similar RIs from other regions, promoting synergies beyond the continental boundaries','HUMAN','en',246711),(137,'Over the past 6 years, the EC has invested to extend the European eInfrastructure technology and European eInfrastructure (and particularly Grid) operational and organizational principles to a number of regions in the world, and reinforcing the close collaboration and exchange of know-how with similar technologies in other areas. A number of different collaboration models have thus been established between Europe and the rest of the world, while the projects implementing these collaborations have had impacts typically focused on their regions. \n\nThe CHAIN project aims to coordinate and leverage these efforts and their results with a vision of a harmonized and optimized interaction model for eInfrastructure and specifically Grid interfaces between Europe and the rest of the world. \n\nThe project will elaborate a strategy and define the instruments in order to ensure coordination and interoperation of the European Grid Infrastructures with other external e-Infrastructures. \n\nThe CHAIN consortium, consisting of leading organizations in all the regions addressed by the project, will ensure global coverage, European leadership, and most efficient leveraging of results with respect to preceding regional initiatives. First, the project will define a coherent operational and organisational model, where a number of EU countries/regions will possibly act, in collaboration with EGI.eu, as bridges/gateways to other Regions/Continents. Further, the project will validate this model by supporting the extension and consolidation of worldwide virtual communities, which increasingly require distributed facilities (large instruments, distributed data and databases, digital repositories, etc.) across the regions for trans-continental research. Finally, the project will act as a worldwide policy-watch and coordination instrument, by exploring and proposing concrete steps for the coordination with other initiatives and studying the evolution of e-Infrastructures.','HUMAN','en',260011),(138,'Over the last 10 years, the European Commission and governments have invested substantial funds in scientific grid computing. Scientists have access to state-of-the-art computational and data resources located around the world, putting European research into a leading position to address the greatest challenges facing us today, such as climate change, pandemics and sustainable energy. \n\nWith the advent of the European Grid Infrastructure and the associated fundamental changes to the way that grid computing will evolve in the future, combined with the blurring of boundaries between grids, clouds, supercomputing networks and volunteer grids, a clear consistent source of information aimed at non-experts is now more important than ever, through dissemination projects that cross national boundaries. \n\ne-ScienceTalk will build on the outstanding achievements of the GridTalk project in bringing the success stories of Europe s e-Infrastructure to policy makers in government and business, to the scientific community and to the general public. E-ScienceTalk will work with the EGI and other collaborating projects to expand the scope of the existing GridTalk outputs, to report on the interactions of grids with e-Infrastructures such as cloud computing and supercomputing, and will also explore options for the sustainability of e-ScienceTalk s products. \n\ne-ScienceTalk will produce a series of reports aimed at policy makers to disseminate key policy issues underpinning grid and e-Infrastructure development in Europe and coordinate e-concentration activities. The GridCafé, GridCast and GridGuide suite of websites will cover new topics and explore novel web technologies, as well as integrating more closely with GridPP s Real Time Monitor to combine live views of grid activity with the human aspects of computing. The growing weekly publication, International Science Grid This Week (iSGTW) will bring news and events to the existing and potential e-Science community.','HUMAN','en',260733),(139,'Scientific research is no longer conducted within national boundaries and is becoming increasing dependent on the large-scale analysis of data, generated from instruments or computer simulations housed in trans-national facilities, by using e Infrastructure (distributed computing and storage resources linked by high-performance networks). \n\nThe 48 month EGI-InSPIRE project will continue the transition to a sustainable pan-European e-Infrastructure started in EGEE-III. It will sustain support for Grids of high-performance and high-throughput computing resources, while seeking to integrate new Distributed Computing Infrastructures (DCIs), i.e. Clouds, SuperComputing, Desktop Grids, etc., as they are required by the European user community. It will establish a central coordinating organisation, EGI.eu, and support the staff throughout Europe necessary to integrate and interoperate individual national grid infrastructures. \n\nEGI.eu will provide a coordinating hub for European DCIs, working to bring existing technologies into a single integrated persistent production infrastructure for researchers within the European Research Area. EGI-InSPIRE will collect requirements and provide user-support for the current and new (e.g. ESFRI) users. Support will also be given for the current heavy users as they move their critical services and tools from a central support model to ones driven by their own individual communities. \n\nThe project will define, verify and integrate within the Unified Middleware Distribution, the middleware from external providers needed to access the e-Infrastructure. The operational tools will be extended by the project to support a national operational deployment model, include new DCI technologies in the production infrastructure and the associated accounting information to help define EGI\'s future revenue model.','HUMAN','en',261323),(140,'The INDICATE project will coordinate policy and best practice regarding the use of e-Infrastructures for digital cultural heritage in countries all around the Mediterranean. \n\nThe project will establish and nurture a network of common interest made up of experts and researchers in all the relevant fields, whose sustainability will be planned on a long term beyond the project duration. The network will share experience, promote standards and guidelines, seek harmonisation of best practice and policy and act as a conduit for knowledge transfer from countries with more experience of e-Infrastructures-enabled e-culture to those who are just beginning to investigate this area. \n\nThe project will be rooted in the reality of research pilots and case studies which will act as exemplars and demonstrators of the issues and the processes which are relevant to establishing cultural initiatives on the e-Infrastructures platform. The results will inform a wide-reaching dissemination work-package, including two major public best practice deliverables, one international conference, three technical workshops and one policy workshop. \n\nThe project builds on a wealth of experience in effective international coordination of digitisation, digital cultural heritage and e-Infrastructures-enabled culture. It takes full cognisance and advantage of e-Infrastructures and cultural projects which have gone before and will actively seek interaction and synergies with other projects in this area. The impact on international collaboration and on digital cultural heritage in the Mediterranean region will be substantial.','HUMAN','en',261324),(141,'The GISELA objective is to guarantee the long-term sustainability of the European-Latin American e-Infrastructure and thus ensure the continuity and enhancement of the Virtual Research Communities (VRC) using it. The project will focus on: \n\n\n- Implementing the Latin American Grid Initiative (LGI) sustainability model rooted on National Grid Initiatives (NGI) or Equivalent Domestic Grid Structures (EDGS), in association with CLARA and collaborating with EGI; \n- Providing VRCs with the e-Infrastructure and Application-related Services required to improve the effectiveness of their research, addressing both: \n- Current EELA-2 small User Communities; \n- Larger VRCs through Specialised Support Centres (SSCs). \n\nThe GISELA mission is twofold: \n- Ensure the sustainability of the EU-LA e-Infrastructure \n\nThe sustainability of the EU part of the e-Infrastructure being cared of by EGI, GISELA will concentrate on its LA component. The tasks, at each level of the e-Infrastructure are: \n- Institution: Get all Services fully operational in the Resource Centre (RC); \n- Country: Implement all Grid Operation Centre (GOC) Services; \n- Continent: Implement all Grid & Network Support Centres (GSC, NSC) Services; \n- Support a catchall GOC. \n- Support Virtual Research Communities \n\nThe support will encompass: \n\nUser Support: \n- Provide access to the EU-LA Infrastructure to VOs represented in GISELA (HEP, Life Sciences, Earth Sciences, etc.); \n- Publicise and support the GISELA e-Infrastructure and Application Services; \n- Collaborate with VRCs or SSCs to the development of integrated services (e.g. gateways). \n\nTraining & Dissemination activities \n- Organisation of tutorials for single users and VRCs; \n- Coordinate dissemination actions, workshops, Conferences; \n- Produce dissemination material. \n\nGrid Services for VRCs will be provided by CLARA on the basis of a business plan using a Life Cycle Product Management (LCPM) approach.','HUMAN','en',261487),(142,'Core European eInfrastructure for large-scale eScience research consists of the backbone GÉANT network; distributed storage & computing infrastructure - European Grid Initiative (EGI); and the PRACE initiative providing tier-0 High Performance Computing (HPC) infrastructure. South-East European eInfrastructure initiatives aim for equal participation of the less-resourced countries of the region in the European trends. SEEREN initiative established a regional network and the SEE-GRID initiative the regional Grid, with majority of countries now equal partners in GÉANT and EGI. BSI project established the GÉANT link to the Caucasus, active until mid-2010. However, HPC involvement of the region is limited. Only few HPC installations are available, not open to cross-border research; while the less-resourced countries have no mechanism established for interfacing to the pan-European HPC initiatives.\n\nHP-SEE focuses on a number of strategic actions. First, it will link the existing and upcoming HPC facilities in the region in a common infrastructure, and provide operational solutions for it. As a complementary action, the project will establish and maintain the GÉANT link for Caucasus. Second, it will open this HPC infrastructure to a wide range of new user communities, including those of less-resourced countries, fostering collaboration and providing advanced capabilities to researchers, with an emphasis on strategic groups in computational physics, chemistry and life sciences. Finally, it will ensure establishment of national HPC initiatives, and act as a SEE bridge for PRACE. In this context, HP-SEE will aim to attract the local political & financial support for long-term sustainable eInfrastructure.\n\nHP-SEE aspires to contribute to the stabilisation and development of South-East Europe, by overcoming fragmentation in Europe and stimulating eInfrastructure development and adoption by new virtual research communities, thus enabling collaborative high-quality research across a spectrum of scientific fields.','HUMAN','en',261499),(143,'Today scientists and engineers are commonly faced with the challenge of modelling, predicting and controlling multi-scale systems which cross scientific disciplines and where several processes acting at different scales coexist and interact. Such multidisciplinary multi-scale models, when simulated in three dimensions, require large scale or even extreme scale computing capabilities. Progress in science and technology is limited by our ability to solve efficiently such problems on available distributed computing infrastructures. The MAPPER project will respond to this critical need by developing computational strategies, software and services for distributed multi-scale simulations across disciplines, exploiting existing and evolving European e-Infrastructure. Driven by seven challenging applications from five representative scientific domains (fusion, clinical decision making, systems biology, nano-science, engineering), \n\nMAPPER will deploy a computational science environment for distributed multi-scale computing on and across European e-infrastructures. By taking advantage of existing software and services, as delivered by EU and national projects, MAPPER will result in high quality components for today s e-Infrastructures. \n\nWe will advance the state-of-the-art in high performance computing on European e-Infrastructures by enabling distributed execution of multi-scale models. \n\nWe will develop tools, software and services that allow two modes (loosely - and tightly coupled) of multi-scale computing, in a user friendly and transparent way. \n\nWe will integrate our applications into the MAPPER environment, and we will demonstrate their enhanced capabilities by answering one challenging scientific question related to each application. We plan to collaborate with other projects on adaptation of successful MAPPER methodologies, and will work with resource providers to develop policies facilitating the new multi-scale computing paradigms.','HUMAN','en',261507),(144,'The European Exascale Software Initiative (EESI) goal is to build a European vision and roadmap to address the challenge of the new generation of massively parallel systems composed of millions of heterogeneous cores which will provide Petaflop performances in 2010 and Exaflop performances in 2020. These capabilities lead to outstanding technological breakthrough possibilities in computations and simulations which will be reached only if an international cooperation work program is set up. \n\nThis will be done through a set of conferences and work groups involving a very large number of HPC European actors and users. They will investigate where Europe stands in the overall international HPC landscape and competition, what are its strengths and weaknesses, and whether such or such topics and challenges should be addressed inside or outside Europe. EESI will also identify the sources of competitiveness for Europe induced by the development of Peta/Exascale solutions and usages. \n\nThe overall challenge must be faced at worldwide level to be attainable. A close collaboration with the EU PRACE project which is preparing the tier-0 level of the European HPC ecosystem, will be implemented. Coordination with the International Exascale Software Project (IESP) launched by The Department Of Energy (Office of Science), National Science Foundation and Department Of Defense is planned. The project leader of IESP, Jack Dongarra, and the Japanese executive member of IESP, Satoshi Matsuoka, are contributing participants of EESI. \n\nExpected outputs of the project are a roadmap and a set of recommendations shared by the European HPC community, on tools, methods and applications to be developed for this new generation of supercomputers. Coordination with international actors working on the same goal will have been effectively established.','HUMAN','en',261513),(145,'Since its inception, Central and Eastern European Networking Association (CEENet) has played an essential and significant role in the creation, incubation and development of National Research and Education Networks (NRENs) in Central, Eastern, Southern Europe and Central Asia. In many ways this mission and goals that emanate from it have been accomplished through a range of objectives from different domains such as education and training both on technical and strategic levels, introduction of innovative and specialised services like the ones afforded by CERTs, and feasibility and planning studies of computing and communication infrastructures nationally and regionally. Recently, CEENet did an assessment and evaluation study of its position and activities with an outlook for the future, and consequently one of the results has been that the Association engages more intensively and aggressively in supporting, even more than in the past, developing NRENs in the areas which are both complementary to and enabling towards GEANT3. \n\nThe project Central and Eastern European Networking EnGINE (CEENGINE) that relies heavily on the unqualified experience, expertise and competence of CEENet in CEE, Caucasus and Central Asia aims to fulfill the following objectives: coordination of the activities between national and pan-European e-Infrastructure initiatives; raising awareness and transferring the technical know-how necessary for the extension, adoption and usage of the high speed networking infrastructure (GÉANT) and some cross-border connections that may include dark fibre procurement; fostering international cooperation in the eventual extension of GEANT towards the East; wide and effective knowledge dissemination concerning the e-Infrastructure programme and related projects (GEANT, BSI, CAREN, various GRID and HPC initiatives) among all of the NRENs users and various research organizations. \n\nIt is expected that the objectives would be accomplished by organizing several workshops (in the areas of technology, policy/management, and user communities and services); revision and updating of the appropriate data repositories with respect to user communities, international collaboration and competence availability; preparation of the informational sources such as portal, newsletters, and various promo materials that also includes establishment of a PR team; co-organisation and participation in at least nine different dissemination events; support of creation of researchers groups from ICPC countries willing to participate in the research in the field of e-infrastructures; and to facilitate the close cooperation of a number of NRENs with GEANT Furthermore, the project should produce a study termed as CEENet GO (Global Outreach) concept that would reflect the interests and the activities of CEENet relative to the extension of CEENet to other geographical areas through innovative types of partnerships and memberships in the fut','HUMAN','en',261517),(146,'The co-ordinated and integrated approach of HYDRALAB aims at structuring the access to unique and costly hydraulic and ice engineering research infrastructures in the European Research Area. The network of HYDRALAB is unique in the hydraulic research community and has large experience in co-operating since its start in 1997. It began by informing and co-ordinating the activities of the partners in HYDRALAB I and II, and via strong collaboration in HYDRALAB III we will now realize further integration of our research services in Europe in HYDRALAB IV. Over the course of 10 years our network has grown from 8 participants in 1997 to a total of 30 participants from 15 countries today. Research in our infrastructures deals with complex questions regarding the interaction of water with environmental elements, sediment, structures and ice and goes beyond just hydraulic research: hence we have adopted the theme More than water. Questions that we need to answer deal with e.g. the development of adaptive strategies to climate change and sustainable measures against natural hazards, like floods. \n\nA fully integrated and balanced ensemble of Networking Activities (5), Joint Research Activities (4) and Transnational Access Activities (10) enhances the operation of our infrastructures and their instrumentation facilities beyond the present state-of-the-art and identifies potential future developments. By means of the common User Selection Procedure optimal access is guaranteed. With our dissemination events we foster a culture of co-operation between the participants and the wider user community. Further objectives of HYDRALAB IV are to improve access to experimental data, by providing researchers with a database on results of experiments, and bring young researchers and first time users from across Europe to the cutting edge of experimental research. As compared to the first proposal for HYDRALAB IV this proposal is improved with the recommendations made by the review panel.','HUMAN','en',261520),(147,'Life Science is developing into one of the largest e- Infrastructure users in Europe, in part due to the ever-growing amount of biological data. Modern drug design typically includes both sequence bioinformatics, in silico virtual screening, and free energy calculations, e.g. of drug binding. This development will accelerate tremendously, and puts high demands on simulation software and support services. e-Infrastructure projects such as PRACE/DEISA have made important advances on hardware and scalability, but have largely been focused on theoretical scalability for large systems, while typical life science applications rather concern small-to-medium size molecules. Here, we propose to address this with by implementing new techniques for efficient small-system parallelization combined with throughput and ensemble computing to enable the life science community to exploit the largest next-generation e-Infrastructures. We will also build a new cross-disciplinary Competence Network for all of life science, to position Europe as the world-leading community for development and maintenance of this software e-Infrastructure. \n\nSpecifically, we will \n(1) develop new hierarchical parallelization approaches explicitly based on ensemble and high-throughput computing for new multi-core and streaming/GPU architectures, and establish open software standards for data storage and exchange, \n(2) implement, document, and maintain such techniques in pilot European open-source codes such as the widely used GROMACS & DALTON, a new application for ensemble simulation (DISCRETE), and large-scale bioinformatics protein annotation, \n(3) create a Competence Centre for scalable life science software to strengthen Europe as a major software provider and to enable the community to exploit e-Infrastructures to their full extent. This Competence Network will provide training and support infrastructure, and establish a long-term framework for maintenance and optimization of life science codes.','HUMAN','en',261523),(148,'The objective of Novel EXplorations Pushing Robust e-VLBI Services (NEXPReS) is to offer enhanced scientific performance for all use of the European VLBI Network (EVN) and its partners. \n\nThe proposed activities will allow the introduction of an e-VLBI component to every experiment, aiming for enhanced robustness, flexibility and sensitivity. This will boost the scientific capability of this distributed facility and offer better data quality and deeper images of the radio sky to a larger number of astronomers. In the past years, e-VLBI has been successfully introduced for real-time, high-resolution radio astronomy. Due to limitations in connectivity, bandwidth and processing capacity, this enhanced mode cannot be offered to all astronomers yet, in spite of its obvious advantages. By providing transparent buffering mechanisms at telescope and correlator it will be possible to address all the current and future bottlenecks in e-VLBI, overcoming limited connectivity to essential stations or network failures, all but eliminating the need for physical transport of magnetic media. Such a scheme will be far more efficient, and ultimately greener, than the current model, in which complex logistics and a large over-capacity of disks are needed to accommodate global observations. \n\nIt will require high-speed recording hardware, as well as software systems that hide all complexity. Real-time grid computing and high bandwidth on demand will be addressed as well, to improve both the continuous usage of the network and prepare the EVN for the higher bandwidths which will ensure it will remain the most sensitive VLBI array in the world. The proposed programme will strengthen the collaboration between the European radio-astronomical and ICT communities. This will be essential to maintain Europe\'s leading role in the global SKA project.','HUMAN','en',261525),(149,'Current National Research and Education Networks (NRENs) in Europe provide connectivity services to their customers: the research and education community. Traditionally these services have been delivered on a manual basis, although some efforts towards automating the service setup and operation have been initiated. At the same time, more focus is being put in the ability of the community to control some characteristics of these connectivity services, so that users can change some of the service characteristics without having to renegotiate with the service provider. \n\nThe MANTYCHORE project wants to consolidate this trend and allow the NRENs to provide a complete, flexible IP network service that allows research communities to create an IP network under their control, where they can configure: \ni) layer 1 -optical- \nii) layer 2 - Ethernet and MPLS- and \niii) layer 3 -IP addressing, internal routing, peering, firewalls-. \n\nTo achieve its goals, MANTYCHORE FP7 will integrate and improve the tools developed by the past, privately funded MANTICORE projects and related initiatives (IaaS Framework efforts), and produce a robust and extensible software to operate and use the IP network service. MANTYCHORE will carry out pre-operational deployments of the IP network service at two NRENS: HEAnet and NORDUnet. Initially three communities of researchers will benefit from this service: the Nordic Health Data Network, the British Advance High Quality Media Services and the Irish Grid effort. Part of the project effort will be dedicated to consolidate and enhance the community of providers (NRENs but also commercial) and users of the IP network service. \n\nFinally, the JRAs will research two important topics to improve the IP network service: \ni) an infrastructure resource marketplace, to further automate the negotiation of the resources that comprise the IP network; and \nii) the use of renewable energy sources to power e-Infrastructures, so that they can become carbon neutral.','HUMAN','en',261527),(150,'The transition from science to e-Science is happening: a data deluge emerges from publicly- funded research facilities; a massive investment of public funds into the potential answer to the grand challenges of our times. This potential can only be realised by adding an interoperable data sharing, re-use and preservation layer to the emerging eco-system of e-Infrastructures. The importance of this layer, on top of emerging connectivity and computational layers, has not yet been addressed coherently at ERA or global level. All stakeholders in the scientific process must be involved in its design this layer: policy makers, funders, infrastructure operators, data centres, data providers and users, libraries and publishers. \n\nODE is proposed by the Alliance for Permanent Access and four of its members: CERN, Finnish Computer Centre for Science, Helmholtz Association and UK Science and Technology Funding Council. Collectively, we represent all the stakeholder groups listed above and have a significant sphere of influence within those communities. This will allow us to identify, collate, interpret and deliver evidence of emerging best practices in sharing, re-using, preserving and citing data, the drivers for these changes and barriers impeding progress, in forms suited to each audience. We will: \n-Enable operators, funders, designers and users of national and pan-european e-Infrastructures to compare their vision and explore shared opportunities \n-Provide projections of potential data re-use within research and educational communities in and beyond the ERA, their needs and differences \n-Demonstrate and improve understanding of best practices in the design of e-Infrastructures leading to more coherent national policies \n-Document success stories in data sharing, visionary policies to enable data re-use, and the needs and opportunities for interoperability of data layers to fully enable e-Science \n-Make that information available in readiness for FP8','HUMAN','en',261530),(151,'Biodiversity science brings information science and technologies to bear on the data and information generated by the study of organisms, their genes, and their interactions. ViBRANT will help focus the collective output of biodiversity science, making it more transparent, accountable, and accessible. Mobilising these data will address global environmental challenges, contribute to sustainable development, and promote the conservation of biological diversity. Through a platform of web based informatics tools and services we have built a successful data-publishing framework (Scratchpads) that allows distributed groups of scientists to create their own virtual research communities supporting biodiversity science. The infrastructure is highly user-oriented, focusing on the needs of research networks through a flexible and scalable system architecture, offering adaptable user interfaces for the development of various services. In just 28 months the Scratchpads have been adopted by over 120 communities in more than 60 countries, embracing over 1,500 users. ViBRANT will distribute the management, hardware infrastructure and software development of this system and connect with the broader landscape of biodiversity initiatives including PESI, Biodiversity Heritage Library (Europe), GBIF and EoL. The system will also inform the design of the LifeWatch Service Centre and is aligned with the ELIXIR and EMBRC objectives, all part of the ESFRI roadmap. ViBRANT will extend the userbase, reaching out to new multidisciplinary communities including citizen scientists by offering an enhanced suite of services and functionality.','HUMAN','en',261532),(152,'The PaN-data Europe Strategic Working Group (PaN-data Europe) will support the development of a sustainable data infrastructure for European Neutron and Photon laboratories. The existing PaN-data collaboration aims to develop a common data infrastructure for European Neutron and Photon large facilities. The PaN-data Europe Support Action will support the integration of this work with the creation of a fully integrated pan-European e-infrastructure supporting all scientific communities.\n\nPaN-data Europe brings together eleven large multidisciplinary Research Infrastructures. The consortium operates hundreds of instruments used by over 30,000 scientists each year. They support fields as varied as physics, chemistry, biology, material sciences, energy technology, environmental science, medical technology and cultural heritage. Applications are numerous, e.g. crystallography reveals the structures of viruses and proteins important for the development of new drugs; neutron scattering identifies stresses within engineering components such as turbine blades, and tomography can image microscopic details of the 3D-structure of the brain. Industrial applications include pharmaceuticals, petrochemicals and microelectronics.\n\nThis Support Action focuses on 5 standardisation activities: \n1. development of a common data policy framework \n2. agreement on protocols for shared user information exchange \n3. definition of standards for common scientific data formats \n4. strategy for the interoperation of data analysis software enabling the most appropriate software to be used independently of where the data is collected, and \n5. integration and cross-linking of research outputs completing the lifecycle of research, linking all information underpinning publications, and supporting the long-term preservation of the research outputs. \n\nThe Pan-data partners are: STFC (UK), ESRF (Int), ILL (Int), Diamond (UK), PSI (CH), DESY (DE), ELETTRA (IT), Soleil (FR), ALBA (ES), HZB (DE), LLB (FR).','HUMAN','en',261537),(153,'Astronomy has been a pioneer in the conceptualization and implementation of a science driven virtual infrastructure, essential to optimize the science return of the large infrastructures of the discipline. The concept of a Virtual Observatory (VObs) is that all the world\'s astronomical data should feel like they sit on the astronomer\'s desk top, analysable with a user selected workbench of tools and made available through standard interfaces across the whole range of astronomical research topics. VObs is embraced as a world-wide community-based initiative with the potential to transform and restructure the way astronomy research is done. The European Virtual Observatory, Euro-VO, is the European implementation of this idea. The astronomical VObs is undergoing significant evolution with the beginning of its operational phase. Some activities are critical and have to be maintained to assess their evolution and prepare them for being sustained on the long term. The EuroVO-ICE project is a short (1 year) focussed project which aims at preparing all the necessary measures to continue the pioneering work of Euro-VO and sharing its concepts with other scientific disciplines, (1) by exploring the key points for long term sustainability, including the international, European, and national perspectives, and (2) by assessing how to maximize the impact of the work on the VObs development and of Euro-VO achievements by building partnership with other neighbouring disciplines time for this coordination is now mature thanks to projects recently selected to be supported by EU funding.','HUMAN','en',261541),(154,'Service Level Management (SLM) is considered a vital discipline in the management of today\'s information technology infrastructures. The widespread and commonly approved international standard for IT Service Management, ISO/IEC 20000, describes the objective of Service Level Management as follows: To define, agree, record and manage levels of service. All of these aspects are crucial when bringing the new e-Infrastructure technologies, processes and services to new user communities. Only by having a framework for establishing a common understanding of these four aspects of the services provided and used, can the e-Infrastructure maintain a sufficient customer satisfaction on sustainable level. \n\nHowever, SLM has not been successfully implemented and deployed in any of the next generation IT infrastructures (e-infrastuctures). To remedy this situation, grid environments are seen as a very promising starting point. By establishing grid-wide service catalogs and service agreements between customers and a virtual grid provider, grid services can be delivered in a more deterministic fashion. As the cross-organisational collaboration models are evolving rapidly in the Grid domain through the EGI initiative, gSLM project can act as a crucial enabler for the application of grid technology and the grid concept in general also in environments where predictable service utility and warranty are seen as significant requirements. \n\nThe goal of the proposed gSLM project is to bring together European experts from the grid and service management community and promote the development of SLM solutions that are well tailored to the requirements of and operational conditions in the e-infrastructure service provision today and in the future.','HUMAN','en',261547),(155,'E-Infrastructures initiatives have a great innovation potential toward the ERA and the society at large. This is one the main results of the ERINA study, also cited in the official communication to the European Parliament ICT Infrastructures for e-Science , issued by the EC in April 2009. However, many projects are still not aware of the opportunity of self-assessing the potential impact of their actions, and, more important, have no instruments to do this. In the present times, when the economic crisis and the pressure from developing countries are pushing for critical budgetary decisions, policy-makers need to have concrete instruments to concentrate economic efforts and maximise their investments. With this respect, the EC and the e-Infrastructures and Geant Unit, in particular, have issued and awarded several tenders on Impact analysis. However, the ERINA+ Consortium believes that there is urgency to target also all the e-Infrastructures initiatives through a support service complementing the scientific quality of the activities. The proposed service will provide a quantitative method for assessing projects impact, addressing 20 projects, throughout their duration. This will be achieved through a wide outreach strategy including focus groups, workshops and a final conference, leading to the production of a final recommendations White Paper. The ERINA+ initiative is proposed by a well balanced consortium bringing together the expertise of a leading research and industrial organisation, the know-how of an internationally renowned research institute, and two innovative SMEs providing in-depth analysis and studies related to the socio-economic impact of ICT research and investments.','HUMAN','en',261550),(156,'The project is aimed at service provisioning, networking and research of cloud and virtualization technologies to simplify and optimize the use and operation of existing distributed computing infrastructures (e.g. EGEE/EGI). The project will incorporate cloud and virtualization innovation into existing Grid infrastructures by integrating cloud technologies and services within Grid sites; and by enriching existing computing infrastructures with Infrastructure as a Service (IaaS) cloud-like delivery paradigms. \n\nStratusLab will integrate, distribute and maintain a sustainable open-source cloud distribution to bring cloud to existing and new grid sites. The StratusLab toolkit will be composed of existing cutting-edge open source software, and the innovative service and cloud management technologies developed in the project. It will also include the required additions to turn the software elements into a production grade distribution to support production quality and operational systems, as will be demonstrated with the operation of production level grid sites in the project. \n\nStratusLab will bring to the e-Infrastructure ecosystem several benefits, in terms of simplification, added flexibility, increased maintainability, quality, energy efficiency and resilience of the sites. The new distribution will complement existing middleware services, being fully transparent to upper layers in the infrastructure. Existing Grid middleware would continue to provide the glue to federate the distributed resources and the services for high-level job and data management. StratusLab will help to improve usability of distributed computing infrastructures, attracting the science user communities and industrial users that have embraced the cloud computing provisioning model; to keep European research infrastructures at the technology forefront; and to strengthen the technological know-how in virtualization and cloud computing of the European industry.','HUMAN','en',261552),(157,'Within the EARNEST foresight study, a prelude but systematic benchmarking undertaking was conducted, with the spotlight on the Research and Education Networking Infrastructures that resulted to a framework called Research and Education Development Index REDI, as a first step of measuring the progress of eInfrastructures. This activity stimulated substantial interest within the eInfrastructures community as well as an extended group of stakeholders, including the European Parliament. Alongside, the issue of benchmarking has been raised high in the EC policy agenda in several recent occasions as vital for assessing the impact of eInfrastructures at EU level and beyond, with the INFRA-2010-3.3 topic materializing policy into specific call-for-action. Responding to this, the eNVENTORY project suggests the formation of a European eInfrastructures Observatory, a single-entry-point and one-stop-shop of a standardised database, accessible via an advanced web platform and capable of representing multiple primary and convoluted indicators and benchmarks through intuitive, interactive and user-friendly mappings, plots and graphics, and open to the eInfrastructures stakeholders and to the public-at-large to generate personalized lists, rankings, and cross-comparisons, over time and across regions, in a fully modular and customizable way. The eNVENTORY project will extend prior benchmarking by including all core components of eInfrastructures (i.e., computing, communication and services) and will build the indicator databases from various international repositories. It will carry out extensive consultation with eInfrastructures stakeholders and research and innovation indicator experts, and will eventually deploy a prototype web platform dealing with a critically-selected subset of indicators and relevant repositories for further feedback on the intuitiveness, flexibility and ease of use.','HUMAN','en',261554),(158,'Partners to this proposal include the six major global programmes exploring the full extent of species diversity, a core dimension in human knowledge of global biodiversity. \n\nThey are: GBIF and distribution modelling, the EBI/INDSC, and Barcode of Life initiatives and molecular diversity, IUCN Red Lists and the species conservation movement, and the Species 2000 Catalogue of Life taxonomic framework. These will work closely with ELIXIR and LifeWatch, the ESFRI Infrastructures covering biodiversity, and build on the 4D4Life Project that develops the internal e-infrastructure of the Catalogue of Life. \n\nThe i4Life project is to establish a Virtual Research Community that will enable each of these global projects to engage in a common programme enumerating the extent of life on earth. It builds on the common need of each organisation to specify the entire set of organisms, their growing use of the Catalogue of Life as a common taxonomic resource alongside their own catalogues, and the different expertise that each programme brings to the task. \n\nThese key players present particular hurdles to Catalogue integration because they a) have established their own architectures, standards and protocols, b) have special requirements, and c) have their own partial catalogues that need to be integrated with the Catalogue of Life in a two way flow. \n\nIn each case i4Life will design, implement and test the necessary special pipelines, as well as contributing significantly to enhancement of the Catalogue of Life for all to use through the inflows from the partners. By providing access to a common species catalogue within each of the organisations, we expect to contribute a much needed level of knowledge integrity across the various scientific and community studies of the global biota. To make sense of global biodiversity it is vital that these organisations can communicate through a unified view of the extent of life.','HUMAN','en',261555),(159,'EDGI\'s aim is to deploy desktop grid (DG) and cloud services for EGI user communities that are heavy users of DCIs and require extremely large multi-national e-infrastructure. In order to achieve this goal software components of ARC, gLite, Unicore, BOINC, XWHEP, ADICS, 3G Bridge, OpenNebula, Eucalyptus will be integrated into SG-DG-Cloud platforms for service provision and as a result EDGI will extend ARC, gLite and Unicore grids with volunteer and institutional DG systems. EDGI will create novel QoS support for the DG systems and will explore new service provision models in order to ensure harmonised DG?Cloud interfaces to ARC, gLite, Unicore resources. EDGI will provide a workflow-oriented science gateway to enable user communities to more easily access the EDGI infrastructure. EDGI will establish the EuroCivis organization to coordinate DG-related activities in Europe both for solving technical issues as well as to attract volunteer DG resource donors by disseminating results of the EDGI and EGI projects. EuroCivis and EDGI will work in strong collaboration with EGI, EMI, NorduGrid, Unicore Forum and interested NGIs.','HUMAN','en',261556),(160,'Large scale simulations are the third pillar of science today alongside theory and experiment. They produce scientific insights, technological advances, and solve problems in many fields of society. Their tools are high-end computers and effective software. PRACE, the Partnership for Advanced Computing, has been created as a not for profit association in May 2010 as a permanent pan-European High Performance Computing service providing world-class systems for world-class science. Up to six systems at the highest performance level (Tier-0) will be deployed the first one being the already installed BlueGene/P in Germany. Funding for the next three systems has been committed by France, Italy, and Spain. Twenty European states are members of the PRACE Research Infrastructure (RI). Access to the PRACE resources will be through a single peer review process. The Scientific Steering Committee represents the user communities and guides the strategic directions. PRACE works closely with national, regional, and topical centres to shape the European HPC ecosystem. The PRACE-1IP project is designed to support the accelerated implementation of the RI. The project supports the evolution of the RI by refining and extending the administrative, legal and financial framework with focus on the specific requirements of industry. To enable world-class science on novel systems the project assists users in porting, optimising and peta-scaling applications to the different architectures and deploys consistent services across the RI. The tools and techniques will be selected to have broad applicability across many disciplines. This is accompanied by advanced training in modern programming methods and paradigms, establishing a permanent distributed training infrastructure. The PRACE brand is already well established in the international HPC scene; extensive dissemination and outreach will be continued. The project advises PRACE on procurements of the next generation of systems. Finally, promising technologies, especially with respect to energy efficiency, will be evaluated with the ultimate goal to collaborate with industrial partners to develop products exploiting STRATOS, PRACE advisory group for Strategic Technologies created in the PRACE Preparatory Phase project.','HUMAN','en',261557),(161,'In order to continuously support the European computing infrastructures and to exploit possible synergies, it is of crucial importance to coordinate the European Globus activities, drive forward the developments according to the requirements of the European users and to strengthen the influence of the European developers in the Globus Alliance. Topics like security or privacy, data privacy protection, compatibility with Grid standards used in Europe to enable interoperability, and aspects of multi-nationality are important in Europe and deserve a stronger representation in Globus. Long-standing relations with the Globus developers and recent negotiations with the Globus Alliance enable us to introduce necessary adjustments into the code base of the Globus Toolkit. Computing infrastructures like DEISA and PRACE can immediately rely on the high-quality middleware required to run these infrastructures while reducing their own efforts keeping track of new developments. With the establishment of the EGI, the IGE can take over the role of providing Globus Toolkit components to the Unified Middleware Distribution (UMD) of EGI. The Initiative for Globus in Europe serves as a comprehensive service provider for the European e-infrastructures regarding the development, tailoring, customization, provisioning, support, and maintenance of components of the Globus Toolkit. This can involve the continuous measurement of software quality, but must also include the operation of a software repository as well as participation in standardisation bodies, training, promotion, and documentation activities. In order to guarantee the sustainability of this effort the main activities are based at large European computing centres and industrial partners. The first steps will be the establishment of a European Globus User Forum and the organization of a yearly Globus Europe conference series in close cooperation with the organisers of the Globus World conference.','HUMAN','en',261560),(162,'The FP7 EDGeS project has successfully set up a production-level distributed computing infrastructure (DCI) consisting of more than 100.000 PCs from several volunteer and low-cost Desktop Grids, which have been connected to existing Service Grids (including EGEE, SEE-GRID, etc. with about 150.000 processors) based on the new 3G Bridge technology and application development methodology. \n\nThe main aim of the DEGISCO project is the further extension of the European DCI infrastructure that is already interconnected by EDGeS to International Cooperation Partner Countries (ICPC) in strong collaboration with on the one hand local partners in ICPC countries and on the other hand European e-Infrastructure experts (including 3G Bridge know-how) and thus, reinforce the global relevance and impact of European distributed infrastructures. \n\nThe project will support the creation of new Desktop Grids in ICPC countries and the connection of these Grids to European DCIs and existing Service Grids in ICPC countries by employing 3G Bridge technology. Moreover, building on the solid expertise of the DEGISCO partners, the project will provide recommendations on best practices and define joint roadmaps for ICPC countries and Europe. \n\nThe application support activities of DEGISCO support the use of the already two dozen ported applications on new connected DCI\'s in ICPC countries and support new applications. \n\nThe dissemination and training activities will promote via various channels such interoperation between Desktop Grid and Service Grid infrastructures on a global scale, which leads to more awareness under the general public of computational science and distributed computing co-funded by the EC. As a result more citizens, students, and companies are expected to donate resources to scientific purposes. \n\nAs part of these activities an International Desktop Grid Federation will be operated allowing for effective exchange of information through participation.','HUMAN','en',261561),(163,'The e-Infrastructure Reflection Group Support Programme 3 (e-IRGSP3) supports the e-Infrastructure Reflection Group (e-IRG). The e-IRG reflects on results and developments in the area of e-infrastructures. It consists of government appointed national representatives and was created in 2003. The e-IRG has reached a high ranking position as an independent advisory body in Europe in its field. It cooperates increasingly closer with the European Strategy Forum on Research Infrastructures (ESFRI), whose work it largely complements through its lateral domain. The e-IRG produces White and Green Papers, Roadmaps and other policy-related documents, covering the whole domain of e-infrastructures: networks, supercomputers, data repositories and grids. The e-IRG formulates its conclusions and advice in various ways. The e-IRG Recommendations endorsed by the e-IRG delegates are well received by the communities concerned as well as by policy makers and funding agencies and can thus have very serious impact. \n\nThe e-IRGSP3 project builds on the experiences of previous e-IRG support programmes. It is lightweight designed focusing on the core requirements of the e-IRG. It provides the secretariat of the e-IRG community, supports the e-IRG Chair and Executive Board, organises e-IRG workshops and delegate meetings, and facilitates the engagement with stakeholders. The policy creating process of the e-IRG is supported by monitoring and analysing the state-of-the-art developments in the fields of interest of the e-IRG (at policy, technology, research, and socioeconomic level), thus conceiving ideas and input for the e-IRG policy documents. Finally, the support programme fully implements the dissemination work of the e-IRG and maintains the extensive and growing amount of knowledge, including the data in the e-IRG Knowledge Base. \n\nThe e-IRGSP3 project helps establishing continuity in the-IRG work together with the Chair, across the semi-annual personal changes of the e-IRG Executive Board','HUMAN','en',261563),(164,'Several research communities in Europe exploit e-Infrastructures, sharing data and computing resources with Grid and Supercomputing technology. However the inherent complexity of these technologies has limited their wider adoption and their long term sustainability: designing, developing and operating a computing infrastructure for an e-Science community remains challenging and costly. VENUS-C will develop and deploy an industrial-quality service-oriented platform based on virtualisation technologies to serve research and industrial user communities, leveraging previous experiences and competences of grids & supercomputing, while investigating new sustainable business models. For Europe to remain at an international competitive edge, it needs to continue investing aggressively in new computing technologies such as those proposed by VENUS-C. These could develop into an essential infrastructure of the information economy. \n\nVENUS-C will foster the development of Cloud Computing service offerings taking advantage of existing international opportunities and European industrial potential. Ten years ago, Europe successfully applied a similar approach with Grid computing, importing key technology from the US to quickly become a world-wide leader. By exploiting commercial solutions, but avoiding vendor lock-in with effective interoperability, \n\nVENUS-C will provide an easy way to deploy end-user services, dynamically extending e-infrastructures capabilities, addressing all aspects of a sustainable infrastructure. \n\nVENUS-C is a Europe-driven industry-led consortium with skilled partners and a strong, international advisory committee formed by worldwide experts in distributed computing and scientific applications. The user communities involved are: Bioinformatics, System Biology, Drug discovery, Civil Protection, Civil Engineering, and Digital Libraries. Twenty short-term experiments will be supported in the second year of VENUS-C through a competitive selection process.','HUMAN','en',261565),(165,'Structural biology and life sciences in general, and NMR in particular, have always been associated with advanced computing. The current challenges in the post-genomic era, with their focus on biomolecular interactions, call for virtual research platforms that provide the worldwide research community with both user-friendly tools, platforms for data analysis and exchange, and an underlying e-infrastructure. \n\nThe WeNMR project will group different research teams into a virtual research community at a worldwide level. It builds on the established eNMR e-Infrastructure tightly integrated into the EGEE and its steadily growing virtual organization currently representing the second largest VO in the life science area. WeNMR will consolidate the operation of the current services and provide an e-Infrastucture platform and structural biology Science Gateway towards EGI for the users of existing infrastructures. It will involve researchers from around the world and will build bridges to other areas of structural biology. Integration with a rapidly growing and highly complementary method, SAXS, is directly included in WeNMR, but links will also be established to related cryo-EM and X-ray crystallography initiatives. WeNMR will serve all relevant INSTRUCT communities in line with the ESFRI roadmap. \n\nFrom an e-infrastructure viewpoint, WeNMR will strengthen the European ties with National Grid Initiatives, the new EGI and PRACE initiatives toward an effective sharing of the offered service. Collaborations will be established with the Asian, South-African, South- and North-American GRID initiatives, in close contact with the existing EC projects, to extend and open the WeNMR Life-Science Gateway at global level. WeNMR will establish and promote best practices in life sciences and offers (virtual) training services to worldwide researchers. It will work with all stakeholders, including an industry panel, to ensure its sustainability.','HUMAN','en',261572),(166,'With top systems reaching the PFlop barrier, the next challenge is to understand how applications have to be implemented and be prepared for the ExaFlop target. Multicore chips are already here but will grow in the next decade to several hundreds of cores. Hundreds of thousands of nodes based on them will constitute the future exascale systems. \n\nTEXT is centered on the vision that the key component to support high productivity and efficient use of a system is the programming model, and we defend that MPI/SMPSs is a hybrid approach that can today be demonstrated and show the way to follow on the path to exascale. The SMPSs model provides the necessary support for asynchrony and heterogeneity as well as enabling incremental parallelization, modularity and portability of applications. By integrating it within MPI we can propagate its characteristics to the global application level. This is also a way to leverage and provide a smooth migration path for the huge number of applications today written in MPI. \n\nThe focus of the TEXT project is to install the MPI/SMPSs environment at several HPC facilities of partners and demonstrate how seven real and relevant applications/libraries can be improved using it. The codes fall in the areas of basic linear algebra libraries, geophysics, plasma physics, engineering and molecular dynamics. They have been selected considering the impact in their respective scientific communities. \n\nWe will actually validate our claim by evaluating the ported applications with different end users and collect their feedback to further improve the technology. We will also promote the use of the model to other application developers beyond what is feasible to integrate as committed project partners. \n\nIn order to exploit the opportunity window and really achieve global impact the project proposal is for 2 years. The TEXT proposal is composed of three networking activities, three service activities and two joint research activities.','HUMAN','en',261580),(167,'The overall purpose of the 6DEPLOY-2 project is to (i) support the deployment of IPv6, in Europe and developing regions, (ii) sustain the wealth of 6DEPLOY training material (e-learning package with subtitles in national languages, presentation material, exercises, etc.), and (iii) create a catalyst of global IPv6 expertise through the installation of strategically-placed sustainable IPv6 training labs. \n\nIn order to support the deployment of IPv6, in Europe and developing regions, 6DEPLOY-2 includes LACNIC and AfriNIC as partners in the Consortium. These partners have their own IPv6 training schedules and 6DEPLOY-2 will liaise with these organisations (and APNIC) to exploit training opportunities cost effectively in Africa, Latin America and the Asia-Pacific region. \n\nPartners will maintain and update the existing 6DEPLOY material and include new training media, and multiply its training effectiveness through courses which educate other trainers about the key messages to pass on IPv6, so that they can teach others (?training trainers?). \n\n6DEPLOY-2 exploits the expertise and high quality training material from the 6DEPLOY project, including presentations, the e-learning course and especially the growing number of IPv6 Labs These testbeds will not only be accessed remotely for ?hands-on? exercises during the IPv6 training workshops, but they will also form centres of IPv6 expertise in the countries where they are situated. \n\nThe current/planned 6DEPLOY IPv6 Labs will be extended to: \n- be used in 6DEPLOY-2 training workshops (giving access to more testbeds for ?hands-on? configuration exercises), \n- create centres of IPv6 competence in countries around the world, \n- form a sustainable human network of expertise to train others \n\n6DEPLOY-2 will also revive the IPv6 Cluster,to encourage the exchange of information between FP7 projects with IPv6 implementations (and offer support). \n\nFurthermore, 6DEPLOY-2 will describe step-by-step real practical deployment scenarios on its Website.','HUMAN','en',261584),(168,'Researchers of all disciplines, from Life Sciences and Astronomy to Computational Chemistry, create and use ever-increasing amounts of complex data, and rely more and more on compute-intensive modelling, simulation and analysis. Scientific workflows have become a key paradigm for managing complex tasks and have emerged as a unifying mechanism for handling scientific data. Workflows capture the essence of the scientific process, providing a means to describe it via logical data- or work-flows. Workflows are mapped onto concrete Distributed Computing Infrastructures (DCIs) to perform large-scale experiments. The learning curve for reusing workflows, however, is still steep because workflows typically have their own user interfaces/APIs, description languages, provenance strategies, and enactment engines, which are not standard and do not interoperable. Workflow integration or reuse therefore is currently impractical, thereby inhibiting the growth in uptake and proliferation of workflows in scientific practice.\n\nThe SHIWA project aims to leverage existing solutions and enable cross-workflow and inter-workflow exploitation of DCIs by applying both coarse- and fine-grained strategies. The coarse-grained approach treats workflow engines as distributed black box systems, where complete sub-workflows are sent to pre-existing enactment engines. The fine-grained approach addresses language interoperability by defining an intermediate representation to be used for translation of workflows across systems (currently selected: ASKALON, Pegasus, P-Grade, MOTEUR, Triana). SHIWA will develop, deploy and operate the SHIWA Simulation Platform to offer users production-level services supporting workflow interoperability following both approaches. A Repository will facilitate publishing and sharing of workflows, and a Portal will enable their actual enactment. Three use cases based on medical imaging applications will serve to drive and evaluate this platform from a user\'s perspective','HUMAN','en',261585),(169,'DECIDE (Diagnostic Enhancement of Confidence by an International Distributed Environment), aims at creating a e-Infrastructure to enhance the diagnostic confidence in chronic brain diseases such as Alzheimer and dementia. Proper management of these neurodegenerative diseases are thought to be very important in terms of health-economical point of view. \n\nThe DECIDE infrastructure will provide the medical community with neuroimaging applications that can take advantage of the use of large reference databases and advanced, computationally intensive algorithms to detect disease biomarkers in individual patients based on structural Magnetic Resonance (MR), functional Positron Emission Tomography (PET) and Single Photon Emission Tomography (SPECT), and electroencephalographic (EEG) images. The DECIDE infrastructure will be built on different layers: networks, GRID and storages, neuroimaging applications, user-friendly customized GUI. \n\nThe workplans of RTD and SVC activities explain how the e-Infrastructure will be deployed and validated, whilst the NAs activities will take care of dissemination, training and outreach to the medical community. This infrastructure will enable clinicians from hospitals across the Eeurope not owning large sets of normal subject images or/and not equipped with high computation resources or/and not providing computer-aided sophisticated algorithms to support neurological diagnosis, to carry out analyses, remotely and efficiently, by the use of a centralized, user friendly, web-Grid service. \n\nThe project would like to exploit the state-of-the-art neuroimaging data acquisition, analysis and grid based technology to reduce the burden of huge cost for the management of the neurodegenerative diseases.','HUMAN','en',261593),(170,'With the accelerating materials development cycles, the development of simulation approaches for predictive, de-novo characterization and optimization of materials and device properties emerges as a grand challenge to European R&D. A unified multi-disciplinary approach towards the deployment of models, tools, algorithms and simulation and visualization techniques is required to transform isolated solutions for specific problems into comprehensive, industry-ready platforms, which are capable of predicting the properties of complex materials on the basis of their constitutive elements. While many techniques exist to address the specific questions, a lack of integration of the existing methods into readily available multi-scale modelling platforms has to date limited the impact of materials-modelling techniques in materials design. In this project we will develop an integrated e-infrastructure for multi-scale materials modelling (MMM@HPC), where expert groups unite with computational resource providers to deliver an integrated infrastructure for multi-scale materials modelling. MMM@HPC will be an open platform to integrate of existing software modules into customizable, high performance protocols and workflows. We will provide the European research community with a leading edge software infrastructure to exploit the highest quality software and computational resources; enabling Europe to address the emerging grand challenges in materials science and engineering. MMM@HPC will strengthen Europe\'s international role as software provider and nucleate a unified community of computational scientists to address emerging computing needs of the research community with a very efficient, evolving research tool. The project will demonstrate a direct impact towards solving visible European R&D challenges in the areas of energy storage (Li ion batteries), energy conversion (organic light emitting diodes), carbon based devices for electronics and polymer based electronics.','HUMAN','en',261594),(171,'This project proposes the development of a high performance computing eco-system in the Eastern Mediterranean region by interlinking and coordinating regional compute, data and visualisation resources to form an integrated e-platform. It will provide training activities and user support, and engage the regional communities through networking activities such as workshops, exchange of visitors and organization of joint events. Its focus will be on virtual research communities in three fields that are clearly relevant to the region and of global importance, namely Climate Modelling, Digital Cultural Heritage and Synchrotron applications. Regional HPC centres will be contributing resources to support user communities in the region with the Computation-based Science and Technology Research Centre of the Cyprus Institute, the National Authority for Remote Sensing and Space Sciences (Egypt) and the Bibliotheca Alexandrina (Egypt) being initially the major contributors. \n\nSESAME, (Jordan/UNESCO), a major experimental facility with a broad user community, will be promoting networking in the region. An upgraded connection between Cyprus and Jordan will provide the needed bandwidth for the transfer of SESAME data. The Julich Supercomputing Center and the National Center of Supercomputing Applications of the University of Illinois will provide know-how at the highest level for running and integrating such facilities, whereas international leaders in the three thematic areas will ensure transfer of state-of-the-art techniques to the regional user communities, thereby linking the Eastern Mediterranean with the European and international computational science activities.','HUMAN','en',261600),(172,'The European Middleware Initiative is a collaboration of the three major middleware providers in Europe, ARC, gLite and UNICORE, and other consortia. EMI aims to deliver a consolidated set of middleware components for deployment in EGI, PRACE and other DCIs; extend the interoperability between grids and other computing infrastructures; strengthen the reliability of the services; and establish a sustainable model to maintain and evolve the middleware, fulfilling the requirements of the user communities. European scientific research has benefited recently from the increasing availability of computing and data infrastructures with unprecedented capabilities for large scale distributed initiatives. \n\nThese infrastructures are largely defined by enabling middleware. After the necessary initial period of research and consolidation that has taken place in the past several years, the growing usage of these resources now requires the transformation of the computing infrastructures into a professionally managed and standardized service. It is of strategic importance for the establishment of permanent, sustainable research infrastructures to lower the technological barriers still preventing resource owners from federating the resources, and potential communities of tens of thousands of researchers from using grids as a commodity tool in their daily activities. \n\nThe EMI project will make the realization of this vision possible by addressing a number of problems that still prevent users from easily accessing and using the whole capacity of the existing computing infrastructures. It will focus on improving the usability and accessibility for scientific users and the interoperability and manageability for service providers. The sustainability of the grid services will be directly addressed by replacing wherever possible proprietary technology with off-the-shelf components, improving their standardization and implementing industry standard quality assurance methodologies.','HUMAN','en',261611),(173,'Solar System Science has traditionally been undertaken within a number of separate disciplines. However, like any system its aspects are inter-related and it has been difficult to address these aspects because of the lack of the integrating technology required to span the inter-disciplinary boundaries. While advances in technology means that the intrinsic differences between disciplines (manifest in differing data formats and dependencies) are beginning to be addressed, it is necessary to coordinate our efforts in order to help break down the barriers. \n\nUnder the Seventh Framework Programme, the European Commission is funding three projects that are directly relevant to this issue - HELIO, EuroPlanet RI and SOTERIA. Within their own areas, each is making significant improvements to the infrastructure that supports their communities and enabling increased ability to do science. \n\nWithin this Coordination Action we propose to take steps to move to the next level by cooperating in a number of areas. The cooperation will be in three main areas: \n1. We will investigate ways to improve the interoperability between data and metadata from the domains. We will also investigate the possibility of sharing some metadata resources. \n2. We will coordinate the use of standard within the projects and reflect any changes that are required to organizations like the IVOA, IPDA, etc. \n3. We will coordinate our dissemination activities in order to create a more coherent and comprehensive approach. As part of this activity, we will hold meetings of key players in order to lobby the case for solar system science with the decision makers and funding agencies.','HUMAN','en',261618),(174,'Digital Earth is a visionary concept for the virtual representation of the Earth that is spatially referenced, interconnected with the world\'s digital data repositories, and encompassing all its systems and forms, including Earth Sciences, Natural Resources Management, Environmental Monitoring system and human society dimensions. The project will establish open data and services access, allowing European and worldwide Digital Earth Communities to seamlessly access, produce and share data, information, products and knowledge. This will create a multi-dimensional, multi-temporal, and multi-layer information facility of huge value in addressing global challenges such as biodiversity, climate change, pollution and economic development. GENESI-DEC evolves and enlarges the platform developed by the predecessor GENESI-DR project by federating to and interoperating with existing infrastructures. \n\nGENESI-DEC will: \n- Enlarge the GENESI-DR infrastructures in terms of both resources availability and geographical extent. \n- Provide guaranteed, reliable, easy, effective access to a variety of data, facilities, and applications to an ever increasing number of scientists and users. \n- Harmonise operations at selected key infrastructures limiting fragmentation of solutions and assure that the access to data and resources is secure and controlled, according to policies. \n- Enable multidisciplinary collaboration among communities and the creation of user-configured virtual research facilities. \n- Integrate new scientific and technological paradigms in operational infrastructures in response to the latest Digital Earth requirements. \n- Stimulate, educate and support the creation of virtual research communities. \n\nGENESI-DEC involves key partners of ESFRI projects and collaborates with key actors of Digital Earth and Earth Science initiatives, including the International Society of Digital Earth and GEO-GEOSS. Thus efficient use of already existing and planned developments is guaranteed','HUMAN','en',261623),(175,'Environmental change and climate change in particular, are expected to be most pronounced in the polar regions. For this reason, a multi-disciplinary research infrastructure covering all important elements of the coupled Earth System in the Arctic is a very valuable tool to quantify the ongoing global change and to verify the capability of Earth System models to predict future changes. The proposed EFRI project \"Svalbard Integrated Arctic Earth Observing System\" (SIOS) is intended to take this role. The main goal of the SIOS Preparatory Phase (SIOS-PP) project is to define, work out and decide on the formal framework needed to establish and operate the geographically distributed and thematically composed multi-national research infrastructure with a node function in different aspects, that SIOS will manifest. \n\nThis covers, on one side, aspects common for all ESFRI initiatives, such as legal status, governance structure, financial strategy, a data management and utilization plan, and an (on- and offshore) logistics plan. In addition, SIOS-PP will address topics that are special for this infrastructure: a dedicated remote sensing strategy, an internal scientific and observational, as well as an international integration and cooperation plan, which will link SIOS to regional European Arctic and pan-Arctic scientific infrastructure networks. The SIOS-PP project will be carried out by a consortium of 27 partners from 14 countries including 4 non-EU and non-associated countries; three of the partners are national funding agencies. In addition, 19 associated partners with infrastructure or strong scientific interests on Svalbard will cooperate during the preparatory phase. The project has a duration of 3 years.','HUMAN','en',261747),(176,'The EU-OPENSCREEN Preparatory Phase forms the basis for the construction and operation of a pan-European infrastructure of open screening platforms for Chemical Biology. EU-OPENSCREEN will bring together leading laboratories from 12 European countries covering all aspects of Chemical Biology from high-throughput screening with a dedicated compound library to assay development, chemical synthesis for hit-optimisation, bio-profiling and in vivo studies, as well as a central database, training for scientists and platform staff and dissemination activities. The infrastructure will be used by researchers from universities, research institutes and SMEs across Europe, who either have only limited in-house facilities or no access at all to such resources and expertise. The EU-OPENSCREEN infrastructure will keep Europe at the forefront of the biological and medical sciences and will stimulate industrial research and commercial exploitation. In order to prepare the creation of an efficient network of centres which provide users with optimal resources, the EU-OPENSCREEN Preparatory Phase will address the following issues: - A user-focused access strategy. - The physical infrastructure requirements. - Suitable data standards and the framework for a database to archive and make the results available to the scientific community. - A financial management plan for the construction and sustainable operation of the infrastructure in co-operation with national funding bodies. - The legal approach regarding intellectual property issues. - An appropriate legal and governance structure. - The development of a Chemical Biology education package to ensure adequate training of scientists and platform staff. - A central Chemical Biology information gateway in form of a website. - The dissemination of the business plan to stakeholders and decision makers and co-ordination with national funding strategies.','HUMAN','en',261861),(177,'In the past two decades spectacular insight into basic principles of life has been obtained from paradigmatic high-resolution structural investigations providing a rational basis for biological experiments. NMR is an indispensable enabling technology for determining such structures and their interactions in solution, the immobilized state and living cells. \n\nThe power of NMR to link structural, dynamic, kinetic and thermodynamic information makes it an essential component of cutting edge research in medicine and biology. Bio-NMR pools pan-European resources of the most relevant bio-NMR infrastructures. Eleven partners will provide access to researchers involved in structural biology following the EU-NMR I3 project. This initiative successfully responded to the increasing demand for access since 1994. Seven other excellent partners, including the leading NMR manufacturer Bruker, are included in the new consortium. Jointly, they will develop methods aimed at pushing the frontiers of biological NMR and improving the quality of access to allow users to tackle ever more challenging goals in cellular structural biology. \n\nFinally, all nineteen partners, amongst them a company specialized in NMR technology dissemination, are involved in the networking activities. \nThese include (1) knowledge transfer among consortium members, Bio-NMR users and other NMR researchers, (2) the demonstration to biologists of the potential of structural biology with NMR, and lowering the barriers to their becoming users, (3) interactions with industrial and medical communities, and (4) raising awareness of the impact of the results achieved through Bio-NMR among society, financing and governing bodies with the final aim of developing a business plan for self-sustainability. The overall project and its management have been conceived in coordination with INSTRUCT, which will contribute to the cultural frame and networking activities of Bio-NMR.','HUMAN','en',261863),(178,'In the year the world commemorates the 65th anniversary of the liberation of Auschwitz, a European Holocaust Research Infrastructure (EHRI) project sets out to support research into the Holocaust. EHRI\'s main objective is to support the European Holocaust research community and help initiate new levels of collaborative research through the development of innovative methodologies, research guides and user-driven transnational access to research infrastructures and services. To this end, EHRI proposes to design and implement a Virtual Research Environment offering online access to a wide variety of disparate and dispersed key Holocaust archival materials and to a number of online tools to work with them. Building on integrating activities undertaken over the past decades by the 19 partners in the consortium and a large network of associate partners, EHRI sets out to transform the data available for Holocaust research around Europe and elsewhere into a cohesive corpus of resources.\nEHRI will first and foremost strengthen the existing clusters of excellence in Holocaust research, but also serve as a \'best practice\' model for other archival or humanities projects as well as for more encompassing follow-up projects in contemporary history. Although EHRI is primarily geared towards the needs of scholarly communities, the online availability and open access to reliable and properly contextualized Holocaust material is relevant and important for the larger public well beyond scholarly communities, as its research topic is deeply rooted in the development of European societies. European support and a European approach are essential to achieve an integral and comprehensive approach to the history of the Holocaust as a European phenomenon.','HUMAN','en',261873),(179,'This Project builds on the GENNESYS European-wide study, which extensively analyzed the needs and opportunities for coordinating future research and development in nano-materials science and technology. The mission of the International GENNESYS Congress on Nanotechnology and Research Infrastructures is to establish a strategic partnership between nano-materials research laboratories, universities, industry and the European research infrastructures. \n\nA well coordinated nano-materials science and technology program needs to be integrated into research infrastructures in the whole of Europe and in close regional, national and international collaboration to the welfare of the society and of the economy. \n\nThe GENNESYS International Congress is focused on future visions and actions to achieve breakthroughs in nano-materials science and technologies. At this prestigious conference various R&D&T roadmaps as worked out by worldwide experts as well as major conclusions and recommendations from the GENNESYS study will be presented to an international audience of major stakeholders in science, politics and industry, stimulating the development of European research policies. The congress will take place in Barcelona during the Spanish EU presidency, the Coordinator ICMAB (Institut de Ciencia de Materials de Barcelona from CSIC) will work closely with its partners DESY (Deutsche Elektronen-Synchrotron), PRUAB (Parc de Recerca Universitat Autonoma de Barcelona) and INL (International Iberian Nanotechnology Laboratory), ensuring that the outcomes have the authority and support of leading organisations in this field.','HUMAN','en',261915),(180,'EISCAT_3D is a next generation incoherent scatter radar system for high-latitude atmosphere and geospace studies that will be built in northern Fenno-Scandinavia. The facility will consist of multiple large phased-array antenna transmitters/receivers in three countries, comprising tens of thousands of individual antenna elements. The new radars will collect data from the upper stratosphere to the magnetosphere and beyond, contributing to the basic, environmental and applied science that underpins the use of space by contemporary society. EISCAT_3D\'s capabilities go beyond anything currently available to the international research community and will constitute a valuable scientific resource for the European Research Area. Located in the auroral zone at the edge of the northern polar vortex, EISCAT_3D will provide long-term continuous data for scientists studying global change, measuring the effects of man-made and natural variability on the middle and upper atmosphere. Its observations will underpin space weather prediction and monitoring, essential for the operation and the improved service of European space assets. In addition EISCAT_3D will facilitate studies of solar system influences on the terrestrial environment, such as solar wind, meteors, dust, energetic particles and cosmic rays, in collaboration with other research infrastructures. The Preparatory Phase will resolve the remaining legal, financial and technical questions which must be addressed before the construction of EISCAT_3D.','HUMAN','en',261967),(181,'This proposal includes all tasks that are essential to maintain the European added value of the Survey of Health, Ageing and Retirement in Europe (SHARE) and to keep the 16 national surveys well integrated. It complements the national financing mode of data collection as result of the ESFRI process by keeping its centrifugal forces in bounds. \n\nIt will keep up our excellence in service provision as well as in science by: \n1. Fostering the culture of cooperation between designers and users of SHARE by organizing user conferences, offering specialized training courses for users and interviewers, expanding web services and developing standards and procedures within the network that will make more efficient use of the research infrastructure. \n2. Improving the multinational services for users in EU member countries, associated countries and third countries by a more efficient centralized data base management that will provide detailed synopses and concordances across member countries. We will coordinate this work with our sister surveys in the UK, US, China, India, Japan, Korea and Thailand, thereby providing a platform for global access to ageing data. \n3. Pushing the state-of-the-art in interdisciplinary panel construction further such that SHARE will maintain its status as a leading edge research infrastructure. \n\nThe project will leverage our research on response behaviour to minimize attrition; it will develop a multi-mode interviewing facility tailored to the 50+ in order to reduce survey costs; it will develop innovative questionnaire modules on biomarkers, physical health, social networks, pension claims, time use and nutrition that will keep SHARE at the forefront of empirical science; and, with the help of EUROMOD, it will harmonizes income concepts across EU-surveys, notably EU-SILC in order to facilitate the measurement of material well-being in times of rapid demographic change with its complex implications for old-age income provision.','HUMAN','en',261982),(182,'ENSAR is the Integrating Activity of Nuclear Scientists from almost all European countries performing research in three of the major subfields of Nuclear Physics: Nuclear Structure, Nuclear Astrophysics and Applications of Nuclear Science. It proposes an optimised ensemble of Networking (NAs), Trans-national Access and Joint Research Activities (JRAs), which will ensure qualitative and quantitative improvement of the access provided by the current seven infrastructures, which are at the core of this proposal. The novel and innovative developments that will be achieved by the RTD activities will also assure state-of-the-art technology needed for the new large-scale projects. Our community of nuclear scientists profits from the diverse range of world-class research infrastructures in Europe that can supply different ion beams and energies. \n\nWe have made great efforts to make the most efficient use of these facilities by developing the most advanced and novel equipment needed to pursue their excellent scientific programmes and applying state-of-the-art developments in nuclear instrumentation to other research fields and to benefit humanity (e.g. archaeology, medical imaging). Together with multidisciplinary and application-oriented research at the facilities these activities ensure a high-level socioeconomic impact. To enhance the access to these facilities, the community has defined a number of JRAs, using as main criterion scientific and technical promise. These activities deal with novel and innovative technologies to improve the operation of the facilities. In addition, a key JRA aims at integrating the laboratories in Central and South-Eastern European countries with those elsewhere in Europe. The NAs of ENSAR have been set-up with specific actions to strengthen the communities\' coherence around certain research topics and to ensure a broad dissemination of results and stimulate multidisciplinary and application-oriented research at the Research Infrastructures.','HUMAN','en',262010),(183,'Euro-BioImaging brings together imaging technologies stretching from basic biological imaging with advanced light microscopy, in vivo molecular imaging of single cells to animal models up to the clinical and epidemiological level of medical imaging of humans and populations. Euro-BioImaging, in close consultation with its stakeholders, will address the imaging requirements of both biological and medical imaging research communities by creating a coordinated and harmonized plan for infrastructure deployment in Europe. Euro-BioImaging infrastructures will be planned to provide access to state-of-the-art equipment as well as to provide training and continue the development of imaging technologies to be able to offer them as new services. The vision of Euro-BioImaging is to provide a clear path of access to imaging technologies for every biomedical scientist in Europe. The Euro-BioImaging infrastructure will be focused on imaging technologies grouped around different scales of biological organization, from the single molecule to the whole human organism. \n\nEuro-BioImaging will therefore develop a plan to construct and operate a set of complementary and strongly interlinked infrastructure facilities appropriately distributed across the European member states. To achieve this, Euro-BioImaging will define the legal and governance framework with its currently 22 member states and develop a finance plan in close cooperation with national funding bodies as well as with the European Commission. The key objective of the Euro-BioImaging preparatory phase project is to integrate these plans into an overarching business plan that provides a realistic basis for construction and operation of the Euro-BioImaging infrastructure. Through the combination of these technological and strategic objectives, Euro-BioImaging will be able to address the key elements of successful infrastructures: supporting research, training and innovation in biomedical imaging across Europe.','HUMAN','en',262023),(184,'AIDA (http://cern.ch/aida) addresses the upgrade, improvement and integration of key research infrastructures in Europe, developing advanced detector technologies for future particle accelerators, as well as transnational access to facilities that provide these research infrastructures.\n\nIn line with the European Strategy for Particle Physics, AIDA targets the infrastructures needed for R&D, prototyping and qualification of detector systems for the major particle physics experiments currently being planned at future accelerators. By focusing on common development and use of such infrastructure, the project integrates the entire detector development community, encouraging cross-fertilization of ideas and results, and providing a coherent framework for the main technical developments of detector R&D.\n\nThis project includes a large consortium of 37 beneficiaries, covering much of the detector R&D for particle physics in Europe. This collaboration allows Europe to remain at the forefront of particle physics research and take advantage of the world-class infrastructures existing in Europe for the advancement of research into detectors for future accelerator facilities.\n\nThe infrastructures covered by the AIDA project are key facilities required for an efficient development of future particle physics experiments, such as: test beam infrastructures (at CERN, DESY and LNF), specialised equipment, irradiation facilities (in several European countries), common software tools, common microelectronics and system integration tools and establishment of technology development roadmaps with a wide range of industrial partners.','HUMAN','en',262025),(185,'In the context of the emerging and re-emerging infectious diseases involving highly pathogenic micro-organisms, European countries have to be well-prepared to face such threats. However, the Biosafety Level 4 (BSL4) capacity in Europe is not sufficient enough to cover the efficient development of diagnosis, prophylactic and therapeutics means against these pathogens. Moreover, there is no global coordination of activities and harmonization of practice in this field. Therefore, the ERINHA project proposes the creation of a top world-class BSL4 research infrastructure that will address the actual European capacity sparseness. \n\nThe project plans to conduct five main actions which are: \n(i) Building additional BSL4 areas in several existing BSL4 laboratories, \n(ii) Building BSL4 laboratories in strategically selected EU countries that are lacking one, \n(iii) Building a support infrastructure around BSL4 laboratories mainly dedicated to host scientific visitors and staff, \n(iv) Setting-up the user access to the ERINHA infrastructure, \n(v) Establishing coordination capacities for efficient dispatching and control of all activities. \n\nFor 36 months, the ERINHA Preparatory Phase will focus on: \n(i) Identifying relevant sites in Europe for new BSL4 constructions or major upgrades, \n(ii) Getting political and financial commitments from National, European or International concerned entities to support construction, \n(iii) Establishing a secured and validated financial plan for construction, (iv) Defining and implementing an appropriate governance and legal framework, \n(v) Harmonising and disseminating common procedures related to L4 biological resources, bio-safety and bio-security management, \n(iv) Defining and implementing joint training programs to operate in BSL4 facilities, \n(vii) Identifying the ERINHA\'s users and establishing rules for access. \n\nThese achievements will allow the ERINHA project to reach the legal, financial and technical maturity to proceed to the construction phase.','HUMAN','en',262042),(186,'VISIONAIR is a project of creation of a European infrastructure that should be a unique, visible and attractive entry towards high level visualisation facilities. These facilities must be open to the access of a wide set of research communities. By integrating existing facilities, it will create a world-class research infrastructure enabling to conduct frontier research. This integration will provide a significant attractiveness and visibility of the European Research Area.\nCurrent scientific challenges concern climate evolution, environmental risks, health, energy, etc. and require the management of more and more complex information. The development of information technologies, the increasing complexity of the information to be handled and analysed, along with the increasing capacities in scientific and engineering simulations, call for the development of increasingly powerful visualisation tools and methods. The Europe Research Area must be able to compete with other big Research Areas when addressing the previously defined challenges. By integrating visualisation facilities with the VISIONAIR project, ERA will be able to answer integrated challenges out of the scope of usually disseminated research teams.\nBoth, physical access and virtual services, will be provided by the infrastructure. A full access to visualisation dedicated software will be organised, while physical access on high level platforms, will be partially (about 20% of global usage) open for other scientists for free on behalf of excellence of submitted projects. The partners of this project propose to build a common infrastructure that would grant access to high level visualisation facilities and resources to researchers. Indeed, researchers from Europe and from around the world will be welcome to carry out research projects using the visualisation facilities provided by the infrastructure. Visibility and attractiveness of ERA will be increased by the invitation of external projects.','HUMAN','en',262044),(187,'The Cherenkov Telescope Array CTA will be the first open facility for gamma-ray astronomy in the very-high-energy domain, with a performance which is dramatically improved over existing instruments in terms of sensitivity, energy coverage, survey capability and flexibility. CTA will probe non-thermal phenomena in the Universe \' known to have comparable energy content to other forms of energy such as thermal radiation \' both in our own Galaxy and at cosmological distances, addressing questions in astrophysics, astro-particle physics, particle physics, plasma physics, cosmology, and fundamental physics. \nThe CTA preparatory phase \' CTA-PP \' will address a number of crucial prerequisites for the approval, construction and operation of CTA: \n- the legal framework, governance schemes, and financial regulations under which CTA will be constructed and operated \n- the preparation of funding agreements between potential funding agencies \n- the preparation of contracts with potential host countries for the CTA instrument \n- the detailed technical design and costing of the CTA observatory \n- the selection of sites where CTA will be deployed, and detailing and cost-estimation of the required site infrastructure \n- the schemes for procurement and industry involvement in the technical design and construction of CTA \n- the required linking with relevant science communities regarding the detailed definition of the science program, the corresponding final optimisation of the observatory layout, and the definition of user services and data access. \n\nFor CTA-PP, support is sought primarily for work on the legal, governance and financial issues, for the installation of a project office coordinating and supporting management of CTA-PP as well as the design of CTA and the planning of the implementation, and for studies regarding the optimisation and production of CTA components by industry...','HUMAN','en',262053),(188,'The objective of this project is the integration of world class high-throughput sequencing and genotyping facilities that will provide sequencing and genotyping technologies and data analysis methodologies to the scientific community. The European Sequencing and Genotyping Infrastructure (ESGI) will enable external users to generate data rapidly and to acquire knowledge efficiently. By providing access to the ESGI facilities in order to benefit from the sequencing and genotyping technologies, there will be an outreach and sustainable impact for the scientific community in the area of biological and medical research to generate new knowledge. The ESGI will optimise European research programs and foster transnational collaborations. \n\nIn general, the ESGI will defragment and thereby strengthen the European research capacities in genetics and genomics and improve the knowledge transfer from large genomics centres among themselves and to external expert groups or scientists who are focusing on specific research questions. Our aim is to apply and improve new high-throughput nucleic acids analysis technologies for a broad range of genetic and systems biology studies using well-phenotyped samples, for example those derived from standardised European biobanks and animal facilities. In particular, massively-parallel sequencing technologies are essential components of modern biomedical research and are ready to reveal molecular and cellular pathways underlying complex traits and common diseases. \n\nAs the European Strategy Forum for Research Infrastructures (ESFRI) pointed out in the past, the development of an efficient infrastructure for sequencing and genotyping is of crucial importance to position Europe as one of the world-leading regions for genetics, genomics and systems biology research and thus a contribution to the European Research Area.','HUMAN','en',262055),(189,'EXPEER will bring together, major observational, experimental, analytical and modelling facilities in ecosystem science in Europe. By uniting these highly instrumented ecosystem research facilities under the same umbrella and with a common vision, EXPEER will form a key contribution to structuring and improving the European Research Area (ERA) within terrestrial ecosystem research. EXPEER builds on an ambitious plant for networking research groups and facilities. The joint research activities will provide a common framework and roadmap for improving the quality, interaction and individual as well as joint performance of these infrastructures in a durable and sustainable manner. \n\nEXPEER will provide a framework for increased use and exploitation of the unique facilities through a strong and coordinated programme for Transnational Access to the infrastructures. Extensive outreach and collaboration with related networks, infrastructures as well as potential funding bodies will ensure that EXPEER will contribute with its key experiences to the shaping and designing of future research networks and infrastructures, and that it has full support from all stakeholders in reaching its long-term objectives. \n\nThe establishment of the EXPEER Integrated Infrastructure will enable integrated studies of the impacts of climate change, land use change and loss of biodiversity in terrestrial ecosystems through two major steps: \n1. Bringing together the EXPEER Infrastructures to enable collaboration and integration of observational, experimental and modelling approaches in ecosystem research (in line with the concept developed in ANAEE); \n2. Structuring existing network of ecosystem observational, monitoring and experimental sites across Europe (LTER-Europe). \n\nThrough its integrated partnership, uniting both the experimental, observational, analytical and modelling research communities, EXPEER has the multidisciplinary expertise and critical mass to integrate and structure the European long-term ecosystem research facilities providing improved services and benefits to the whole research community as well as the society in general.','HUMAN','en',262060),(190,'Genome sequencing initiated a new age in biology. Now, the emphasis is on the biological interpretation of the genome: zooming on the biological functioning of the gene-products, i.e. the proteins, emerging into a filed termed proteomics. Protein levels depend not only on mRNA levels, but also on translational controls & regulated degradation, making the measurement of expression at the protein level a prerequisite. The expression levels of all proteins, their modifications, localization and interactions provide the most relevant single data set characterizing a biological system. \n\nThe PRIME-XS consortium aims to provide state-of-the-art proteomics technologies to the European biological and biomedical research community. Its twelve partners, all leading in the field of proteomics, will provide access to their technology at six access facilities, distributed over Europe, will develop new technologies to better aid the research community in answering current day scientific questions, and will organize a wide range of meetings, courses and training events to disseminate their knowledge and expertise. Special emphasis will be placed on extending this knowledge to new member states of the European Union and other regions of Europe with less privileged availability of proteomics facilities. Access to the facilities will be advertised widely and will be open to all researchers in Europe, via an open, independently reviewed, online application system. Research proposals will be evaluated and, if selected, linked to an appropriate access facility. Many of the partners will be involved in research projects aiming at the development of new methods and tools to aid the access facilities and users. Results obtained will be communicated to both facility operators as well as user via publications, meetings and courses. Together with an industrial platform, users as well as other stakeholders, the consortium will also aim to provide the basis for a sustainable, Europe wide, proteomics community to maintain the high level of proteomics access and research, also beyond the duration of this project.','HUMAN','en',262067),(191,'The Radboud University Nijmegen, operating the High Field Magnet laboratory (HFML, for continuous magnetic fields), the Forschungszentrum Dresden-Rossendorf, operating the Hochfeld-Magnetlabor Dresden (HLD, for pulsed magnetic fields), and the Conseil National de la Recherche Scientifique, operating the Laboratoire National de Champs Magnetiques Intenses in Grenoble and Toulouse (LNCMI-G for continuous and LNCMI-T for pulsed magnetic fields), undertake a study how to organize and operate, under one umbrella, the European Magnetic Field Laboratory (EMFL).\nThis study will investigate all legal, financial, organizational and employment related issues, and formulate a document for the founding agreement of the EMFL of the 3 partners, or any other stakeholders that may be identified.\nDifferent work packages will provide studies of the feasibility and cost of all the proposed investments in the new EMFL, and develop the in-house knowledge base for the investments, and harmonize experimental capabilities at the infrastructures. A web page and material will be developed for communication with the user community and the public. The coupling of high magnetic fields with advanced light sources will be investigated and how joint operation of different infrastructures can be organised, and a future roadmap for EMFL established.','HUMAN','en',262111),(192,'For the 10th anniversary of the European network of instrumented aircraft for research in environmental and geo-science, an international conference will be organized in Toulouse at the Meteo-France conference centre during the last week of October 2010. All scientists involved in airborne research will be invited to exchange knowledge and experience and contribute to a forward-look on user requirements and operators? development strategy. \n\nThere will be a special focus on open access to airborne research infrastructures, joint development of a heavy-payload and long endurance aircraft, availability of a stratospheric aircraft in Europe and the development of UAS for environmental research. Following the scientific conference, the Supporting Activity aims to organize an exhibit of research aircraft, where decision makers will be informed of the recommendations from the meeting on the future of airborne geo-science. They will also be able to inspect research aircraft from both Europe and the US, to witness inter-calibration flight experiments, and to debate the benefits of open access and the constitution of a sustainable structure for the coordination of the European fleet. The first day of the aircraft exhibition will be reserved for institutions and professionals and the second and third days will be open to the public. \n\nWith most of the international research aircraft based at the airport for three days, the operators will benefit, for the first time, from an opportunity to inter-calibrate their measurement systems. SMEs involved in airborne equipment will be invited to advertise their most sophisticated products and know-how, and they will reach a very large collection of aircraft operators and academic laboratories involved in airborne measurements. Finally the public, by visiting instrumented aircraft on the ground and observing real research flights, will better understand the rationale for the development of cutting edge research infrastructures.','HUMAN','en',262147),(193,'The MERIL project aims to complete an in-depth analysis of the current European Portal on Research Infrastructures\' Services, leading to the redesign and implementation of a comprehensive database of pan-European Research Infrastructures (RIs) and their mapping as a useful tool for scientists and policy makers. In the long run impacts are expected such as increased visibility of the services and collaborations offered by the RIs as well as joint foresight with gap and needs analysis. Funding is requested from the European Commission for the first two years of the project. If approved the EC would thereby play its role of catalyst. \n\nMERIL governance will consist of: \n- a Steering Committee (SC) comprising representatives from the major European stakeholders e.g. ESF, EUROHORCs, ESFRI, ERF and EIROforum etc. Each reporting to their General Assemblies; \n- a Science Advisory Board responsible for providing expert scientific and political advice at important milestones of the project. \n\nThe ESF Member Organisation (MO) Forum made up of delegates representing ESF organisations willing to explore the future of RIs in Europe will be central in contributing to the project and its Chair will be a member of the SC. ESF will coordinate the project and assemble a project management team. A series of meetings will be held: \ni) to reach consensus on definitions (RIs, Categories of RIs, Science Domains, Scope etc.), to make a state of the art analysis on the European context, and to identify the needs of data users and providers; \nii) to discuss data acquisition, including incentives and access rules; \niii) to agree on a common set of criteria for ensuring quality of the data. The combined reports of these meetings will lead to an up-graded and up-dated pan-European database. \n\nThrough the combined efforts of determined and highly committed stakeholders it is expected that the MERIL database will contain high-quality data and have flexible, customer-oriented interfaces.','HUMAN','en',262159),(194,'Improved cooperation has brought European astronomy to front player, notably through such organisations as ESO and ESA. To continue to excel in a competitive world, Europe must also coordinate national resources in the long term and across borders between disciplines and nations. Accordingly, the goal of ASTRONET is to establish a strategic planning mechanism for all of European astronomy. Established as an ERA-NET in 2005, ASTRONET developed its \"Science Vision for European Astronomy\" (2007), followed in 2008 by an \"Infrastructure Roadmap\". \n\nBoth documents are very comprehensive: they cover all scientific topics in astronomy, from the Sun and Solar System to the limits of the observable Universe, and observation tools from the radio domain to gamma-rays and particles, on the ground and in space; they discuss theory and computing, outreach, training and recruitment of the vital human resources; they cover all of Europe as ASTRONET aims to engage all astronomical communities on the new map of Europe. Building on those notable achievements, our ambition now goes even farther as we proceed to the implementation stage, a very significant new step towards increased coordination of the European resources for astronomy. \n\nASTRONET\'s objectives for 2011-2014 are fourfold: \n(1) To establish a permanent mechanism for planning and coordination in European astronomy. \n(2) To follow-up and implement the Roadmap by building the new facilities that are needed to reach our scientific goals while optimising existing programmes in both scientific and financial terms ? not only new joint projects at ESO or ESA, but a range of national resources as well. \n(3) To narrow the scientific and ? in particular - technology gaps between different European countries, and \n(4) To establish a regularly updated data base with key information on the financial and human resources for astronomy in all European countries, as well as on the structure and governance of astronomical research in each country.','HUMAN','en',262162),(195,'Nano-scale objects interact with living organisms in a fundamentally new manner, ensuring that a fruitful marriage of nanotechnology and biology will long outlast short term imperatives. Therefore, investment in an infrastructure to drive scientific knowledge of the highest quality will have both immediate benefits of supporting the safety assessment of legacy nano-materials, as well as pointing towards future (safe) applications with the lasting benefits to society. \n\nThere are immediate priorities, for few doubt that serious damage to confidence in nanotechnology, unless averted, could result in missed opportunities to benefit society for a generation, or more. QNano will materially affect the outcome, at this pivotal moment of nanotechnology implementation. The overall vision of QNano is the creation of a \'neutral\' scientific & technical space in which all stakeholder groups can engage, develop, and share scientific best practice in the field. Initially it will harness resources from across Europe and develop efficient, transparent and effective processes. Thereby it will enable provision of services to its Users, and the broader community, all in the context of a best-practice ethos. This will encourage evidence-based dialogue to prosper between all stakeholders. However, QNano will also pro-actively seek to drive, develop and promote the highest quality research and practices via its JRA, NA and TA functions, with a global perspective and mode of implementation. \n\nQNano will also look to the future, beyond the current issues, and promote the growth and development of the science of nano-scale interactions with living organisms. By working with new and emerging scientific research communities from medicine, biology, energy, materials and others, it will seek to forge new directions leading to new (safe, responsible, economically viable) technologies for the benefit of European society.','HUMAN','en',262163),(196,'The Square Kilometre Array (SKA) is a 1.5 B + global research infrastructure that aims to build a radio telescope with a collecting area of a million square metres, fifty times larger than any existing instrument. The telescope will be composed of a centrally condensed array of antenna stations that will be distributed on scales of up to 3000 km. The SKA concept was originally developed by European scientists and engineers, and has recently emerged as one of the two major priorities for the European astronomical community in the coming decade (via the ASTRONET Infrastructure Strategic Plan). In addition to advancing science in general, the SKA will also be a technological driving force in pushing forward Europe s competitiveness in areas such as digital processing, computing, archiving, and research networking capabilities (on local, regional and global scales). The ISKAF2010 hosts for the first time in Europe, the International SKA Forum 2010. The meeting will take place in the Netherlands and will be part of a larger range of initiatives and support events for which we also seek funding. The forum in 2010 will aim to bring together politicians, government ministries, the EC, national funding agencies, educators, scientists, and engineers from all over the world. The theme will focus on SKA beyond Astronomy and underline European participation in all aspects of the project, emphasising the potential benefits of the SKA to industry, business and society as a whole.','HUMAN','en',262168),(197,'ESS-DACE aims to secure the continuation and consolidation of the European Social Survey (ESS) as a key data source for measuring and understanding long-term changes in public attitudes across Europe. This will be achieved by strengthening the links between the 7 institutions responsible for the central design and coordination of the ESS infrastructure, as well as between the ESS and its funders, data users, national teams and a distinguished network of advisers. The objectives of the ESS infrastructure are: to chart and explain changes in Europes social, political and moral climate (WP2, WP4); to achieve and spread improved standards of rigour in cross-national social measurement, and simultaneously to raise the threshold standards of national surveys (WP3, WP5, WP7, WP12); to introduce and encourage the use of soundly-based attitudinal indicators of national progress, based on citizens judgments of key aspects of their societies (WP6); to undertake and facilitate the training of European researchers in comparative quantitative measurement and analysis (WP9); to provide enhanced access remotely to the users of and participants in the infrastructure (WP8); to improve the visibility and outreach of quantitative data on social change to academics, policy makers and the wider public (WP5, WP10, WP11); to maintain and update a specially-created contextual data repository to help isolate the independent effect of background political and social developments on shifts in attitudes and values (WP13) and to refine the financial, operational and organisational arrangements of the ESS infrastructure to suit its longer term perspectives and commitments (WP3). This application is to ensure not just the survival of the ESS time series, but also to consolidate its achievements by creating a transparent, accessible and increasingly valued mechanism for unpicking the relationship between Europes changing institutions and the shifting values of its people.','HUMAN','en',262208),(198,'To understand the complex Earth System requires an integrated observational strategy and infrastructure to record key diagnostic features of its dynamics. Accordingly, this infrastructure must include geographically distributed and multidisciplinary monitoring instruments and observations. \n\nThe European Plate Observing System (EPOS) will meet this challenge. The proposed RI (EPOS) will create a single sustainable, permanent and distributed infrastructure, integrating land-based geophysical monitoring networks, local observatories (including permanent in-situ and volcano observatories) and experimental laboratories in Europe. EPOS will give open access to geophysical and geological data and modelling tools, enabling a step change in multidisciplinary scientific research into different fields, including seismic and volcanic hazards, environmental changes as well as energy and long-term sustainability. This will result in benefits to society. Presently, the different European countries own a mosaic of hundreds of impressive, but separated networks, observatories, temporary deployments, labs and modelling facilities, etc... for solid earth studies. Long-term sustainability of plate observations, optimising access to, and combining a wide variety of solid Earth data and modelling tools are prerequisites to innovative research for a better understanding of the physical processes controlling earthquakes, volcanic eruptions and other catastrophic events (landslides, tsunamis) together with those controlling Earth surface dynamics (crustal response to deformation and to global change). \n\nEPOS will enable the scientific community to study the same phenomena from a multidisciplinary point of view, at different temporal and spatial scales (from laboratory to field and plate tectonic scale experiments). EPOS intends to create the prerequisites for Europe to maintain a leading role in solid Earth science research.','HUMAN','en',262229),(199,'Climate change is for a large part governed by atmospheric processes, in particular the interaction between radiation and atmospheric components (e.g. aerosols, clouds, greenhouse and trace gases). Some of these components are also those with adverse health effects influencing air quality. Strengthening the ground-based component of the Earth Observing System for these key atmospheric variables has unambiguously been asserted in the IPCC Fourth Assessment Report and Thematic Strategy on air pollution of the EU. However, a coordinated research infrastructure for these observations is presently lacking. ACTRIS (Aerosols, Clouds and Trace gases Research InfraStructure Network) aims to fill this observational gap through the coordination of European ground-based network of stations equipped with advanced atmospheric probing instrumentation for aerosols, clouds and short-lived trace gases. \n\nACTRIS is a coordinated network that contributes to: providing long-term observational data relevant to climate and air quality research produced with standardized or comparable procedures; supporting transnational access to large infrastructures strengthening collaboration in and outside the EU and access to high quality information and services to the user communities; developing new integration tools to fully exploit the use of atmospheric techniques at ground-based stations, in particular for the calibration/validation/integration of satellite sensors and for the improvement of global and regional-scale climate and air quality models. \n\nACTRIS supports training of new users in particular young scientists in the field of atmospheric observations and promotes the development of new technologies for atmospheric observation of aerosols, clouds and trace gases through close partnership with SMEs. \n\nACTRIS will have the essential role to support integrated research actions in Europe for building the scientific knowledge required to support policy issues on air quality and climate change.','HUMAN','en',262254),(200,'The Mediterranean and Middle East, with a combined total population of more than 400 million people, are characterized by strong environmental gradients, climate extremes and diverse economic, social and cultural identities. It is expected that throughout the 21st century the region will experience substantial adverse climate changes and face major challenges in energy demand and supply, as well as a decreasing availability of fresh water. It will be essential to address the undesirable economical and societal consequences and manage them cooperatively. Rethinking energy and water policies and adopting new concepts to respond to these challenges are increasingly recognized as a high priority, both regionally and internationally. \n\nThe main objective of the project is to favor and prepare the creation of a regional data infrastructure devoted to climate, water, energy and related topics, by engaging relevant entities into a coordinated effort at the regional scale. To this end the project will set up a Task Force including internationally recognized experts and carry out studies of all relevant scientific, technical, legal and political issues. It will also carry out networking activities aimed at regional climate stakeholders (Research institutions, public authorities, relevant state agencies, NGOs, etc.), in order to raise their awareness and engage key actors into creating the appropriate conditions for the formation of a regional data infrastructure devoted to climate, energy and water related data, and into capacity building, prospective & incubation activities for future collaborative climate research.','HUMAN','en',262263),(201,'The Preparatory Phase for a pan-European MARINE BIOLOGICAL RESOURCE CENTRE(EMBRC) research Infrastructure. This application focuses on the technical, legal, governance, and financial issues to prepare a memorandum of understanding to begin to construct EMBRC. It will build on existing Marine Biological Institutes and Research Centres which will be complemented with innovative components and properly embedded into European scientific, ethical, legal and societal frameworks. \n\nThe preparative phase of EMBRC will provide the proof of concepts for a key resource to increase excellence and efficacy in Marine Biological Research and secure competitiveness of European research and industry in a global context. This distributed pan-European infrastructure will provide access to model marine organisms and related genomic resources. It will promote access for both research and training. The main costal marine laboratories will be embedded within this RI to provide access to model marine organisms and their ecosystems together with modern technology and \'omic\' platforms.','HUMAN','en',262280),(202,'Considering the amount of resources invested in RI, evaluation of their direct and indirect impacts is needed to support policy decision. EVARIO aims at developing an evaluation method well suited to RI, taking into account their specific role in the changing context towards an open innovation and research environment. The project will primarily adapt the so-called Beta approach of evaluation to the case of the RI, an approach used so far for ex post evaluations of economic impacts of a large variety of RD programmes. The adaptation will be carried out in connection with in-depth investigations of the evolution of RI and the research networks around them. The underlying idea is that S&T knowledge creation in general and knowledge creation through RI in particular result from a cumulative and interactive learning process. \n\nMore precisely the project will: \n- map the effects generated by RI, including enrichment and network effects proper to an open innovation and research perspective \n- develop methods and indicators for evaluating some of these effects \n- provide 4 complementary analyses related to the role and impact of RI in open innovation and research systems, connected to their evolution and networking properties: (i) open source knowledge creation through RI; (ii) flexibility of RI via real option; (iii) RD networks; (iv) impact on regional creativity \n- carry out 4 RI case studies via interviews to assess the validity of the mapping in various contexts, the feasibility of the evaluation method, and bring the relevant facts to feed the complementary analyses. \n\nBy developing enhanced methods and indicators to identify and measure economic impacts of RI, EVARIO should provide guidelines for policy makers to optimize the resources dedicated to RI. This study, via targeted dissemination actions, should also improve the understanding of the conditions of knowledge creation through RI, in particular their ability to foster collaborations and creativity.','HUMAN','en',262281),(203,'The overall aim of NERA is to achieve a measurable improvement and a long-term impact in the assessment and reduction of the vulnerability of constructions and citizens to earthquakes. NERA will integrate the key research infrastructures in Europe to monitor earthquakes and assess their hazard and risk, and will combine expertise in observational and strong-motion seismology, modeling, geotechnical and earthquake engineering to develop activities to improve the use of infrastructures and facilitate the access to data. NERA will ensure the provision of high-quality services, including access to earthquake data and parameters and to hazard and risk products and tools. NERA will coordinate with other EC projects (SHARE, SYNER-G) a comprehensive dissemination effort. NERA will contribute to the OECD GEM program and to the EPOS ESFRI infrastructure.','HUMAN','en',262330),(204,'AQUAEXCEL will coordinate the highest class European aquaculture research facilities covering the entire range of production systems (recirculation, flow-through, cage, hatchery and pond systems), environments (freshwater and marine, cold and warm water), scales (small, medium and industrial scale), fish species (salmon, trout, sea bass, sea bream, cod, carp), and fields of expertise (nutrition, physiology, health and welfare, genetics, monitoring and management technologies and engineering).\nAQUAEXCEL will:\n- Link and coordinate key research infrastructures in Europe: cage, recirculation and hatchery aquaculture systems, land and sea based, fresh and salt water installations in order to create the basis for synergistic research projects\n- Provide research teams with access to a wide range of the state-of-the-art infrastructures covering all important aquaculture species, systems, environments and expertises\n- Increase resource sharing and standardization between partners, notably but not exclusively for fish models and experimental methods developed in-house\n- Stimulate innovation through transfer of knowledge, harmonisation and development of best practices across fields of research, production systems and species\n- Execute joint research and development activities designed to improve the services currently provided by the infrastructures (remote access and monitoring, more accurate performance evaluation, limitation of live animals use, applicability of results at industry scale, development of biological models).\n- Bridge the gap between the scientific community and the industry through stimulation of problem-based research and enhanced knowledge transfer\nAQUAEXCEL will facilitate a coherent development of the aquaculture research facilities for which there is a strong demand from the public and private sectors of aquaculture research, which have to work towards sustainable production of high quality seafood with reduced environmental impact.','HUMAN','en',262336),(205,'The central objective of this ESMI proposal is to create a top-level interdisciplinary research infrastructure available to a broad European materials research community. This is of crucial importance to the EU in view of the European strategy for nano-sciences and nanotechnology and its implementation report that identifies \'a lack of leading interdisciplinary infrastructures\'. ESMI offers the most important experimental and synthesis techniques and combines world-class infrastructures with cutting edge scientific expertise through a sophisticated networking programme. The anticipated JRA will further improve the existing infrastructure. Computer simulations being of increasing importance for the understanding and prediction of complex materials, ESMI offers access to simulation groups and their advanced tools. \n\nThe availability of such an infrastructure will provide soft matter scientists with a broad choice of techniques to address their scientific objectives. It will result in a quantum leap in research opportunities and assure that European scientists have a world-class collaborative capability for their frontier research. ESMI will strongly contribute to a fundamental understanding, allowing the development of new, tailored smart materials. \n\nESMI follows the FP6 experience of the NoE SoftComp. A key feature developed within SoftComp is the highly successful Research Platforms offered to its members, anticipating the spirit of the EU Integrated Infrastructure Initiative. ESMI will promote the SoftComp experience to the European materials community, reflecting the EU recommendations that FP6 collaborative projects \'may well lead to new European infrastructures\'. Together with a platform for disseminating the results and educating a new generation of young soft matter scientists, ESMI represents an important added value to the European Research Area in nano-science, nanotechnology and materials science','HUMAN','en',262348),(206,'Biomedical research depends on the availability of living non-human primates and biological material with primate origin. The need for animal research using non-human primates is therefore recognised by all governments that support internationally competitive biomedical research aimed at addressing the world\'s most pressing medical challenges. While essential for biomedical research owing to their similarity to humans, non-human primates are more than other animals endowed with high sensory and cognitive abilities. This is the basis of an international consensus that the use of primates in research has to comply with the highest ethical standards and should be restricted to cases where no alternatives exist. Research with primates has to follow the 3R-concept of Refinement, Reduction and Replacement. Meeting this requirement necessitates a commitment to substantial investments into appropriate facilities, specialized equipment and extensive training of personnel, which has been realised by the establishment of the I3-project EUPRIM-Net in the 6th framework programme. \n\nThe aim of EUPRIM-Net is to contribute to European science by improving the ability of its participants to provide the best services, support the best science that meets the highest ethical standards for primate-based animal research. With the funding of EUPRIM-Net II we will build on the successes of the starting phase of EUPRIM-Net to focus on the following overarching core objectives: - advancing the 3Rs (refinement, reduction, replacement) in primate research - develop, refine and ensure best practice in primate research - extend the network in Europe to include commercial partners and extend the network to include non-European primate centres to insure a global sharing of available resources. Additionally, EUPRIM-Net places a focus on moving away from EU funding and implementing self-sustaining structures.','HUMAN','en',262443),(207,'The main objective of this proposal is to provide a prospective and retrospective analysis of experimental research infrastructures on Energy Efficiency in Buildings related to their technical and socio-economical impact. These experimental research infrastructures, as being addressed by the Research Priorities for the Definition of a Multi-annual Roadmap and longer term strategy document elaborated for the EC by the Energy-efficient Buildings (EeB) PPP, shall contribute to (1) the implementation of Europe-wide harmonised and standardised labelling system in order to provide reliable measurement of energy performance of buildings, (2) cross national analysis of construction solutions to increase energy and thermal performance of buildings, taking into account the different climate conditions and local building practices, (3) validation of design and assessment models through analysis under real conditions and different climate conditions, in order to carry out benchmarking analysis to increase reliability of simulation software and labelling and (4) increase the cross-national contacts activities of the industrial construction sector by providing a unified, European-wide network of experimental facilities to analyze, improve and show the thermal and energy performance of building elements. By first identifying the European Experimental Research Infrastructures on Energy Efficiency and then analysing their scientific and socio-economic impacts, we shall be able to provide optimization strategies in order to get the maximum impact of these infrastructures.','HUMAN','en',262476),(208,'The project will create a dedicated initiative to promote research infrastructure partnerships between Europe and Africa. There is currently significant political attention on promoting science and technology partnerships between the European Union and Africa. The Joint Africa-European Union (EU) Strategy, adopted by Heads of Government at the December 2007 Lisbon Summit, notably includes a dedicated Science, Information Society and Space initiative. Several collaborative efforts are currently being implemented under this Partnership, with the support of the African Union Commission, the European Commission and African and European Union Member States. None of these initiatives are, however, specifically addressing research infrastructures. The \'Promoting African European Research Infrastructure Partnerships\' (PAERIP) proposal is specifically focused on addressing this void notably by undertaking a series of relevant studies, which will inform the organisation of policy dialogue and cooperation promotion events.','HUMAN','en',262493),(209,'The ECCSEL consortium teams up selected Centres of Excellence on CCS across Europe (Norway, Poland, France, Italy, Germany, Spain, Greece, UK, Netherlands and Switzerland). The mission is to develop (i.e. build and operate) a European distributed, goal-oriented, integrated Research Infrastructure, to: \r\n- Provide a dynamic scientific foundation to respond systematically to the urgent R&D needs in CCS at a pan-European level in a short and long term perspective; \r\n- Maintain Europe at the forefront of the international CCS scientific community; \r\n- Increase the attractiveness of the European Research Area, reinforcing the research-based clusters and improving their socio-economic impacts; \r\n- Optimise the value of the Community financial support The existing and new ECCSEL laboratories will be owned by the involved partner institutions. \r\n\r\nThey will, however, be developed and made available for the ECCSEL program, governed by an overall agreement. It is foreseen that ECCSEL will gradually become ready and accessible starting from 2015. The main objective of the ECCSEL Preparatory Phase project (PP) is to address the primary tasks necessary to establish a new distributed, goal-oriented, integrated pan-European infrastructure for state-of-the-art research on technologies enabling CO2 capture, transport and storage (CCS). The PP Consortium has 15 participants from 8 member states and 2 associated countries. The PP will be split into two phases, phase I and II, that will build on each other. \r\nThe first phase will last for two years and focus on legal, financial and strategic work. It will be structured in six Work Packages; WP1 Legal and governance structure, WP2 Financial strategy, WP3 Infrastructure development plan, WP4 Dissemination and outreach measures, WP5 Implementation strategy, and WP6 Project management and coordination. \r\nThe most important outcomes of the first phase include: \r\n- Identification of suitable legal and governance structure, including rules for IPR, access to and use of the facilities, and HSE standards. \r\n- Development of a financial strategy \r\n- Review of priority research needs, mapping and subsequent gap analysis to create the Infrastructure development plan. \r\n\r\nThe formal output of phase I will be the Implementation strategy report, which will be developed in WP5.','HUMAN','en',262512),(210,'Offshore Renewable Conversion systems are mostly at the pre-commercial stage of development. They comprise wave energy and tidal stream converters as well as offshore wind turbines for electrical generation. These devices require research to be undertaken at a series of scales along the path to commercialization. Each technology type is currently at a different stage of development but each one also needs specific research infrastructures to facilitate and catalyze commercialization. The aim of this project is to coordinate research and development at all scales (small models through to prototype scales from Laboratory through to Open Sea tests) and to allow access for researchers and developers into facilities which are not available universally in Europe. The linking together of facilities at different scales together with the incorporation of test facilities for components such as power take-off systems, grid integration, moorings, environmental tests will ensure a focusing of activities in this area. \n\nMaRINET brings together an Infrastructure with 42 Facilities from 28 Partners spread across 11 EU countries and 1 ICPC, Brazil. It also brings together a network of expertise in the Offshore Marine Renewable Energy sector with experience at all scales of offshore technology research and development. MaRINET offers over 600 weeks of access to 300 projects and 800 external users. The majority (77%) of the MaRINET budget has been targeted in the areas most prioritized in the EC Call such as networking, training, dissemination and transnational access.','HUMAN','en',262552),(211,'This project builds on the work previously done for the first RAMIRI project. It responds to a number of developments in European research infrastructure (RI) management, including the ESFRI Roadmap, the ESFRI regional issues working group, the ECRI conferences and the European Research Area (ERA) Board. The principal aims of this proposal are to train a group of new RI-managers (with a particular emphasis on managers from the new member states) in a number of key practical areas relevant to establishing and managing RIs of pan-European and international importance, including both single-sited and distributed infrastructures in both the physical/natural and social sciences. \nTopics covered will include: determining socio-economic impact, site-selection, legal and governance issues, financing, project planning and construction, recruiting specialised staff, and strategic planning (upgrades, partnerships, technology transfer). These learning areas will be delivered by expert speakers coordinated by a programme committee across 2 learning programmes over 24 months. \nEach programme will consist of two workshops held in a different location: Amsterdam, Prague and twice in Trieste. Elettra Sincrotrone Trieste will coordinate the overall project and work closely with its partners: Adam Mickiewicz University, Imperial College London, Institute of Physics and University of Amsterdam. The workshops will also include a site visit or more detailed case study relevant to each location. Participants will be selected on the basis of suitability through an application process. \nA mid-term review meeting will be held in Poznan to coincide with the Polish Presidency of the EU in late 2011. Following the end of the programmes, the learning materials and case presentations will be incorporated into a revised \'RAMIRI\' handbook which thematises and summarises key issues in RI-management.','HUMAN','en',262567),(212,'Around European coastal seas, the number of marine observing systems is quickly increasing under the pressure of both monitoring requirements and oceanographic research. Present demands for such systems include reliable, high-quality and comprehensive observations, automated platforms and sensors systems, as well as autonomy over long time periods. In-situ data collected, combined with remote sensing and models output, contribute to detect, understand and forecast the most crucial coastal processes over extensive areas within the various national and regional marine environments.\n\nCoastal observations are an important part of the marine research puzzle of activities and applications. However significant heterogeneity exists in Europe concerning technological design of observing systems, measured parameters, practices for maintenance and quality control, as well as quality standards for sensors and data exchange. Up to now, the expansion of coastal observatories has been driven by domestic interests and mainly undertaken through short-term research projects. Therefore the main challenge for the research community is now to increase the coherence and the sustainability of these dispersed infrastructures by addressing their future within a shared pan-European framework.\n\nThis is the main objective of JERICO, which proposes a Pan European approach for a European coastal marine observatory network, integrating infrastructure and technologies such as moorings, drifters, ferrybox and gliders. Networking activities will lead to the definitions of best practices for design, implementation, maintenance and distribution of data of coastal observing systems, as well as the definition of a quality standard. Harmonisation and strengthening coastal observation systems within EuroGOOS regions will be sought.\n\nUnique twin Trans National Access experiments will be carried out in order to reveal the potential of datasets used in synergy. Central coastal infrastructure in Europe will be opened for international research. This will among other benefits GMES and European contribution to climate change research.\n\nNew joint research will be conducted in order to identify new and strategic technologies to be implemented in the next generation European coastal observatories. Focus is given on emerging technologies and the biochemical compartment.\n\nJERICO intends to contribute to the international and global effort on climate change research (GEOSS), to provide coastal data in','HUMAN','en',262584),(213,'While access to anonymous official micro-data for researchers is still uneven both at national and at European level, access to highly detailed and sensitive micro-data is now increasingly on the agenda. Different member states have substantially different outcomes for research access to Official data, and the issue is not just efficiency, but real harm to the contribution of the social sciences to democracy in an information society. Therefore the primary impact of this application is to prepare the essential relationships and build trust, common view and agreements on standards between the European Statistical System led by Eurostat, other stakeholders as the Central banks, the Data Archives European network (CESSDA) and the researchers who are the final users; from access as a postcode lottery, to an integrated model where the best solutions for access are available irrespective of national boundaries and are flexible enough to fit national arrangements. \n\nIt aims at: \na) discussing frameworks and proposing pilots for a European accreditation and a distributed remote access for confidential micro-data to be expanded later to other partners, both for national and European datasets; \nb) fostering discussions and promoting improvements and solutions for the entire communities through annual/bi-annual European data Forum, regional workshops, users conferences, training sessions, staff visits \nc) preparing an easy and single point of access (What data are available? How can I access them?) for the researchers, to be linked to the CESSDA portal where NSIs metadata could be harvested when not available through the CESSDA archives still providing access to official micro-data; \nd) immediately enhancing access to official data making European datasets more useable (metadata, routines) and supporting foreign researchers transnational access both on site and through remote access system to countries official micro-data. \n\nClose coordination with the European Statistical System discussions and initiatives as well as with on-going and future related projects is developed to ensure maximum synergy and incorporation of outputs.','HUMAN','en',262608),(214,'Environmental change and particularly amplified global climate change are accelerating in the Arctic. These changes already affect local residents and feedback from the Arctic\'s land surface to the climate system, will have global implications. However, climate change and its impacts are variable throughout the wide environmental and land use envelopes of the Arctic. Unfortunately, the Arctic is generally remote, sparsely populated and research and monitoring activities are more restricted in time and space than elsewhere. This limitation comes when there is a rapidly expanding need for knowledge as well as increasing technological opportunities to make data collection in the field and accessibility more efficient. \n\nINTERACT is a network under the auspices of SCANNET, a circumarctic network of terrestrial field bases. INTERACT specifically seeks to build capacity for research and monitoring in the European Arctic and beyond. Partnerships will be established between Station Managers and researchers within Joint Research Activities that will develop more efficient networks of sensors to measure changing environmental conditions and make data storage and accessibility more efficient through a single portal. New communities of researchers will be offered access to Arctic terrestrial infrastructures while local stakeholders as well as major international organisations will be involved in interactions with the infrastructures. \n\nThis will lead to increased public awareness of environmental change and methods to adapt to them, increased access to information for education at all levels, and input to major international research and assessment programmes. The whole consortium will form a coherent and integrated unit working within a concept of a wide environmental and land use envelopes in which local conditions determine the directions and magnitudes of environmental change whereas the balance and synergies of processes integrated across the whole region have global impacts.','HUMAN','en',262693),(215,'The Project promotes the access to five European Research Infrastructures, and it is structured into nine Networking Activities, plus the Management of the Consortium, and fourteen Joint Research Activities.\r\n\r\nThe Project will profit of the success of the previous HadronPhysics project in FP6 and the current HadronPhysics2 in FP7, and originates from the initiative of more than 2.500 European scientists working in the field of hadron physics. Hadron physics deals with the study of strongly interacting particles, the hadrons. Hadrons are composed of quarks and gluons. Their interaction is described by Quantum Chromo Dynamics, the theory of the strong force.\r\nHadrons form more complex systems, in particular atomic. Under extreme conditions of pressure and temperature, hadrons may lose their identity and dissolve into a new state of matter similar to the primordial matter of the early Universe.\r\n\r\nThe Networking Activities are related to the organization of experimental and theoretical collaborative work concerning both ongoing activities at present Research Infrastructures and planned experiments at future facilities.\r\n\r\nIn hadron physics the close interaction between experimentalists and theoreticians is of paramount importance. The Joint Research Activities concentrate on technological innovations for present and future experiments. Applications in material science, medicine, information, technology etc. represent natural fall-outs. The main objective of this Integrating Activity is to optimize the use and development of the Research Infrastructures existing in Europe working in the field of hadron physics.\r\n\r\nThe Project aims as well at structuring, on European scale, the way Research Infrastructures operate, and at fostering their joint development in terms of capacity and performance. The approach used is the bottom up approach, to respond to the needs of the scientific community in all fields of science and technology.','HUMAN','en',283286),(216,'EUDAT is our proposal for the next stage in the realisation of the vision of data as infrastructure . The EUDAT consortium includes representatives from each stage of the value chain that has evolved to deliver scientific knowledge to researchers, citizens, industry and society as a whole. It includes funding agencies that invest in research infrastructures and programmes of research, infrastructure operators and research communities who rely on the availability of data-management services, national data centres and providers of connectivity and, of course, the users who rely on the availability of data and services, innovators who add value to the raw results of scientific research.\n\nEUDAT is a three-year project that will deliver a Collaborative Data Infrastructure (CDI) with the capacity and capability for meeting future researchers needs in a sustainable way. Its design will reflect a comprehensive picture of the data service requirements of the research communities in Europe and beyond. This will become increasingly important over the next decade as we face the challenges of massive expansion in the volume of data being generated and preserved (the so-called data tsunami ) and in the complexity of that data and the systems required to provide access to it.\n\nAlthough those user requirements will vary between scientific disciplines, the micro-systems from which each community s services are built are largely generic. This commonality will make it easier to achieve the minimum critical mass of users necessary for significant economies of scale to be achieved. The ability to rapidly provide bespoke responses to the evolving needs of our research communities additionally strengthens the business case for those communities. With the inclusion of disciplines from across the spectrum of scientific endeavour sharing a common infrastructure, EUDAT also provides the opportunity for data-sharing between disciplines and cross-fertilisation of ideas.','HUMAN','en',283304),(217,'Between 2007 and 2010 the ORIENT project provided the first high capacity link between GEANT and China with FP6 funding support and successfully enabled many innovative EU-China research and application collaborations to flourish. ORIENTplus addresses Section 3.4 domain (f) of the call (\"International cooperation in Research and Education Networking addressing (i) the extension of the European infrastructure to China \") to maintain and further develop infrastructure between GEANT and China that is open for use by all European and Chinese researchers. ORIENTplus requires EC funding support to increase the capacity and offer point to point services on the link during the project term.\n\nIn ORIENT China was formally represented by CERNET; this time CERNET and CSTNET are equal partners, reflecting the strengthening research network relationships between the regions and offering scope for coordinated operational and user support.\n\nThe ORIENTplus proposal has been constructed taking account of the deep expertise of both the European and Chinese partners and building on the experiences of working together in ORIENT. CERNET and CSTNET, are each committing 1M Euro towards the link costs with CERNET\'s funding already maintaining the link during first 6 months of 2011. The EC and European NRENs will match the Chinese commitment over the period to the end of ORIENTplus to reflect the high mutual benefit to China and Europe, with 0.94M of the funds provided by the EC.\nThe focus of the proposal is to support the infrastructure link. In addition the proposal sets out unfunded supporting activities to optimise the performance of the link, promote the use of the link, and provide users with technical support.','HUMAN','en',283334),(218,'Biodiversity Virtual e-Laboratory (BioVeL) meets the needs of Europes Biodiversity Science research community with tools for pipelining data and analysis into efficient workflows, urgently needed to understand biodiversity in a rapidly changing environment. BioVeL customises, deploys and supports the Taverna / myExperiment / BioCatalogue family of software to achieve this.\n\nClose user involvement is crucial to successful design and implementation of virtual laboratories. Close support and guidance makes all the difference in uptake of tools and their continued success. BioVeL places particular emphasis on targeted networking activities with specific sub-communities and tailored service activities that deliver training, helpdesk and consultancy assistance to solve specific problems.\n\nUsing agile processes, BioVeL defines and deploys (web) service sets and workflow packs catering for sub-communities within the domain. The project focuses on pilot topic areas:\ni) DNA sequence-based phylogeny and metagenomics services that help link knowledge of model organisms to a broad range of species, that provide a measure of genetic diversity used in conservation planning and that help to understand adaptation in relation to climate change;\nii) Taxonomy services to provide the underpinning checklist of diversity in Europe, identification aids to native, invasive and economic species;\niii) Niche and population modelling for species, to better understand the processes of conservation and invasive species management; and,\niv) Ecosystem functionality and valuation services, to improve modelling capabilities to ecosystem services and CO2 sequestration.\n\nThrough use of gateways, workflows composed in the BioVeL environment can be executed on a wide range of computing resources, including European e-Infrastructures (EGI, PRACE, etc.).\n\nJoint research activities will investigate improvements to ease of use of workflows by exploring new middleware approaches to easier user interfaces.','HUMAN','en',283359),(219,'RadioNet is an I3 that coordinates all of Europe\'s leading radio astronomy facilities in an integrated cooperation to achieve transformational improvement in the quality and quantity of the scientific research of European astronomers. RadioNet3 includes 27 partners operating world-class radio telescopes and/or performing cutting-edge R&D in a wide range of technology fields important for radio astronomy.\r\n\r\nRadioNet3 proposes a work plan that is structured into 7 NAs, 9 TNAs and 4 JRAs with the aim to integrate and optimise the use and development of European radio astronomy infrastructures. The general goals of RadioNet3 are to:\r\n- facilitate, for a growing community of European researchers, access to the complete range of Europe\'s world-leading radio-astronomical facilities, including the ALMA telescope;\r\n- secure a long-term perspective on scientific and technical developments in radio astronomy, pooling resources and expertise that exist among the partners;\r\n- stimulate new R&D activities for the existing radio infrastructures in synergy with ALMA and the SKA;\r\n- contribute to the implementation of the vision of the ASTRONET Strategic Plan for European Astronomy by building a sustainable and world leading radio astronomical research community.\r\n\r\nRadioNet3 builds on the success of two preceding I3s under FP6 and FP7, but it also takes a leap forward as it includes facilitation of research with ALMA via a dedicated NA, and 4 pathfinders for the SKA in its TNA Program. It has a transparent and efficient management structure designed to optimally support the implementation of the project.\r\n\r\nRadioNet is now recognized by funding agencies and international project consortia as the European entity representing radio astronomy and facilitating the access to and exploitation of excellent facilities in this field. This is of paramount importance, as a dedicated, formal European radio astronomy organisation to coordinate and serve the needs of this community does not yet exist.','HUMAN','en',283393),(220,'Worldwide activity on the development of the Information Society is being heavily hampered by the difficulty of integrating e-Infrastructures in different continents with the exception of North America.\nWe are proposing to run a Feasibility Study to build a state-of-the-art communication infrastructure connecting Europe and Latin America, with the further objective of facilitate and trigger the creation of a private consortium with possible minor contributions from public sources to put the infrastructure into reality.\nWe propose to perform a whole range of activities to this extent:\n- Technical feasibility study.\n- Assessment of the market and of its perspectives from the commercial and the points of view\n- Clarification of the financial framework.\nOther activities will be directed to maintain the interest in the project high and to try and create a kernel for the consortium that will have to build and operate the cable.','HUMAN','en',283396),(221,'The aim of this initiative is to address priorities a) and c) of the call INFRA-2011-1.2.2: Data infrastructures for e-Science. It is about delivering long-term preservation services as part of the data infrastructure for e-Science.\nWe aim to deliver generic infrastructure services for science data preservation that address the persistent storage, access and management required by the call and to build on the experience of the ESA Earth Observation Long Term Data Preservation (LTDP) programme to favour the set-up of a European Framework for the long term preservation of Earth Science (ES) data through the definition of common preservation policies, the harmonization of metadata and semantics and the deployment of the generic infrastructure services in the ES domain.\nThe generic services will build on the already proven research prototype services from the CASPAR project. We will evaluate and tune these services in depth, using Earth Science as pathfinder, and broadly but less deeply across other disciplines linked to the Alliance for Permanent Access (APA) and ESFRI clusters. Earth Science presents an enormous challenge to the providers of data-infrastructure because it is inherently a very broad and scattered domain with completely different instruments operated by different entities, which at the moment apply different data preservation policies or none at all. This work is important because it will allow our society to properly preserve the digitally encoded information on which we all depend, in particular Earth Science measurements which can never be repeated and yet on which a multitude of ecological, economic and political decisions must be based in the future. The generic services will allow all kinds of data to be usable by researchers from many different domains and will enable the cost for long-term usability across disciplines to be shared supporting the creation of strong business cases for the long term support of that data.','HUMAN','en',283401),(222,'Over the last ten years the European countries and the EC have made significant investments in e-Infrastructures for scientific computing, notably High Throughput Computing (HTC) and High Performance Computing (HPC) services. Their contribution in pushing the European research towards a leading position in addressing global challenges has been validated by a growing number of research initiatives, most notably the ESFRI projects. Sustainability of such services is crucial, as the research supported by them is more and more crucial for European competitiveness and sustainability can be planned better if the costs are known. The emerging commercial offerings (Cloud-based HTC and HPC solutions) pose additional challenges and opportunities for sustainability. They represent new ways of explicit monetisation of computing and open the way to new business models (e.g. service fees or of lease industrial resources). \nThe upcoming next framework programme and broader EU policies depend on more careful impact assessment, which requires accurate cost estimates. Similarly energy saving and green computing will be increasingly relevant, and project results will also allow estimating potential benefits in these areas. It is thus vital to understand the cost of the dedicated computing related e-Infrastructures, as expressed by EGI and PRACE initiatives. \nThe calculation of such costs is not trivial; keeping detailed accounting data for the evolving mix of capital (hardware) and operational (personnel, energy) expenditures is only one of the challenges. \nThe scope of the e-FISCAL proposal is to analyse such costs, facilitated by national entities (NGIs and HPC centres), compare them with equivalent commercial leased or on-demand offerings and provide an evaluation report. The execution of the survey builds on a small-scale survey conducted by the e-IRGSP2 project that proved the complexity of the issue and provided tacit knowledge valuable for the e-FISCAL project.','HUMAN','en',283449),(223,'Frontier environmental research increasingly depends on a wide range of data and advanced capabilities to process and analyse them. The ENVRI project, Common Operations of Environmental Research infrastructures is a collaboration in the ESFRI Environment Cluster, with support from ICT experts, to develop common e-science components and services for their facilities. The results will speed up the construction of these infrastructures and will allow scientists to use the data and software from each facility to enable multi-disciplinary science.\nThe target is on developing common capabilities including software and services of the environmental and e-infrastructure communities. While the ENVRI infrastructures are very diverse, they face common challenges including data capture from distributed sensors, metadata standardisation, management of high volume data, workflow execution and data visualisation. The common standards, deployable services and tools developed will be adopted by each infrastructure as it progresses through its construction phase.\nTwo use cases, led by the most mature infrastructures, will focus the development work on separate requirements and solutions for data pre-processing of primary data and post-processing toward publishing. The project will be based on a common reference model created by capturing the semantic resources of each ESFRI-ENV infrastructure. This model and the development driven by the testbed deployments result in ready-to-use systems which can be integrated into the environmental research infrastructures. \nThe project puts emphasis on synergy between advanced developments, not only among the infrastructure facilities, but also with ICT providers and related e-science initiatives. These links will facilitate system deployment and the training of future researchers, and ensure that the inter-disciplinary capabilities established here remain sustainable beyond the lifetime of the project.','HUMAN','en',283465),(224,'SCI-BUS will create a generic-purpose gateway technology as a toolset to provide seamless access to major computing, data and networking infrastructures and services in Europe including clusters, supercomputers, grids, desktop grids, academic and commercial clouds. SCI-BUS will elaborate an application-specific gateway building technology and customisation methodology based on which user communities can easily develop their own customised gateways. SCI-BUS will use the gateway technology and customization methodology to create 11 application-specific gateways customized for various types of user communities (represented in the project) and to provide gateway services for these communities including astrophysics, seismology, helio-physics, bio-science, computational chemistry, biomedical communities, PireGrid SMEs. community, Blender community, citizens. web-2 community, DCI application developer community, business process modeling community. SCI-BUS will establish production gateway services for the represented user communities and will attract further user communities by training and by other forms of disseminations activities. SCI-BUS will use the established production customized gateways as best-practice case studies based on which other communities can build their own customized gateway. SCI-BUS will provide gateway development, operation and maintenance support for the new communities to build and operate their own customized gateways. SCI-BUS will provide user support for application developers and end-users to develop and run new DCI applications based on the developed gateways. SCI-BUS will develop business models to enable the commercial exploitation of the developed technologies and to guarantee the sustainability of the gateway services developed in the project.','HUMAN','en',283481),(225,'The Discover the COSMOS coordination action aims to demonstrate innovative ways to involve teachers and students in eScience through the use of existing e-infrastructures in order to spark young people\'s interest in science and in following scientific careers. It aims to support policy development by a) demonstrating effective community building between researchers, teachers and students and empowering the latter to use, share and exploit the collective power of unique scientific resources (research facilities, scientific instruments, advanced ICT tools, simulation and visualisation applications and scientific databases) in meaningful educational activities, that promote inquiry-based learning and appreciation of how science works, b) demonstrating effective integration of science education with e-infrastructures through a monitored-for-impact use of eScience activities, which will provide feedback for the take-up of such interventions at large scale in Europe and c) documenting the whole process through the development of a roadmap that will include guidelines for the design and implementation of effective educational and outreach activities that could act as a reference to be adapted for stakeholders in both scientific research outreach and science education policy.','HUMAN','en',283487),(226,'PRACE-2IP supports the accelerated implementation of the pan-European HPC Research Infrastructure created in April 2010 as the result of the preparatory phase PRACE project. It complements and extends the work of the PRACE-1IP project that was started in July 2010.\nPRACE-2IP addresses the computational and simulation needs of European scientific communities to keep them at the forefront of discovery. Our vision is the formation of an integrated HPC ecosystem of facilities and services enabling researchers to realise the full potential of computational science within the supportive environment of the European Research Area.\nBuilding on the implementation work of the preceding PRACE and DEISA projects, PRACE-2IP will enable seamless access to HPC systems and services at the Tier-0 and Tier-1 level to users, regardless of their country of work. This provides the means and motivation to undertake ambitious, ground-breaking computational science. In particular, DEISA-like services will be integrated into the ecosystem.\nApplications enabling expertise will support researchers in code development, optimisation and peta-scaling to help them make effective use of the Tier-0 and Tier-1 systems. Training and dissemination activities will ensure that European scientists have the knowledge and the skills enabling them to take full advantage of the facilities on offer. Through collaboration with technology providers and vendors, novel architectures, systems and technologies will be evaluated to ensure that Europe remains at the forefront of HPC and that the future needs of the research community are understood and met. Targeted research activities will investigate possible solutions to challenges in programmability and scalability of future multi-petaflop systems.\nPRACE-2IP will considerably strengthen and deepen the co-operation between HPC centres, funding bodies and research communities in a mutually beneficial partnership to enhance European scientific competitiveness.','HUMAN','en',283493),(227,'Food and energy security are major challenges facing humanity in the coming decades. The falling costs of nucleotide sequencing are opening up significant opportunities for crop improvement through plant breeding and increased understanding of plant biology; in particular through interpreting the growing volume of plant genomics data in the context of phenotype. However, at present, there is no adequate infrastructure for plant genomic data. transPLANT will develop a new infrastructure for this data, leveraging the experience of medical informatics while addressing the particular challenges and opportunities of plant genomics.\n\nCompared with vertebrate genomes, plant genomes may be large and have complex evolutionary histories, which makes their analysis a hard problem (both in terms of theory, and in terms of the compute resources required for data storage and analysis). Issues include genome size, polyploidy, and the quantity, diversity and dispersed nature of data in need of integration.\n\nTo address these problems, transPLANT will develop distributed solutions, exploiting the expertise of the project partners in particular species and problems to provide a seamless set of computational and interactive services to the plant research community. These services will be developed on top of the outputs of RTD activities designed to build new repositories and develop new algorithms, and with the input from the plant science and other related communities garnered through extensive networking activities. A series of training workshops will educate the community in the use of transPLANT tools and data.\n\ntransPLANT will be built on standard technologies for data exchange and representation, service provision, virtual compute infrastructure, and interface development; where such standards are currently lacking (as in phenotype description), they will be developed in the context of the project.','HUMAN','en',283496),(228,'The earthquake and seismology research, an intrinsically Global undertaking, addresses both fundamental problems in understanding Earth\'s internal wave sources and structures, and augment applications to societal concerns about natural hazards, energy resources, environmental change, and national security. This community is central in the European Plate Observing System (EPOS), the ESFRI initiative in solid Earth Sciences..\n\nGlobal and regional seismology monitoring systems are continuously operated and transmitting a growing wealth of data from around the world. The multi-use nature of these data puts a great premium on open-access data infrastructures integrated globally. Most of the effort is in Europe, USA and Japan.\n\nThe European Integrated Data Archives infrastructure provides strong horizontal data services. Enabling advanced analysis of these data by utilising a data-aware distributed computing environment is instrumental to exploit fully the cornucopia of data, and to guarantee optimal operation and design of the high-cost monitoring facilities.\n\nThe strategy of VERCE, driven by the needs of data-intensive applications in data mining and modelling, aims to provide a comprehensive architecture and framework adapted to the scale and the diversity of these applications, and integrating the community Data infrastructure with Grid and HPC infrastructures.\n\nA first novel aspect of VERCE consists of integrating a service-oriented architecture with an efficient communication layer between the Data and the Grid infrastructures, and HPC. A second novel aspect is the coupling between HTC data analysis and HPC data modelling applications through workflow and data sharing mechanisms.\n\nVERCE will strengthen the European earthquake and seismology research competitiveness, and enhance the data exploitation and the modelling capabilities of this community. In turn, it will contribute to the European and National e-infrastructures.','HUMAN','en',283543),(229,'The PaN-data collaboration brings together eleven large multidisciplinary Research Infrastructures which operates hundreds of instruments used by over 30,000 scientists each year. They support fields as varied as physics, chemistry, biology, material sciences, energy technology, environmental science, medical technology and cultural heritage. Applications are numerous, for example, crystallography can reveal the structures of viruses and proteins important for the development of new drugs; neutron scattering can identify stresses within engineering components such as turbine blades, and tomography can image microscopic details of the 3D-structure of the brain. Industrial users include the pharmaceutical, petrochemical and microelectronic industries.\n\nPaNdata-ODI will develop, deploy and operate an Open Data Infrastructure across the participating facilities with user and data services which support the tracing of provenance of data, preservation, and scalability through parallel access. It will be instantiated through three virtual laboratories supporting powder diffraction, small angle scattering and tomography.','HUMAN','en',283556),(230,'Unprecedented growth in the accessibility of imaging data of persons with brain diseases has led to the development of computational infrastructures offering scientists access to image databases and e-Science services. FP7 neuGRID is the leading e-Infrastructure where neuroscientists can find core services and resources for brain image analysis. neuGRID for Users (N4U) will provide an e-Science environment by further developing and deploying the neuGRID infrastructure to deliver a Virtual Laboratory offering neuroscientists access to a wide range of datasets and algorithm pipelines, access to computational resources, services, and support. The laboratory will be developed for imaging neuroscientists but designed to be adaptable to other user communities. While neuGRID has mainly developed the lower layers of the infrastructure, N4U will concentrate on the upper user-facing levels. N4U will (i) integrate and augment the neuGRID service provision with intuitive and customizable image analysis services and more robust computational resources making use of Grid, Cloud and HPC; (ii) expand the scientific coverage of neuGRID to meet the requirements of new research communities; (iii) design, develop, and deploy user-centred, friendly, and customizable interfaces for the daily use of N4U by end-users (Science Gateway and portal); and (iv) develop a Specific Support Center including active learning, training, support, and education. Captivating applications and dissemination tools to attract students and lay persons will be developed making use of augmented reality technology; syntactic and semantic interoperability with the major related international initiatives will build on Internet2, CAnet and GEANT connectivity; open standard technology will include an API to access Open Cloud Computing Interface; licensing schemes for the future sustainability of N4U will leverage on Open Source Software.','HUMAN','en',283562),(231,'Predicting weather and climate and its impacts on the environment, including hazards such as floods and landslides, is still one of the main challenges of the 21st century, with significant societal and economic implications. At the heart of this challenge, as also suggested by the DRIHMS (Distributed Research Infrastructure for Hydro-Meteorology Study) project, lies the ability to have easy access to hydro-meteorological data and modells, and to facilitate the collaboration between meteorologists, hydrologists, and Earth science experts for accelerated scientific advances in hydrometeorological research (HMR).\nThe proposed DRIHM (Distributed Research Infrastructure for Hydro-Meteorology) project intends to develop a prototype e-Science environment to facilitate this collaboration, and provide end-to-end HMR services (modells, datasets and post-processing tools) at the European level, with the ability to expand to the global scale. The objectives of DRIHM are to lead the definition of a common long-term strategy, to foster the development of new HMR modells and observational archives for the study of severe hydrometeorological events, to promote the execution and analysis of high-end simulations, and to support the dissemination of predictive modells as decision analysis tools.\nDRIHM combines the European expertise in HMR, and in Grid and High Performance Computing (HPC). Joint research activities will improve the efficient use of European e-Infrastructures, notably Grid and HPC, for HMR modelling and observational databases, model evaluation tool sets and access to HMR model results. Networking activities will disseminate DRIHM results at the European and global levels in order to increase the cohesion of European and possibly worldwide HMR communities, and to increase the awareness of the potential of ICT for HMR. Service activities will deploy the end-to-end DRIHM services and tools in support of HMR networks and virtual organizations on top of the existing European e-Infrastructures.','HUMAN','en',283568),(232,'The BioStruct-X consortium has 19 partners from 11 EU member and associated states, who lead in facility provision and research in structural biology using high brilliance X-rays, provided by state-of-the art synchrotrons and a free electron laser. BioStruct-X will provide integrated transnational access via 43 installations in four key areas: macromolecular X-ray crystallography, small angle X-ray scattering, X-ray imaging, protein production and high-throughput crystallisation. All installations provide on-line data analysis tools and remote experiment control. \n\nTransnational access will be critically enhanced by four targeted joint research activities: \na) new data processing tools, to the benefit of access to applications in macromolecular X-ray crystallography; \nb) an integrated on-line sample characterisation system, to the benefit of the access to small angle X-ray scattering, \nc) correlated fluorescence light microscopy components that will enhance X-ray imaging applications offered for access; \nd) a toolbox for mammalian cell line expression, to the direct benefit of the access to protein production facilities. \n\nThe BioStruct-X project will offer a central Batch Allocation Group proposal mechanism to promote project excellence by combining different methods and encouraging multi-site applications. The networking activity integrates all activities and combines them with those of other I3 actions under the ESFRI project INSTRUCT for future coordinated infrastructure activities in structural biology. The efficient management structure has four transparent layers: the coordinator, a six-member executive board, three work package coordinators and the general assembly comprising three user representatives and all partners. Thus, BioStruct-X will establish a state-of-the-art coordinated and multi-site infrastructure for current and emerging key methods in 21st century structural biology, thus advancing the European Research Area in biomedical sciences.','HUMAN','en',283570),(233,'OpenAIREplus will build a 2nd-Generation Open Access Infrastructure by significantly expanding in several directions the outcomes of the OpenAIRE project, which implements the EC Open Access (OA) pilot. Capitalizing on the OpenAIRE infrastructure, built for managing FP7 and ERC funded articles, and the associated supporting mechanism of the European Helpdesk System, OpenAIREplus will develop an open access, participatory infrastructure for scientific information. It will significantly expand its base of harvested publications to also include all OA publications indexed by the DRIVER infrastructure (more than 270 validated institutional repositories) and any other repository containing peer-reviewed literature that complies with certain standards. \nIt will also generically harvest and index the metadata of scientific datasets in selected diverse OA thematic data repositories. It will support the concept of linked publications by deploying novel services for linking peer-reviewed literature and associated data sets and collections, from link discovery based on diverse forms of mining (textual, usage, etc.), to storage, visual representation, and on-line exploration. It will offer both user-level services to experts and non-scientists alike as well as programming interfaces for providers of value-added services to build applications on its content. Deposited articles and data will be openly accessible through an enhanced version of the OpenAIRE portal, together with any available relevant information on associated project funding and usage statistics. \nOpenAIREplus will retain its European footprint, engaging people and scientific repositories in almost all 27 EU member states and beyond. The technical work will be complemented by a suite of studies and associated research efforts that will partly proceed in collaboration with different European initiatives and investigate issues of intellectual property rights, efficient financing models, and standards.','HUMAN','en',283595),(234,'The overall objective of the SeaDataNet II project is to upgrade the present SeaDataNet infrastructure into an operationally robust and state-of-the-art Pan-European infrastructure for providing up-to-date and high quality access to ocean and marine metadata, data and data products originating from data acquisition activities by all engaged coastal states, by setting, adopting and promoting common data management standards and by realising technical and semantic interoperability with other relevant data management systems and initiatives on behalf of science, environmental management, policy making, and economy. SeaDataNet is undertaken by the National Oceanographic Data Centres (NODCs), and marine information services of major research institutes, from 31 coastal states bordering the European seas, and also includes Satellite Data Centres, expert modelling centres and the international organisations IOC, ICES and EU-JRC in its network. Its 40 data centres are highly skilled and have been actively engaged in data management for many years and have the essential capabilities and facilities for data quality control, long term stewardship, retrieval and distribution. \n\nSeaDataNet II will undertake activities to achieve data access and data products services that meet requirements of end-users and intermediate user communities, such as GMES Marine Core Services (e.g. MyOcean), establishing SeaDataNet as the core data management component of the EMODNet infrastructure and contributing on behalf of Europe to global portal initiatives, such as the IOC/IODE Ocean Data Portal (ODP), and GEOSS. Moreover it aims to achieve INSPIRE compliance and to contribute to the INSPIRE process for developing implementing rules for oceanography.','HUMAN','en',283607),(235,'EarthServer aims at open access and ad-hoc analytics on Earth Science (ES) data, based on the OGC geo service standards Web Coverage Service (WCS) and Web Coverage Processing Service (WCPS). The WCS model defines \"coverage\" as unifying paradigm for multi-dimensional raster data, point clouds, meshes, etc., thereby addressing most of Earth Science data. WCPS as aka \"XQuery for raster data\" allows declarative, SQL-style queries on coverage.\n\nThe project will develop a pilot implementing these standards, integrated with NetCDF and GeoSciML, two core formats used in the ESs, and open-source GIS tools. Integration of WCPS with XQuery will allow mixed data/metadata queries. The unified service will support navigation, extraction, aggregation, and ad-hoc analysis on massive n-D ES data through queries of open-ended complexity, achieving a flexibility on coverage data as it is known from SQL. Clients will range from mobile devices over Web tools to high-end immersive virtual reality.\n\n- In the RTD part, EarthServer will establish open-source client and server technology which is scalable to Petabyte/Exabyte volumes, based on distributed processing, supercomputing, and cloud virtualization. Implementation will be based on the existing rasdaman server technology developed by one partner, an operational system similar to SciDB.\n- In the Service part, this new service will be installed on super-scale archives of data centres serving atmospheric, oceanography, geology, and general earth observation communities. Queries can span archive sites and cross-domain data sets. Volumes of 20+ TB will be demonstrated.\n- In the Networking part, user training, community involvement and outreach, education of society (students, pupils, etc.) and public authorities, and standardization will be performed (e.g., OGC and INSPIRE).\n\nThis novel quality of service, with its unified overarching retrieval, will enable new discoveries and enhanced collaboration, both ad-hoc and in \"long tail science\".','HUMAN','en',283610),(236,'Marine life plays a vital role in the Earths ecosystem. Wise and judicious management of all relevant resources is of paramount importance to ensure that all forms of marine life remain sustainable. However, efforts in this direction are severely hindered by extreme compartmentalization and heterogeneity at all levels and sectors: the global, national, and local organizations active in the field; the different scientific disciplines involved; the methodologies used to acquire, format and present data; the procedures used to analyze the data; and several others. The main goal of the iMarine project is, thus, to launch an initiative aimed at establishing and operating an e-infrastructure supporting the principles of the Ecosystem Approach to fisheries management and conservation of marine living resources. iMarine has three main objectives: (i) the establishment of an iMarine Board, formed by representatives of international organisations involved in this domain, which will define a sustainability-driven data-centric e-infrastructure governance model and organizational and technological policy recommendations; (ii) the management and operation of this e-Infrastructure offering user-level and application-level services that support the recommended policies and provide relevant functionality to the stakeholders; (iii) the extension, adaptation and deployment of a rich set of software components that implement these services. Instrumental in the activities of iMarine will be the establishment of an active set of collaborations with other international initiatives. The aim will be to reuse and render interoperable existing policies, technologies, and e-infrastructures. By leveraging on these collaborations and by taking advantage of additional funding that these organizations invest in the project, the number of available resources brought into play will be maximized.','HUMAN','en',283644),(237,'DASISH provides solutions to a number of common issues relevant for the five ESFRI projects in social science and humanities, being CESSDA, CLARIN, DARIAH, ESS and SHARE and therefore is supporting infrastructure construction. These five infrastructures are presently at different stages in the process of establishing ERICs. DASISH has identified four major areas namely data quality, data archiving, data access and legal and ethics. The activities in these four major areas are based on a thorough analysis of the underlying architectures. The outcome forms the basis for educational activities and for outreach to the communities that are to benefit from the work.\r\nThrough DASISH the participating infrastructures will not only obtain new solutions for specific problems and a consolidation of their infrastructure building, but will work out solutions facilitating interdisciplinary cross-walks of their researchers. This will be of mutual benefit for the five infrastructures and the communities they serve.','HUMAN','en',283646),(239,'The ESPAS project will provide the e-Infrastructure necessary to support the access to observations, the modelling and prediction of the Near-Earth Space environment. This includes the plasma and energetic particle environments that surround our planet as well as the neutral atmosphere at altitudes above 60 km. These environments are an important target for future research in areas such as space weather and Sun-climate studies. The ESPAS interface will provide access to a diverse set of databases that have been developed for the needs of different users. Thus a primary goal is to facilitate user access to heterogeneous data from multiple providers, ranging from ground-based observations acquired with multiple instruments and techniques, to data from satellite experiments, using a mixture of in-situ and remotely sensed techniques. The results of searches will be delivered in a scientist-friendly manner based on existing standards and protocols. The infrastructure will also be used as a test-bed for development of methodologies and standards for validation of models of the near-Earth environment. This will lead to validated predictions of conditions in that environment, and thus promote the transfer of space environment science products into commercial and operational applications.','HUMAN','en',283676),(240,'GLOBAL excursion will introduce e infrastructures to educators and pupils. It provides scientists, policy makers, pupils and their teachers a package of activities, materials and tools for enabling the integration of e infrastructures into school curricula. Main access point is the GLOBAL Virtual Science Hub ViSH. It contains a selection of e Infrastructures, and a social network where scientists, teachers and pupils will be able to exchange and establish collaborations, and a virtual excursion room, where pupils will be able to experience real e-science applications in areas of high relevance for the future, such as nano- and biotechnologies.\nThe technological basis of the Virtual Science Hub is the VCC, a communication platform developed in the GLOBAL project, which has already proven to successfully link distant researchers and to integrate remote regions.\nTo allow for closer links between stakeholder communities, the hub will include a pedagogical framework that tailors science content to the needs of schools preconditions. With this aim, teachers and scientists will be involved in a user-centred design process and collaboratively elaborate generic tools and methods, offering joyful formats attractive to young people. With the ViSH portal as a hub, virtual excursions are possible through existing e-infrastructures and together with pedagogical concepts, a more efficient use of e infrastructures will be ensured. Teachers will have access to guided and compact materials, easy to implement and adapt in their teaching activities.\n\nTogether with end-users, GLOBAL excursion will develop a common understanding, teaching use cases, as well as pedagogical and technical artefacts. The aim of this project proposal is to provide young citizens and their educators (teachers, parents, etc.) across Europe with a range of e-Infrastructures and access to expert knowledge on its usage for a joyful exploration of e-Science through e-Infrastructure. Based on the experience from previous projects, we intend to target pupils between 14-18 years of age (upper stage school). Participating schools and science communicators will elaborate communication and teaching activities. The driving themes will be nano- and biotechnologies, as well as volunteer computing and life sciences with an interdisciplinary focus especially including ethical, legal and social aspects (ELSA).\n\nThe main purpose of the GLOBAL excursion project is to enable students and teachers access to the experimental laboratories and resources of selected e-Infrastructures in order to improve science curricula by enriching schools existing teaching and learning materials. By connecting e Infrastructures, resources and tools with schools, pupils can experience challenging and authentic learning scenarios. Thus, students gain insights in scientific real work and relive interest in natural science education.','HUMAN','en',283686),(241,'Information and Communication Technologies have an unprecedented potential to improve the responsiveness of governments to the needs of citizens and have long been recognized as a key strategic tool to enable reforms in the public sector. During the last years, this potential of ICT has started to be dealt with in a multi-disciplinary way, giving birth to new research communities dealing with governance and policy modelling, modelling and simulation of complex systems, public administration information systems, open governance and social media. However, this potential is to this day non-systematically exploited, as there are significant barriers that hinder the effective exploration, management and distribution of the vast amounts of available public sector data towards the research communities.\n\nThe main goal of ENGAGE project is the deployment and use of an advanced service infrastructure, incorporating distributed and diverse public sector information resources as well as data curation, semantic annotation and visualisation tools, capable of supporting scientific collaboration and governance-related research from multi-disciplinary scientific communities, while also empowering the deployment of open governmental data towards citizens. The ENGAGE consortium comprises of 9 partners from Belgium, Germany, Greece, Israel, the Netherlands and the United Kingdom, with an excellent track record both in the e-Infrastructures and the Governance domain (NTUA, FOKUS, STFC, Uni. Aegean, TU DELFT) including world-leaders in cloud infrastructures (IBM, Microsoft and INTRASOFT International) and a large network of scientific data diffusion (EUROCris).Following on Open Data initiatives throughout Europe, ENGAGE has established links with numerous National and International public sector organisations, research communities, open data experts and standardisation fora. \n\nThe proposal is supported by the Greek NREN and NGI node GRNET, providing the infrastructure for service provision.','HUMAN','en',283700),(242,'The objective of the eleven participating Research Infrastructures (RIs) is to build up collaborations and to create long-term synergies to facilitate their implementation and enhance their efficiency and attractiveness. \r\n\r\nThe CRISP proposal focuses on four R&D tasks that are of utmost importance for these RIs: \r\n(i) Accelerators, \r\n(ii) Instruments & Experiments, \r\n(iii) Detectors & Data Acquisition, and \r\n(iv) Information Technology (IT) & Data Management. \r\n\r\nProgress in accelerator technology is essential to provide the RIs with the best possible sources of X-rays, ions and neutrons and to tackle the next challenges in nuclear and high-energy physics. Joint developments for novel experimental schemes and their related instrumentation will create new scientific opportunities at the RIs and offer tremendous potential across all fields of natural sciences. \r\nNew initiatives and approaches are required to cope with the ever-increasing flow of scientific data, and a joint effort to establish the base elements of adequate platforms for the processing, storage and access to data shall be undertaken. The RIs will exchange know-how and combine complementary expertise, ensuring cost-efficient and coherent development plans. \r\n\r\nThe generated synergies will be crucial to respond to the rapidly evolving and mobile scientific user community. It will allow the RIs to strengthen their role in the advancement of knowledge and to stimulate scientific and technological progress, indispensable to address the grand challenges of our society in health, environment, sustainable energy, transport and communication. The proposed activities will be of enormous benefit as well to other large scale facilities in the European Research Area, such as regional or national light and x-ray sources, high-energy and nuclear facilities.','HUMAN','en',283745),(243,'The Virtual Campus Hub network will use the European e-Infrastructure network including GEANT as the communication backbone. The project will formulate end-user demands for high-quality services in support of a global virtual campus network based on a Virtual Campus Hub concept.\n\nThe Virtual Campus Hub will be developed through pilot use of the hub elements, with special emphasis on the integration of research, innovation and education in sustainable energy. The Virtual Campus Hub will consist of the following components:\n1) A technical platform which can deliver virtual meeting spaces for lectures, conferences, laboratory and numerical exercises, as well as innovation tools, executive learning modules, self-study, etc.\n2) A set of documented best practices for the use of the platform for courses, teaching & learning methods, innovation processes, networking and joint programs, developed through continued complementary on-site activities.\n3) A growing inventory of staff competence and experience gained from using the Virtual Campus Hub for enhancing quality and scaling-up innovation, education, and training activities primarily related to sustainable energy, combined with dissemination and communication of the resulting best practices.','HUMAN','en',283746),(244,'agINFRA is an Integrated Infrastructure Initiative (I3) project that will try to introduce the agricultural scientific communities into the vision of open and participatory data-intensive science. In particular, agINFRA aims to design and develop a scientific data infrastructure for agricultural sciences that will facilitate the development of policies and the deployment of services that will promote sharing of data among agricultural scientists and develop trust within and among their communities. agINFRA will try to remove existing obstacles concerning the open access to scientific information and data in agriculture, as well as improve the preparedness of agricultural scientific communities to face, manage and exploit the abundance of relevant data that is (or will be) available and can support agricultural research. \n\nUltimately, agINFRA will demonstrate how a data infrastructure for agricultural scientific communities can be set up to facilitate data generation, provenance, quality assessment, certification, curation, annotation, navigation and management.','HUMAN','en',283770),(245,'The EU nowadays witnesses increasing demands with regard to chemical safety. In particular, animal-based test models need to be replaced preferably by robust, non-animal assays in vitro/in silico which better predict human toxicity in vivo, are less costly, and are socially better acceptable. Consumers\' and patients\' health will benefit and competitiveness of EUs chemical manufacturing industry will be increased. For developing such assays, FP6/FP7 Research Programmes are exploiting the revenues of data-dense genomics technologies. However, till date, there is no infrastructure foreseen which aims at capturing all data produced by toxico-genomics (TGX) projects, in a standardized, harmonized and sustainable manner. Data may thus evaporate. The lack of such an infrastructure also prevents innovative breakthroughs from meta-analyses of joint databases and systems modelling. \n\nDriven by these needs of the TGX research community, diXa will focus on networking activities, for building a web-based, openly accessible and sustainable e-infrastructure for capturing TGX data, and for linking this to available data bases holding chemico/physico/toxicological information, and to data bases on molecular medicine, thus crossing traditional borders between scientific disciplines and reaching out to other research communities. To advance data sharing, diXa will ensure clear communication channels with and deliver commonly agreed core service support to the TGX research community, by providing SOPs for seamless data sharing, and by offering quality assessments and newly developed tools and techniques for data management, all supported by hands-on training. Through its joint research initiative, by using data available from its data infrastructure, diXa will demonstrate the feasibility of its approach by performing cross-platform integrative statistical analyses, and cross-study meta-analyses, to create a systems model for predicting chemical-induced liver injury.','HUMAN','en',283775),(246,'GLORIA is an innovative citizen-science network of robotic telescopes, which will give free access and research to a virtual community via the Internet. The GLORIA partners will offer access to a growing collection of robotic telescopes via a Web 2.0 environment - 17 telescopes on 4 continents by the project s end.\nThe GLORIA partners can do this because most of the telescopes are already robotized using the same free/open-source RTS2 software (maintained by GLORIA members), and the web access will be based on Ciclope Astro (also by a GLORIA member), which currently provides the world s first free-access robotic telescope at Montegancedo Observatory (http://om.fi.upm.es). The Internet experiments will be coordinated by Galaxy Zoo (http://galaxyzoo.org).\nThe challenge will be to involve people from around the world, to maximise their collective intelligence, and to foster their participation in astronomy research both in data analysis and actual observations. The e-Infrastructure will be managed using the method of karma , proven in most successful web 2.0 sites, whereby those users who participate the most are awarded corresponding observing time.\nGLORIA will be an e-Science network for the virtual community, demonstrating how networking and open e-Infrastructures can increase the quality of research.\nDuring the project, 17 telescopes and 2 experiments will be deployed for these citizen scientists, and a foundation will be built up of documentation, free software, and a community of people will have grown, to maintain and grow GLORIA into the future. Significant dissemination efforts will be made to draw in ordinary people, as well as scholars, to use the network, to learn about astronomy, and to do real science.\nCurrently, GLORIA s telescopes are individually supported from national funds and as this should continue, the network will not bear the cost of their maintenance. GLORIA can easily survive in the future with minimal national funding or even donations.','HUMAN','en',283783),(247,'Advanced solutions to the challenges that confront our technology-based society from energy and environment to health are crucially dependent on advanced knowledge of material properties down to the atomic scale. Neutron and Muon spectroscopy offer unique analytical tools for material investigation. They are thus an indispensible building block of the European Research Area and directly address the objectives of the Innovation Union Flagship Initiative. The knowledge creation via Neutron and Muon spectroscopy relies on the performance of a closely interdependent eco-system comprising large-scale facilities and academic and industrial users.\r\n\r\nThe Integrated Infrastructure Initiative for Neutron and Muon Spectroscopy (NMI3) aims at a pan-European integration of the main actors within this eco-system. The NMI3 coordination effort will render public investment more efficient by harmonizing and reinforcing the services provided to the user community. It will thus directly contribute to maintaining Europe\'s world-leading position.\r\n\r\nNMI3 is a comprehensive consortium of 18 partners from 11 different countries that includes all major providers of neutrons and muons in Europe. NMI3 exploits all tools available within I3s to realize its objectives.\r\n\r\n- Transnational Open Access will build further capacity for European users. It will foster mobility and improve the overall creation of scientific knowledge by providing the best researchers with the opportunity to use the most adapted infrastructures.\r\n\r\n- Joint Research activities will create synergies in innovative instrument development that will feed directly into improved and more efficient provision of services to the users.\r\n\r\n- Networking activities will reinforce integration by harmonizing procedures, setting standards and disseminating knowledge. Particular attention is given to train young people via the European Neutron and Muon School as well as through an e-learning platform.','HUMAN','en',283883),(248,'TREES4FUTURE will make a significant contribution to helping the European forestry sector respond, in a sustainable manner, to increasing demands for wood products and services (among which preservation of forest biodiversity) in a context of changing climatic conditions. To do so TREES4FUTURE will integrate for the first time major, yet rarely interacting forestry communities (and their resources) from geneticists to environmentalists and from communities working at the tree/population scale to those working at forestry landscape/wood basin levels as well as industry concerns.\nThese scientific communities will combine their complementary infrastructures, tools and knowledge and thus fill in the current gaps 1) physical environment vs genetics, 2) basic wood properties vs end-products quality and 3) individuals to forests scales of study. This collaboration will result in a holistic approach integrating abiotic and biotic environmental aspects through biological responses (eco-physiological and pest/disease risk studies), biomass production (breeding and silviculture) and industrial technology (wood quality and technology).\nThe long-term objective of TREES4FUTURE is to provide not only the partners but the whole European forestry community, with an easy and comprehensive access to complementary but currently scattered sources of information and expertise to optimise the short and long-term exploitation of the forest resources by both the research community and the socio-economic players.\nProviding access to the wider research community to a wide variety of forestry research infrastructures (from state-of-the-art analytical tools to predictive models) via the project will enable TREES4FUTURE to improve, coordinate and validate its offer to the European and International researchers from both public and private sectors and thus ensure the future sustainability of the consortium as well as that of the wider European Forestry community at large.','HUMAN','en',284181),(249,'The ESFRI infrastructures in Biological and BioMedical Sciences face substantial challenges in accessing and sharing data and resources. The BioMedBridges consortium brings together the six established ESFRI infrastructures with common goals to define, implement and deliver data interoperability across the biological and biomedical domains.\nThe first objective is to ensure that interoperable standards are available across all data resources and services shared by two of more ESFRI infrastructure. The identified standards will be implemented to enable data interoperation between ESFRI projects in biomedical sciences.\nPublic data in life sciences will be freely accessible through these standard interoperable services. Private data, however, is a major concern in this domain, for medical information or for data with intellectual property issues. Where projects need to share sensitive data, standards for secure and restricted access will be identified and implemented.\nBioMedBridges is a practical solution to the data interoperability requirements of infrastructures in the biological and biomedical domains. A suite of use cases will guide the development and deployment of standards and services with emphasis on the issues arising between specific projects. These may cover the exchange of biomedical and genetic data, linking mouse model organism data with human clinical information, and the deposition of large volumes of data from one project to another.\nBioMedBridges is inclusive of emerging infrastructures which can contribute additional data classes and challenges such as bioimaging, ecosystems, small molecules and infectious diseases.\nThe ESFRI infrastructures leading BioMedBridges are ELIXIR, BBMRI, EATRIS, ECRIN, InfraFrontier and INSTRUCT.','HUMAN','en',284209),(250,'InGOS will support and integrate the observing capacity of Europe for non-CO2 greenhouse gases (NCGHG: CH4, N2O, SF6, H2 and halocarbons). The emissions of these gases are very uncertain and it is unknown how future climate change will feedback into the land use coupled emissions of CH4 and N2O. The NCGHG atmospheric abundances will increase further in the future and the emissions of these gases are an attractive target for climate change mitigation policies.\r\nInGOS aims to improve the existing European observation system so that this will provide us insight into the concentration levels and European and extra-European emissions of the NCGHGs. The data from the network will enable to better constrain the emissions of NCGHGs within the EU and show whether emission reduction policies are effective.\r\nThe data from the network is designed to allow to detect the spatial and temporal distribution (hotspots) of the sources and to detect changes in emissions due to mitigation and feedbacks with climate change.\r\n\r\nTo strengthen the European observation system, the project has several objectives:\r\n- Harmonize and standardize the measurements.\r\n- Provide capacity building in new member states and countries with inadequate existing infrastructure.\r\n- Support existing observation sites and transfer of selected sites into supersites.\r\n- Integrate and further integrate marine observations of the NCGHGs with land-based observations\r\n- Improve measurement methods by testing new innovative techniques and strategies.\r\n- Test advanced isotope techniques for application in the network to enable attribution of the atmospheric fractions to source categories\r\n- Integrate data for network evaluation by using inverse modeling and data-assimilation methods and developments in bottom up inventories\r\n- Link the network to remote sensing data of column abundances from in-situ and satellite observations\r\n- Prepare for the integration of the NCGHG network with the Integrated Carbon Observation System','HUMAN','en',284274),(251,'Research infrastructures (RIs) are a pillar of the European Research Area (ERA). The construction and operation of these are funded by the member states and the return on investment will be seen through advances in scientific knowledge and personnel training, but also must be met through an increase in benefit realised from EU industrial engagement in the development of RI facilities.\nPrior to action being taken, a policy study is needed to determine the scale of support appropriate and the type of support most needed. In this study we intend to quantify the current size and potential for growth of the instrumentation market. We also intend to identify the current bottlenecks in the industrial implementation process and to determine the activities in the process of RI instrumentation development and subsequent industrial exploitation that would benefit most from an EU supported activity. The view from industry of the perceived risks and benefits associated with industrial engagement with the RIs will be recorded so that it can also be taken into account in programme development planning. This study will look into the current means of assessing RI requirements, networking between RIs and industry, access for industry to RIs at the early planning stage, interaction with industry at preliminary stages of technology development, involvement of industry in the R&D phase of instrumentation development and the industrialization of instrumentation supply. We will also assess the suitability of the financial tools available to support European industrial capacity for instrumentation. The evidence for the need and the recommendations on the financial, technological and geographical scope for EU support will be presented to support the development of a new community action.','HUMAN','en',284294),(252,'CoPoRI, Communication and Policy development for Research Infrastructures in Europe, is a service tool for the European Strategy Forum for Research Infrastructures (ESFRI) to enhance communication and policy development for Research Infrastructures in Europe. It aims to support ESFRI in labor intensive activities e.g. enhancing ESFRIs communication skills, the organization of European workshops to analyse the socio-economic aspects of RIs and the setting up of \"regional partner facilities\". Beyond this CoPoRI will encourage and facilitate discussions and share best practices among ESFRI projects on issues of common interest. It will maximize the scientific return and optimize the use of resources and facilities by sharing relevant developments and results, whenever feasible. CoPoRI will support the outreach activities of the ESFRI projects.','HUMAN','en',284306),(253,'Underwater gliders are intelligent and affordable platforms, useful for long-term, multi parameter marine observations. Because of their remotely controlled navigational capabilities and the high spatial and temporal resolution of their measurements in real-time, gliders have been identified to fill gaps existing in the existing ocean observing systems. Along with there rapidly growing importance in purely science driven applications, the implementation of gliders into the Global Ocean Observing System has been recognized as a key point to improve the observational capabilities of the observing systems.\r\n\r\nThe objective of the GROOM proposal is the design of a new European research infrastructure to use underwater gliders for the benefit of European citizens, researcher, and industry. GROOM will define the scientific, technological and organizational/legal levels, of a European glider capacity for research and sustained observations of the oceans, in line with the other European and international initiatives for marine in-situ observations. The proposal for this new infrastructure strongly relies on EuroARGO and JERICO infrastructures which are emerging and also considers the relevant international coordinating bodies such as GOOS. The proposed technological infrastructures will be based on several dedicated \'gliderports\' to maintain and operate a European fleet of gliders in coordination with US, Canadian, Australian and other similar infrastructures. This new infrastructure would be beneficial for both academic oceanographic research and operational oceanography systems on which a large number of marine activities and societal applications now rely.','HUMAN','en',284321),(254,'ARISE proposes to design a new infrastructure that integrates different station networks in order to provide a new 3D image of the atmosphere from the ground to the mesosphere with unprecedented spatio-temporal resolution. Three existing networks are involved: 1) the International infrasound network developed for the verification of the Comprehensive nuclear Test Ban Treaty (CTBT), 2) the Network for the Detection of Atmospheric Composition Changes (NDACC) which uses Lidar to measure stratospheric dynamics and 3) the Network for the Detection of Mesopause Changes (NDMC), dedicated to airglow layer measurements in the mesosphere. In addition the network will incorporate complementary infrasound station and satellite data.\r\nThe infrastructure extends across Europe and outlying regions, including polar and equatorial regions. The network will play a particularly important role in improving atmospheric measurement in the stratosphere. A great deal of recent work has shown that stratospheric variability, primarily caused by large, planetary-scale waves, is important for prediction of tropospheric weather and climate. Additionally, the network will provide important new measurements of atmospheric gravity waves. Parameterization of gravity waves is needed for accurate simulation of mean climate and variability, but parameters are uncertain due to lack of long-term high-resolution observations.\r\nThe expected benefits of ARISE are two-fold. First, the measurements will allow a better description of the atmosphere state, leading to an improved accuracy in short and medium range weather forecasts. Second, the measurements will be used to improve the simulation of middle atmosphere climate and its tropospheric impact. In the long term, data will be used for monitoring changes in the occurrence of extreme events and trends in the middle atmosphere climate. The benefits also include civil applications related to monitoring of natural hazards as volcanoes.','HUMAN','en',284387),(255,'The objective of this project is to strengthen the links and integration of the Euro-Argo European research infrastructure into the Argo International strategy of global ocean observations, and to seek participation by, and to develop cooperation with, potential participants in the European neighbouring areas which have a maritime interest. \n\nThe following activities are planned: \n- Work on the evolution of the Argo core mission together with international partners (O2, bio-geochemical sensors, deep floats, extension to polar and marginal seas), \n- Work on the evolution of the Argo data centers (Delayed Mode Quality Control of the North Atlantic ARC and Southern Ocean Argo Regional Center) and role of the European components, \n- Refine the float deployment strategy in Europe and international seas and links with international partners, \n- making the interfaces with JCOMMOPS and Argo information center (AIC), \n- working on legal aspects and policy issues (law of the sea), \n- Organize scientific and thematic (regional) workshops open to international partners.\n\nThis project will be carried by the Euro-Argo preparatory phase project partners that will form the future partners of the Euro-Argo ERIC.','HUMAN','en',284391),(256,'ECRIN is a distributed ESFRI-roadmap pan-European infrastructure designed to support multinational clinical research, making Europe a single area for clinical studies, taking advantage of its population size to access patients. Servicing multinational trials started during its preparatory phase, and it now applies for an ERIC status by 2011. The ERIC budget will be restricted to core activities required to enable provision of services, and the ECRIN-IA project is designed to expand ECRIN partnerships and impact beyond this core activity. Networking activities will promote pan-European expansion, capacity building, and partnership with other world regions, and address the funding issue (WP2). ECRIN-IA will develop e-services, education material to train professionals and patients associations, and communication with users, patients, citizens and policymakers (WP3). It will support the structuring and connection to ECRIN of disease-, technology-, or product-oriented investigation networks and hubs focusing on specific areas: rare diseases (WP4), medical device (WP5), nutrition (WP6). Transnational access activities will support the cost of multinational extension of clinical trials on rare diseases, medical device and nutrition selected by the ECRIN scientific board (WP7). Joint research activities are designed to improve the efficiency of ECRIN services, through the development of tools for risk-adapted monitoring (WP8), and the upgrade of the VISTA data management tool (WP9). This project will build a consistent organisation for clinical research in Europe, with ECRIN developing generic tools and providing generic services to multinational studies, and supporting the construction of pan-European disease-oriented networks, that will in turn act as ECRIN users and provide the scientific content. Such organisation will improve Europe’s attractiveness for industry trials, boost its scientific competitiveness, and result in better healthcare for European citizens.','HUMAN','en',284395),(257,'The Large Hadron Collider (LHC) is the largest scientific instrument ever built. It has been exploring the new energy frontier since 2009, gathering a global user community of 7,000 scientists. It will remain the most powerful accelerator in the world for at least two decades, and its full exploitation is the highest priority in the European Strategy for Particle Physics, adopted by the CERN Council and integrated into the ESFRI Roadmap. To extend its discovery potential, the LHC will need a major upgrade around 2020 to increase its luminosity (rate of collisions) by a factor of 10 beyond its design value. As a highly complex and optimized machine, such an upgrade of the LHC must be carefully studied and requires about 10 years to implement. The novel machine configuration, called High Luminosity LHC (HL-LHC), will rely on a number of key innovative technologies, representing exceptional technological challenges, such as cutting-edge 13 tesla superconducting magnets, very compact and ultra-precise superconducting cavities for beam rotation, and 300-metre-long high-power superconducting links with zero energy dissipation.\r\n\r\nThis FP7 Design Study proposal (HiLumi LHC) is part of an overall project that will federate efforts and R&D of a large community towards the ambitious HL-LHC objectives. HiLumi LHC involves participants from outside the European Research Area (ERA), in particular leading US and Japanese laboratories, which will facilitate the implementation of the construction phase as a global project. The proposed governance model is tailored accordingly and may pave the way for the organization of other global research infrastructures.\r\n\r\nHiLumi LHC will help to foster opportunities for the European industry to bid for contracts worth 300 M in innovative fields during the second half of this decade, and will establish the ERA as a focal point of a global research cooperation and a leader in frontier knowledge and technologies.','HUMAN','en',284404),(258,'Due to globalization and an enormous technological innovation cultures and languages are subject to extreme changes and many of them will become extinct in the coming decades and with them much knowledge about nature and history. Digital archives have been setup to preserve cultural and language materials for future generations, but also to serve as database for cross-linguistic research about how the human brain processes language.\nIn parallel CLARIN has finished its preparatory phase in which many suggestions have been worked out for example for proper standards, for proper preservation and access, and in which a network of persistent centers with different types of language material as the backbone of an emerging research infrastructure has started of being established.\n\nINNET wants (1) to intensify and extend the existing worldwide archiving grid, (2) to revitalize the existing expert network and (3) to intensify the use of archives not only by researchers but also by schools and the public. The intention is (1) to give the CLARIN center network a worldwide extension and impact, (2) to use the expert network to disseminate the CLARIN achievements and (3) to create a larger user base that will make use of the data stored in the CLARIN center network.','HUMAN','en',284415),(259,'The Collaborative EuropeaN Digital Archive Infrastructure (CENDARI) will provide and facilitate access to existing archives and resources in Europe for the study of medieval and modern European history through the development of an enquiry environment. This environment will increase access to records of historic importance across the European Research Area, creating a powerful new platform for accessing and investigating historical data in a transnational fashion overcoming the national and institutional data silos that now exist. \r\nIt will leverage the power of the European infrastructure for Digital Humanities (DARIAH) bringing these technical experts together with leading historians and existing research infrastructures (archives, libraries and individual digital projects) within a programme of technical research informed by cutting edge reflection on the impact of the digital age on scholarly practice.\r\nThe enquiry environment that is at the heart of this proposal will create new ways to discover meaning, a methodology not just of scale but of kind. It will create tools and workspaces that allow researchers to engage with large data sets via federated multilingual searches across heterogeneous resources while defining workflows enabling the creation of personalized research environments, shared research and teaching spaces, and annotation trails, amongst other features. This will be facilitated by multilingual authority lists of named entities (people, places, events) that will harness user involvement to add intelligence to the system. Moreover, it will develop new visual paradigms for the exploration of patterns generated by the system, from knowledge transfer and dissemination, to language usage and shifts, to the advancement and diffusion of ideas.','HUMAN','en',284432),(260,'We are aiming at studying a novel laser concept for High Energy Particle acceleration, known as CAN for Coherent Amplification Network that would guarantee high peak power and high average powers while exhibiting high efficiency, >30%. The approach is based on fibre amplification. The proposed technical evaluation will be performed by combining the expertise, know-how, and knowledge of a team of world leading experts coming from different horizons of optical science, technology and industry, including femtosecond fibre optics, instrumental optics, astronomy, manufacturing, and marketing.\r\nAlthough our primary target application will be particle acceleration for high-energy physics, our approach will have direct bearing on other fields. It will be done through conferences, workshops and meetings among the participants. Alongside those events mixing the laser and high energy physics communities, the ICAN project aims to identify and approach the Funding Agencies that may contribute to the construction of an infrastructure based on the ICAN concept.\r\nThe final outcome of the study will include an implementation plan and a road map pointing out the most significant technical roadblocks, proposed solutions, manufacturing methods, and lobbying strategies to increase international membership, awareness, market study and business plan.','HUMAN','en',284437),(261,'ESFRI initiatives with a need to work on a global scale will have to collaborate with international comparable partners. The CReATIVE-B project will seek to support the interaction between the LifeWatch ESFRI Research Infrastructure with RI on biodiversity and ecosystems research in other parts of the world. The immediate objective is to define a road map for interoperability on the technological level, on the governance level and on the interrelation with the scientific communities using the RIs. The project will therefore be a catalyst for worldwide collaboration in this field by supporting and initiating coordination activities of these RIs. The greater objective of this collaboration is to serve the goals of GEOSS. At the same time, the international outreach of LifeWatch can lead to further international collaboration on interoperability of these infrastructures to even better serve research communities worldwide. In order to do so, CReATIVE-B will initiate with the international \'sister\' infrastructures to have a second edition of the e-Biosphere conference, to be organized in 2013, and contribute to this conference. In achieving the goals of this coordination and support action, CReATIVE-B will further support the European Commission flagship, vision 2020.','HUMAN','en',284441),(262,'The ability to quantitatively analyze plant phenotypic traits (from single cells to plant and stand level) and their dynamic responses to the environment is an essential requirement for genetic and physiological research, and the cornerstone for enabling applications of scientific findings to bioeconomy. \r\n\r\nWhereas molecular profiling technologies allow today the generation of a large amount of data with decreasing costs largely due to automation and robotics, the understanding of the link between genotype and phenotype has progressed more slowly. Insufficient technical and conceptual capacity of the plant scientific community to probe existing genetic resources and unravel environmental effects limits faster progress in this field. The development of robust and standardized phenotyping applications depends on the availability of specialised infrastructure, technologies and protocols. Europe has become a key driver in defining innovative solutions in academic and industrial settings. However, the existing initiatives at the local or member-state level represent a fragmented research landscape with similar goals. \r\n\r\nThe aim of this project is to create synergies between the leading plant phenotyping institutions in Europe as a nucleus for the development of a strong European Plant Phenotyping Network (EPPN). The project fosters the development of an effective European infrastructure including human resources, expertise and communication needed to support transnational access to user communities. Joint research activities will adapt and develop novel sensors and methods for application in plant phenotyping. Innovative phenotyping concepts integrating mechanistic, medium- and high throughput as well as field phenotyping will be developed and made available to the community. This project will strengthen Europe\'s leading role in plant phenotyping research and application through the creation of a community of research institutes, universities, industry and SMEs.','HUMAN','en',284443),(263,'LASERLAB-EUROPE III is the European Consortium of major Laser Research Infrastructures, forming a FP7 Integrated Infrastructure Initiative. Geographically it covers the majority of European member states, following recent efforts to include partners from all over Europe 27. Scientifically, it covers many areas of laser science and applications with particular emphasis on short-pulses and high-intensities.\r\n\r\nRecently this field has experienced remarkable advances and breakthroughs in laser technologies and beam parameters. Novel applications range from coherent x-ray generation, laser particle acceleration, laboratory astrophysics, and attosecond physics to fusion research, materials research, and biomedicine, to name only few. Consequently and also as a sign of its exceptional internal coherence - the European laser community has engaged in the world\'s first truly international laser infrastructures, ELI and HiPER. Besides offering unprecedented research opportunities these infrastructures, together with the LASERLAB-EUROPE III Consortium, will substantially contribute to innovation and help addressing the grand societal challenges.\r\n\r\nThe main objectives are:\r\n- To maintain a competitive, inter-disciplinary network of European national laser laboratories;\r\n- To strengthen the European leading role in laser research through Joint Research Activities, pushing the laser concept into new directions and opening up new applications of key importance in research and innovation;\r\n- To engage in Transnational Access in a highly co-ordinated fashion for the benefit of the European research community;\r\n- To increase the European basis in laser research and applications by reaching out to neighbouring scientific communities and assisting in the development of laser research infrastructures on both the national and the European level, particularly the Pan-European infrastructures ELI and HiPER.','HUMAN','en',284464),(264,'Enhancing biomass utilization without risking its sustainability is a European energy priority, and can be linked to targets for curbing greenhouse gas emissions by 20% by 2020 and 50% by 2050: enhanced energy security and integration with other industrial sectors, such as agriculture, also play a role. Improved use of biofuels and products in advanced biomass conversion units and biorefineries are seen as a key element in achieving this goal. In recent years leading industrial nations have established facilities in which their researchers have addressed the challenges associated with the production of biofuels and the establishment of bio-refineries. There remains fragmentation in terms of access to high-level experimental equipment necessary for achieving significant advances in this field.\r\n\r\nThe BRISK initiative will integrate networking activities to foster a culture of co-operation between the participants in the project, and the scientific communities benefiting from access to the research infrastructures, with the pursuit of joint research activities, and facilitate transnational access by researchers to one or more infrastructures among those operated by participants in a coordinated way so as to improve the overall services available to the research communities with interests in these fields.','HUMAN','en',284498),(265,'InfraCoMP will establish efficient coordination mechanisms between the ESFRI project Infrafrontier and the International Mouse Phenotyping Consortium. Infrafrontier is a pan-European initative to build a sustainable research infrastructure for systemic phenotyping, archiving and distribution of mouse models of human diseases. The IMPC is a global project to carry out systemic phenotyping of mouse lines for each of the 20000 protein-coding genes of the mammalian genome. The IMPC will utilise the research infrastructure provided by Infrafrontier in Europe and similar resource around the globe. InfraCoMP will bring together all the relevant players of Infrafrontier and the IMPC in a series of joint workshops. These workshops will address central issues that have to be resolved to minimise redundancies, maximise mutual benefit and leverage the expertise and infrastructure capacity:\n- Mouse Phenotyping\n- Mouse Production, Archiving and Distribution\n- Access to Phenotyping Data\n- Community Engagement\nThe results of the workshops will be documented in meeting reports and publicised employing different communication means. InfraCoMP will support the development of a consistent policy for health research in the field of mouse models for human diseases. It will address the specific requirements of an international cooperation of Infrafrontier with the IMPC. Successful cooperaton between Infrafrontier and the IMPC, catalysed by InfraCoMP, will move forward the entire research field.','HUMAN','en',284501),(266,'The vision of SIM4RDM is to enable researchers to effectively utilise the emerging data infrastructures by ensuring that they have the knowledge, skills and support infrastructures necessary to adopt good research data management methodologies. SIM4RDM will achieve this by analysing existing funding programme interventions within member states and internationally, and producing models, evaluation frameworks and policy recommendations for both future national interventions as well as pan-European and International co-ordination.','HUMAN','en',284514),(267,'Key questions in physics can be answered only by constructing a giant underground observatory to search for rare events and study terrestrial and astrophysical neutrinos. The Astroparticle Roadmap of ApPEC/ASPERA strongly supports this, recommending that: a new large European infrastructure of 100\'000-500\'000 ton for proton decay and low-energy neutrinos be evaluated as a common design study together with the underground infrastructure and eventual detection of accelerator neutrino beams. The latest CERN roadmap also states: a range of very important non-accelerator experiments takes place at the overlap of particle and astroparticle physics exploring otherwise inaccessible phenomena; Council will seek with ApPEC a coordinated strategy in these areas of mutual interest. \r\n\r\nReacting to this, uniting scientists across Europe with industrial support to produce a very strong collaboration, the LAGUNA FP7 design study has had a very positive effect. It enabled, via study of seven pre-selected locations (Finland, France, Italy, Poland, Romania, Spain and UK), a detailed geo-technical assessment of the giant underground cavern needed, concluding finally that no geo-technical show-stoppers to cavern construction exist. Building on this, the present design study will address two challenges vital to making a final detector and site choice: (i) to determine the full cost of construction underground, commissioning and long-term operation of the infrastructure, and (ii) to determine the full impact of including long baseline neutrino physics with beams from CERN.','HUMAN','en',284518),(268,'The European Strategy Forum on Research Infrastructures (ESFRI) recognizes in its roadmap for Research Infrastructures that \"in the near future, hydrogen, as an energy carrier derived from a number of other fuels, and fuel cells, as energy transformers, are expected to play a major role, for mobile and stationary applications\". With the current fragmentation of the European R&D infrastructures and the uncoordinated approaches adopted, the demand for effective support of the Hydrogen and Fuel Cells (H2FC) technology developers cannot be satisfied. Therefore this proposal is built to integrate the European R&D community around rare and/or unique infrastructural elements that will facilitate and significantly enhance the R&D outcome. H2FCEuropean Infrastructure addresses the topic INFRA-2011-1.1.16 Research Infrastructures for H2FC Facilities and the related energy-chains, by bringing together, for the first time in Europe, the leading European R&D institutions of the H2 community together with those of the fuel cell community, covering the entire life-cycle of H2FC, i.e. hydrogen production, storage, distribution, and final use in fuel cells. The three pillars of the proposal are networking, transnational access and joint research activities. All are strongly interrelated and oriented towards the resolution of identified bottlenecks. The aim is to provide:\n- A single integrated virtual infrastructure accommodating H2FC test and analysis facilities\n\nTransnational access for the H2FC R&D communities to advanced infrastructures\n- Expert working groups to enhance work at the provided facilities and coordination in aspects of safety, performance and durability\n- Central databases and libraries for safety, performance and durability data and modelling codes\n- Coordination of relevant education and training actions\n- Integration, enhancement and improvement of the existing infrastructures\n- Coordination with national/international bodies and industrial activities','HUMAN','en',284522),(270,'The main objective of EuroRIs-Net+ is to provide value-added services, through the Network of NCPs for Research Infrastructures. These services will facilitate transnational cooperation of NCPs, promoting the effective implementation of the RI programme, highlighting opportunities offered by Research Infrastructures - at the European and international level - and their impact on e-science. The Network will develop observatory functions for EC and national Research Infrastructures policies, programmes and initiatives, supported by an efficient dialogue scheme for RI NCPs with the RI ecosystem and a sustainable and comprehensive RI Knowledge Repository. Specifically: Provision of high level services to our clients (RI scientific communities, industry and public stakeholders) and promotion of best RI NCP practices will be supported through training, peering and helpdesk activities for all RI NCPs, whereas development of systematic partnering activities will increase collaboration among RI stakeholders Increased visibility of the RI programme to all thematic areas of FP7 will empower and support bottom-up approaches for scientific and user communities in the RI programme, facilitated through cooperation with other NCP networks, with direct benefit on focused scientific communities. Moreover, the network will implement targeted dissemination activities to improve visibility of the projects services and the RI programme, contributing to the broader use of Research Infrastructures An interactive platform for communication among the Network, EC, RI policy bodies and RI stakeholders will constructively support policy design, through a dialogue - among RI ecosystem actors - which will facilitate diffusion of RI policy bodies recommendations to the relevant public authorities and, vice-versa, will permit collection and analysis of integrated data on countries participation in Research Infrastructures, to support, wherever possible, their integration within the ERA','HUMAN','en',284528);
